    "All picture settings will be reset to default. Are you sure you wish to continue?":["您的图像设置将恢复到出厂状态，是否继续？","All picture settings will be reset to default. Are you sure you wish to continue?","Bildeinstellungen werden zurückgesetzt. Wirklich fortfahren?","L'impostazione dell'immagine sarà resettata ai valori predefiniti. Sei sicuro di voler continuare?","A configuração da imagem será reposta para as predefinições. Tem a certeza que quer continuar?","La configuración de la imagen se restablecerá a los valores predeterminados. ¿Quiere continuar?","Les réglages de l'image seront réinitialisés par défaut. Voulez-vous continuer?","Bildeoppsettet vil bli tilbakestilt til standard. Er du sikker på at du vil fortsette?","Bildinställningarna återställs till standard. Är du säker på att du vill fortsätta?","Billedindstilling vil blive nulstillet til standard. Sikker på at du vil fortsætte?","Kuvan asetus palautetaan oletusasetukseen. Haluatko jatkaa?","Resim ayarı varsayılana sıfırlanacak. Devam etmeye emin misiniz?","سوف يتم إعادة تعيين الصورة إلى الوضع الافتراضي. هل تريد المتابعة؟","Настройки изображения будут сброшены к изначальным. Продолжить?","Thiết lập hình ảnh sẽ được cài đặt lại thành mặc định. Chắn chắn tiếp tục không?","การตั้งค่ารูปภาพจะถูกรีเซ็ตไปสู่ค่าเริ่มต้น คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","႐ုပ္ပံု သတ္မွတ္မႈကို မူရင္းပါသို႔ ျပန္သတ္မွတ္မည္။ ဆက္လုပ္မွာ ေသခ်ာလား?","Tasvir sozlamasi sukut bo'yicha qiymatga sozlanadi. Davom etmoqchi ekaningizga ishonchingiz komilmi?","चित्र की सेटिंग डिफाल्ट की सेटिंग पर वापस जाएगी. क्या आप करना चाहते हैं?","Налаштування картинки будуть скинуті в початкові. Продовжити?","Tetapan gambar akan diset semula kepada lalai. Pasti teruskan?","הגדרת התמונה תאופס לבררת מחדל. האם אתם בטוחים שתרצו להמשיך?","Nastavení obrazu se nastaví na výchozí hodnoty. Chcete pokračovat?","Nastavenie obrazu sa nastaví na predvolené hodnoty. Chcete pokračovať?","Zostaną przywrócone domyślne ustawienia obrazu. Czy chcesz kontynuować?","A kép beállításai visszaállnak az alapértelmezett állapotba. Biztosan folytatja?","Настройката на картината ще бъде върната до фабричния й вид. Сигурни ли сте, че желаете да продължите?","تنظیمات عکس به حالت پیش‌فرض بازنشانی خواهد شد. می‌خواهید ادامه دهید؟","Pengaturan gambar akan di-reset ke default. Anda yakin ingin melanjutkan?","N/A"],
