    "All sound settings will be reset to default. Are you sure you wish to continue?":["您的声音设置将恢复到出厂状态，是否继续？","All sound settings will be reset to default. Are you sure you wish to continue?","Die Toneinstellungen werden zurückgesetzt. Wirklich fortfahren?","L'impostazione del suono sarà resettata ai valori predefiniti. Sei sicuro di voler continuare?","A configuração do som vai ser reposta para a predefinição. Tem a certeza que pretende continuar?","La configuración del sonido restablecerá a los valores predeterminados. ¿Quiere continuar? ","Les réglages Audio seront réinitialisés par défaut. Voulez-vous continuer?","Lydoppsettet vil bli tilbakestilt til standard. Er du sikker på at du vil fortsette?","Ljudinställningar återställs till standard. Är du säker på att du vill fortsätta?","Lydindstilling vil blive nulstillet til standard. Sikker på at du vil fortsætte?","Äänen asetukset palautetaan oletusasetuksiin. Halutako jatkaa?","Ses ayarı varsayılana sıfırlanacak. Devam etmeye emin misiniz?","سوف يتم إعادة تعيين الصوت إلى الوضع الافتراضي. هل تريد المتابعة؟","Настройки звука будут сброшены к изначальным. Продолжить?","Thiết lập âm thanh sẽ được cài đặt lại thành mặc định. Chắn chắn tiếp tục không?","การตั้งค่าเสียงจะถูกรีเซ็ตไปสู่ค่าเริ่มต้น คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","အသံ သတ္မွတ္မႈကို မူရင္းပါသို႔ ျပန္သတ္မွတ္မည္။ ဆက္လုပ္မွာ ေသခ်ာလား?","Tovush sozlamasi sukut bo'yicha qiymatga sozlanadi. Davom etmoqchi ekaningizga ishonchingiz komilmi?","आवाज़ का सेट अप फिर से डिफ़ाल्ट में सेट हो जाएगा. आप करना चाहते हैं?","Налаштування звуку будуть скинуті в початкові. Продовжити?","Tetapan bunyi akan diset semula kepada lalai. Pasti teruskan?","הגדרות השמע הנוכחיות ישוחזרו להגדרות ברירת מחדל. האם אתה רוצה להמשיך?","Nastavení zvuku se nastaví na výchozí hodnoty. Chcete pokračovat?","Nastavenie zvuku sa nastaví na predvolené hodnoty. Chcete pokračovať?","Zostaną przywrócone domyślne ustawienia dźwięku. Czy chcesz kontynuować?","A hangbeállítások visszaállnak az alapértelmezett állapotba. Biztosan folytatja?","Настройката на звука ще бъде върната до фабричния й вид. Сигурни ли сте, че желаете да продължите?","تنظیمات صدا به حالت پیش‌فرض بازنشانی خواهد شد. می‌خواهید ادامه دهید؟","Pengaturan suara akan di-reset ke default. Anda yakin ingin melanjutkan?","N/A"],
