    "Entering setup wizard. Are you sure you wish to continue?":["即将进入开机导航，是否继续？","Entering setup wizard. Are you sure you wish to continue?","Installationsassistent wird gestartet. Wirklich fortfahren?","Avvio della configurazione iniziale in corso. Sei sicuro di voler continuare?","A entrar no assistente. Tem a certeza que quer continuar?","El asistente de instalación está a punto de comenzar. ¿Está seguro de que desea continuar?","L'assistant de configuration est sur le point de démarrer. Êtes-vous sûr de vouloir continuer?","Starter veiviser. Er du sikker på at du vil fortsette?","Öppnar guiden. Är du säker på att du vill fortsätta?","Går til guiden. Sikker på at du vil fortsætte?","Siirrytään ohjaukseen. Haluatko jatkaa?","Sihirbaza giriliyor. Devam etmeye emin misiniz?","دخول المعالج. تأكد من المتابعة؟","Вход в мастер настройки. Продолжить?","Đang nhập trình hướng dẫn. Chắn chắn tiếp tục không?","กำลังเข้าสู่ผู้ช่วยมหัศจรรย์ คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","အကူေဆာ့ဖ္ဝဲ ထည့္သြင္းေနသည္။ ဆက္လုပ္မလား?","Masterga kirish. Davom etmoqchi ekaningizga ishonchingiz komilmi?","विज़र्ड में प्रवेश. आगे बढ़ें?","Вхід до майстра. Продовжити?","Memasuki pendeta. Pasti teruskan?","נכנס לאשף. האם אתה בטוח שתרצה להמשיך?","Vstupní průvodce Chcete pokračovat?","Vstupný sprievodca Chcete pokračovať?","Uruchamianie kreatora. Czy chcesz kontynuować?","Belépés a varázslóba Biztosan folytatja?","Вход в съветника. Сигурни ли сте, че желаете да продължите?","ورود به ویزارد. ادامه می‌دهید؟","Memasuki penuntun. Anda yakin ingin melanjutkan?","N/A"],
