    "Note: Only SD cards and USB flash drives in FAT and FAT32 format are supported.":["注：仅支持FAT、FAT32格式的SD卡或U盘","Note: Only SD cards and USB flash drives in FAT and FAT32 format are supported.","Hinweis: Nur SD-Karten und USB-Geräte im FAT- und FAT32-Format werden unterstützt","Nota: Supporta solo scheda SD o memorie USB nel formato FAT e FAT32","Nota: Apenas suporta cartões SD e pens USB em formato FAT e FAT32","Nota: Este TV solo soporta Tarjetas SD y Memorias USB en formato FAT o FAT32","Important: Ce téléviseur ne supporte que les cartes SD ou clés USB formatés en FAT ou FAT32.","Merknad: Kun støtte for SD-kort og USB-minnepinne i FAT og FAT32-format","Obs: Stöder endast SD-kort och USB-minne i FAT- och FAT32-format","Bemærk: Kun støtte SD-kort og USB-flashdrev i FAT og FAT32 format","Huom:Laite tukee vain FAT ja FAT32 muodoissa olevaa SD-korttia ja USB-muistitikkua","Not: FAT ve FAT32 biçimlerinde yalnızca SD kart ve USB bellek aygıtı desteklenir","ملاحظة: فقط يدعم بطاقة SD ومحرك أقراص الـ USB ذات الصيغة FAT او FAT32","Примечание: Поддерживаются только SD карты и USB-накопители в форматах FAT и FAT32","Lưu ý: Chỉ hỗ trợ thẻ SD và ổ đĩa USB flash trong định dạng FAT và FAT32","หมายเหตุ: รองรับการ์ด SD และแฟลชไดร์ฟ์ USB ในฟอร์แม็ต FAT และ FAT32 เท่านั้น","မွတ္ခ်က္ : FAT ႏွင့္ FAT32 ပံုစံတို႔မွ SD ကဒ္ႏွင့္ USB သိုေလွာင္ပစၥည္းသာလွ်င္ ပံ့ပိုးသည္","Izoh: Faqat FAT va FAT32 formatdagi SD karta yoki USB flesh xotira qurilmasi qo'llab quvvatlanadi","नोट : केवल फ़ैट औऱ फ़ैट32 फ़ॉरमेट के ही एसडी कार्ड औऱ यूएसबी फ़्लैश ड्राईव चलेगी","Примітка: Підтримуються тільки SD карти і USB флешки у форматах FAT і FAT32","Nota: Hanya menyokong kad SD dan pemacu USB dalam format FAT dan FAT32","הערה: תומך רק בכרטיס SD וכונן USB בפורמטים של FAT ו- FAT32","Poznámka: Podporuje pouze SD karty a USB flash disk ve FAT a FAT32 formátu","Poznámka: Podporuje len SD karty a USB flash disk vo FAT a FAT32 formáte","Uwaga: Obsługiwane są tylko karty SD i pamięci USB w formacie FAT i FAT32","Megjegyzés: Csak SD kártyát és USB flash drive-ot támogat FAT és FAT32 formátumban","Забележка: Поддържа единствено SD карти и USB флаш устройства във формати FAT и FAT32.","نکته: تنها با پشتیبانی کارت حافظه و فلش USB در فرمت FAT و FAT32","Catatan: Hanya mendukung kartu SD dan flash disk USB dalam format FAT dan FAT32","N/A"],
