    "Restart may be required when changing device name":["自定义本机名称需要重启后才可能生效","Restart may be required when changing device name","Neustart des Geräts für die Übernahme des geänderten Gerätenamens erforderlich","Per rendere definitivo il nome è necessario riavviare.","É necesário reiniciar para que o nome personalizado do dispositivo tenha efeito. ","El nombre del dispositivo personalizado requiere reiniciar para tener efecto.","Le nom personnalisé s’affichera après le redémarrage du téléviseur.","Egendefinert enhetsnavn krever omstart for å tre i kraft.","Anpassade enheter måste startas om för att de ska gälla.","Den tilpassede enhedsnavn kræver genstart for at træde i kraft.","Kustomoitu laitenimi vaatii uudelleen käynnistämistä toimiakseen.","Özelleştirilmiş aygıt adı, etkinleşmek için tekrar başlatmayı gerektirir.","قد يتطلب اعادة تسمية الجهاز الى إعادة تشغيل التلفاز.","Чтобы имя устройства обновилось, необходимо выполнить перезагрузку.","Tên thiết bị tùy chỉnh yêu cầu khởi động lại để có hiệu lực.","ชื่อทีวีที่กำหนดเองจะต้องทำการรีสตาร์ตใหม่เพื่อให้มีผลบังคับใช้","စိတ္ႀကိဳက္ေပးထားသည့္ ကိရိယာ အမည္သည္ သက္ေရာက္မႈရွိေစရန္ ျပန္လည္စတင္မႈလိုအပ္သည္။","Alohida sozlangan qurilma nomi kuchga kirish uchun uni o'chirib yoqish kerak.","डिवाईस का नया नाम लागू करने के लिए फिर से चालू करें.","Щоб ім'я пристрою оновилося, необхідно виконати перезавантаження.","Nama peranti yang disesuaikan perlu dimulakan semula untuk berkesan.","שם המכשיר המותאם דורש איתחול כדי להיכנס לתוקף","Pro projevení vlastního názvu je potřebný restart.","Pre prejavenie sa vlastného názvu je potrebný reštart.","Wprowadzenie niestandardowej nazwy urządzenia wymaga ponownego uruchomienia.","A személyre szabott eszköznév érvényesítéséhez újraindítás szükséges.","За да влезе в сила персонализираното име на устройството, е необходимо то да бъде рестартирано.","باید بازنشانی کنید تا نام انتخاب‌شده برای دستگاه فعال شود.","Nama perangkat yang dikustom harus di-restart agar berubah.","N/A"],
