    "Reset will clear your personal setup and information. Are you sure you wish to continue?":["恢复出厂设置将会清空你的个人设置及个人信息，是否继续？","Reset will clear your personal setup and information. Are you sure you wish to continue?","Durch das Zurücksetzen werden alle persönlichen Einstellungen und Daten gelöscht. Wirklich fortfahren?","Il reset cancellerà le tue impostazioni personalizzate. Sei sicuro di voler continuare?","A reposição irá eliminar as configurações e informação pessoais. Tem a certeza que pretende continuar?","Restablecer borrará su configuración personal y la información. ¿Quiere continuar?","Restaurer les paramètre d’usines effacera vos informations et réglages personnels. Voulez-vous continuer?","Nullstilling vil fjerne personlig oppsett og informasjon. Er du sikker på at du vil fortsette?","Återställning kommer att ta bort dina personliga inställningar och information. Är du säker på att du vill fortsätta?","Reset rydde din personlige opsætning og information. Sikker på at fortsætte?","Resetointi poistaa henkilökohtaiset asetukset ja tiedot. Haluatko jatkaa?","Sıfırlama, kişisel ayar ve bilgilerinizi silecektir. Devam etmeye emin misiniz?","إعادة الضبط سوف يقوم بالغاء الإعدادات الشخصية والمعلومات. تأكد من المتابعة؟","Сброс настроек удалит ваши персональные настройки и информацию. Продолжить?","Cài đặt lại sẽ xóa thiết lập và thông tin cá nhân của qúy vị. Chắn chắn tiếp tục không?","การรีเซ็ตจะล้างการตั้งค่าและข้อมูลส่วนตัวของคุณ คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","ျပန္သတ္မွတ္ျခင္းသည္ သင္၏ ကိုယ္ေရး သတ္မွတ္ခ်က္ႏွင့္ အခ်က္အလက္ကို ရွင္းပစ္မည္။ ဆက္လုပ္မွာ ေသခ်ာလား?","Qayta tiklash natijasida shaxsiy sozlovlar va ma'lumotlar o'chiriladi. Davom etmoqchi ekaningizga ishonchingiz komilmi?","रिसेट करने से निजी सेटअप और सूचना मिट जाएगी. आगे बढ़ना चाहते हैं?","Скидання налаштувань зітре ваші персональні налаштування та інформацію. Продовжити?","Set semula akan mengosongkan tetapan peribadi dan maklumat anda. Pasti meneruskan?","שחזור יאפס את כל ההגדרה האישית שלכם. להמשיך בכל זאת?","Resetováním se vymažou vaše osobní nastavení a informace. Chcete pokračovat?","Resetovaním sa vymažú vaše osobné nastavenia a informácie. Chcete pokračovať?","Zresetowanie spowoduje usunięcie Twoich informacji i ustawień osobistych. Czy chcesz kontynuować?","A visszaállítás során elvesznek az egyéni beállításai iés adatai. Biztosan folytatja?","Връщането на настройките към фабричния им вид ще изтрие всички ваши настройки и цялата ви лична информация. Сигурни ли сте, че желаете да продължите?","تمامی تنظیمات شما پس از ریست کردن پاک خواهند شد. آیا ادامه می دهید؟","Reset akan menghapus informasi dan pengaturan pribadi. Anda yakin ingin melanjutkan?","N/A"],
