    "Never cut off AC to ensure effectiveness of settings.":["为保证设置生效，请勿交流断电","Never cut off AC to ensure effectiveness of settings.","Trennen Sie nie die Stromverbindung, um die Effektivität der Einstellungen sicherzustellen","Non interrompere mai l'AC per garantire il salvataggio delle impostazioni.","Não desligue da tomada para garantir a eficácia das definições.","Nunca corte la CA para garantizar la eficacia de los ajustes. ","Ne pas couper l'alimentation électrique afin de garantir la sauvegarde des réglages.","Ikke koble fra strømmen, for å ta vare på innstillingene.","Stäng aldrig av AC för att säkerställa inställningarnas effektivitet ","Sluk aldrig for strømmen, for at sikre effektiviteten af ​​indstillinger.","Älä koskaan katkaise vaihtovirtaa varmistaaksesi asetusten tehokkuutta.","Ayarların etkililiğini sağlamak için AC gücü asla kesmeyin.","لا تقطع التيار لضمان فعالية الإعدادات.","Не отключайте питание, чтобы настройки вступили в силу.","Không bao giờ tắt nguồn AC để đảm bảo giữ nguyên các cài đặt.","อย่าให้ไฟฟ้าดับเพื่อให้แน่ใจว่าการตั้งค่าจะมีผลบังคับใช้","သတ္မွတ္ခ်က္ သက္ေရာက္မႈမ်ား ရွိေစရန္ AC ကို မျဖဳတ္ပါႏွင့္။","Sozlamalar kuchga kirishini ta'minlash uchun hech qachon quvvatni uzmang.","सेटिंग्स को बचाने के लिए कभी एसी न काटें","Не вимикайте живлення, щоб налаштування вступили в силу.","Jangan sekali-kali memotong AC untuk memastikan keberkesanan tetapan.","לעולם אל תנתק את המכשיר מהחשמל כדי להבטיח את השפעת ההגדרות","Nikdy neodpojujte napájení pro zajištění účinnosti nastavení.","Nikdy neodpájajte napájanie pre zabezpečenie účinnosti nastavení.","Nigdy nie odcinaj zasilania, aby zapewnić skuteczność ustawień.","A beállítások érvényesítéséhez soha ne szakítsa meg a hálózati kapcsolatot.","За да се гарантира ефективността на настройките никога не прекъсвайте захранването.","برای اطمینان از انجام شدن تنظیمات، هرگز برق را قطع نکنید.","Jangan pernah memutus aliran listrik AC untuk melancarkan pengaturan.","N/A"],
