    "Please insert external storage device due to insufficient disk space.":["空间不足，请插入外置存储设备。","Please insert external storage device due to insufficient disk space.","Bitte schließen Sie ein externes Speichergerät an, weil nicht genügend Speicherplatz vorhanden ist. ","Si prega di inserire un dispositivo di archiviazione esterno, spazio su disco insufficiente.","Introduza um dispositivo de armazenamento externo devido à falta de espaço em disco.","Por favor, inserte el dispositivo de almacenamiento externo por la falta de espacio en disco. ","Merci d'insérer un dispositif de stockage externe, Espace de stockage interne insuffisant ","Ikke nok diskplass, koble til en ekstern lagringsenhet.","Vänligen sätt in extern lagringsenhet på grund av otillräckligt diskutrymme.","Indsæt ekstern lagerenhed på grund af utilstrækkelig diskplads.","Yhdistä ulkoiseen muistiin, koska laiteen muisti ei riitä.","Yetersiz disk alanından dolayı lütfen harici depolama aygıtı takın.","الرجاء إدخال جهاز تخزين خارجي لان المساحة على القرص غير كافية.","Подсоедините внешний накопитель, т.к. на диске не хватает места.","Xin vui lắp thêm thiết bị lưu trữ bên ngoài vì khoảng trống ổ đĩa không đủ.","กรุณาเสียบอุปกรณ์เก็บข้อมูลจากภายนอกเนื่องจากพื้นที่ว่างของดิสก์ไม่เพียงพอ","သိုေလွာင္ေနရာ မလံုေလာက္သည့္အတြက္ ျပင္ပ သိုေလွာင္ကိရိယာ ထည့္သြင္းပါ။","Xotira joyi yetarli emasligi bois tashqi xotira qurilmasini qo'ying.","डिस्क में जगह कम है कृप्या एक्सटर्नल स्टोरेज डिवाईस लगाएं","Підключіть зовнішній накопичувач, т.к. на диску не вистачає місця.","Sila masukkan peranti storan luaran kerana ruang cakera tidak mencukupi.","אנא הכנס מכשיר אחסון חיצוני עקב חוסר מקום פנוי בדיסק","Připojte prosím externí paměťové zařízení z důvodu nedostatku místa na disku.","Pripojte, prosím externé pamäťové zariadenie z dôvodu nedostatku miesta na disku.","Podłącz urządzenie pamięci masowej z powodu niewystarczającej ilości miejsca na dysku.","Helyezzen be külső tárolóeszközt, mivel a lemezen nincs elég hely.","Недостатъчно пространство на диска. Моля поставете външно устройство с памет.","حجم فعلی کافی نیست. لطفا از حافظه خارجی استفاده کنید.","Pasang perangkat memori eksternal karena memori hardisk tidak cukup.","N/A"],
