    "Invalid input value, please input again.":["输入值无效，请重新输入","Invalid input value, please input again.","Ungültiger Eingabewert, bitte erneut eingeben. ","Valore di input non valido, si prega di inserirlo nuovamente.","Valor de introdução inválido, tente novamente.","Valor de entrada no válido, vuelva a introducirlo.","La valeur entrée est non valide, merci de saisir une autre valeur.","Ugyldig verdi, tast inn på nytt.","Ogiltigt värde angiven, vänligen skriv in igen. ","Ugyldig input-værdi, indtast igen.","Virheelllinen syötön arvo, syötä uudelleen.","Geçersiz giriş değeri, lütfen tekrar girin.","قيمة المدخلات غير صالحة، يرجى الادخال مرة أخرى.","Неверное значение, попробуйте ещё раз.","Giá trị nhập không hợp lệ, vui lòng nhập lại.","ป้อนค่าไม่ถูกต้อง กรุณาป้อนใหม่","ထည့္သြင္း တန္ဖိုး မမွန္ပါ၊ ထပ္မံ ထည့္သြင္းပါ။","Kiritma qiymati noto'g'ri, boshqatdan kiriting. ","इनपुट वेल्यू गलत है, कृप्या फिर से इनपुट करें.","Невірне значення, спробуйте ще раз.","Nilai input tidak sah, sila input sekali lagi.","ערך קלט לא חוקי, אנא הכנס שנית","Neplatná vstupní hodnota, zadejte prosím znovu.","Neplatná vstupná hodnota, zadajte, prosím znova.","Wprowadzona wartość nieprawidłowa, wprowadź ponownie.","Érvénytelen bemeneti érték, adja meg újra.","Невалидна въведена стойност, моля опитайте отново.","ورودی نادرست، دوباره تلاش کنید.","Nilai input tidak valid, tulis lagi.","N/A"],
