    "For you to be able to use the station list \"XXX_1\" for the CA module \"XXX_2\", an automatic station search must be performed. Please specify when you wish to do this.":["","For you to be able to use the station list \"XXX_1\" for the CA module \"XXX_2\", an automatic station search must be performed. Please specify when you wish to do this.","Um Senderliste \"XXX_1\" für CA-Modul \"XXX_2\" zu verwenden, muss eine automatische Sendersuche durchgeführt werden. Legen Sie fest, wann Sie dies tun möchten.","Per poter essere in grado di utilizzare l'elenco delle stazioni \"XXX_1\" per il modulo CA \"XXX_2\", è necessario eseguire una ricerca automatica della stazione. Si prega di specificare se si desidera farlo.","Para ser capaz de usar a lista de estações \"XXX_1\" para o módulo AC \"XXX_2\", deve realizar uma busca automática de canais. Por favor, especifique quando desejar fazer isso. ","Para que sea capaz de utilizar la lista de emisoras \"XXX_1\" para el módulo AC \"XXX_2\", se debe realizar una búsqueda automática de emisoras. Especifique si desea hacerlo.","Afin que vous puissiez utiliser la liste de chaine \"XXX_1\" pour le module CAM \"XXX_2\", il faut effectuer une recherche automatique de chaines. Merci de spécifier quand vous souhaitez le faire.","For at du skal kunne bruke stasjonslisten \"XXX_1\" for BT-modul \"XXX_2\", må et automatisk stasjonssøk utføres. Vennligst oppgi når du ønsker å gjøre dette.","För att du ska kunna använda stationslistan \"XXX_1\" för VÅ modulen \"XXX_2\", måste en automatisk stationssökning utföras. Specificera när du vill göra detta. ","For at du skal blive i stand til at bruge stationslisten \"XXX_1\" til CA modulet \"XXX_2\", må en automatisk stationssøgning foretages. Specificer venligst, hvornår du ønsker at gøre dette.","Jotta pystyt käyttämään asemaluetteloa \"XXX_1\" CA-moduulia \"XXX_2\"varten, suorita automaattinen kanavahaku. Ilmoitathan kun haluat tehdä tämän.","XXX_2\" KE modülüne yönelik \"XXX_1\" istasyon listesini kullanabilmeniz için, bir otomatik istasyon araması gerçekleştirilmelidir. Lütfen bunu yapmak istediğiniz zamanı belirtin.","كي تكون قادرا على استخدام قائمة المحطات \"XXX_1\" لوحدة \"XXX_2\"، يجب إجراء عملية البحث التلقائي عن المحطات . يرجى تحديد هذا اذا كنت ترغب في القيام بذلك.","Чтобы использовать список станций \"XXX_1\" для модуля CA \"XXX_2\", необходимо выполнить автопоиск станций. Укажите, когда хотите сделать это.","Quý vị có thể sử dụng danh sách trạm \"XXX_1\" cho mô-đun CA \"XXX_2\", một sự tìm kiếm trạm tự động phải được thực hiện. Vui lòng xác nhận khi quý vị muốn làm điều này.","สำหรับให้คุณสามารถใช้รายชื่อสถานี \"XXX_1\" สำหรับโมดูล CA \"XXX_2\" จะต้องมีการค้นหาสถานีแบบอัตโนมัติ กรุณาระบุเวลาที่คุณต้องการกระทำ"," CA ေမာ္ဂ်ဴး \"XXX_2\" အတြက္ ဌာန စာရင္း \"XXX_1\" ကို သံုးႏိုင္ေစရန္ အလိုအေလ်ာက္ ဌာန ရွာေဖြမႈ လုပ္ေဆာင္ရမည္။ မည္သည့္အခ်ိန္တြင္ လုပ္လိုသည္ကို သတ္မွတ္ပါ။","\"XXX_2\" CA moduli uchun \"XXX_1\" stansiyalar ro'yxatidan foydalanish imkoniga ega bo'lishingiz uchun avtomatik tarzda stansiyalar izlash amalga oshirilishi kerak. Buni qachon amalga oshirmoqchiligingizni ko'rsating.","अगर आप सीए माडयूल \"XXX_2\" के लिए स्टेशन सूचि \"XXX_1\" का प्रयोग करना चाहते हैं, तो आटोमेटिक स्टेशन की खोज कीजे. कृप्या बताएं, कब करना चाहते हैं.","Щоб використовувати список станцій \"XXX_1\" для модуля CA \"XXX_2\", необхідно виконати автоматичний пошук станцій. Вкажіть, коли хочете робити це.","Bagi anda untuk dapat menggunakan senarai stesen \"XXX_1\" bagi modul CA \"XXX_2\", carian stesen automatik mesti dilakukan. Sila nyatakan apabila anda ingin melakukan ini.","כדי שתוכל להשתמש ברשימת התחנות \"XXX_1\" למודול CA \"XXX_2\", יבוצע חיפוש תחנות אוטומטית. אנא ציין מתי אתה מעוניין לעשות זאת","Pro možnost používat seznam stanic \"XXX_1\" pro modul CA \"XXX_2\", musí být provedeno automatické vyhledávání stanic. Uveďte, prosím, pokud tak chcete učinit.","Pre možnosť používať zoznam staníc \"XXX_1\" pre modul CA \"XXX_2\", musí byť vykonané automatické vyhľadávanie staníc. Uveďte, prosím, ak tak chcete učiniť.","Aby umożliwić użycie listy stacji „XXX_1” dla modułu CA „XXX_2”, należy wykonać automatyczne wyszukiwanie stacji. Proszę określić, kiedy chcesz to zrobić.","Ahhoz, hogy az \"XXX_1\" állomáslistát használhassa az \"XXX_2\" CA modulhoz, automatikus állomáskeresést kell végeznie. Jelezze, ha ezt kívánja tenni.","За да можете да използвате списъка на станциите \"XXX_1\" за модула CA \"XXX_2\", трябва да бъде извършено автоматично търсене на станции. Моля посочете кога искате да направите това.","برای اینکه بتوانید از لیست ایستگاه \"XXX_1\" برای ماژول CA \"XXX_2\" استفاده کنید، باید جستجوی خودکار ایستگاه انجام دهید. لطفا زمان انجام این کار را مشخص کنید.","Untuk menggunakan daftar stasiun \"XXX_1\" untuk modul CA \"XXX_2\", pencarian otomatis stasiun harus dilakukan. Tentukan kapan Anda ingin melakukannya.","N/A"],
