    "Here, please mark the signal sources you are able to receive, which are necessary for operating the CA module \"XXX_1\".":["","Here, please mark the signal sources you are able to receive, which are necessary for operating the CA module \"XXX_1\".","Markieren Sie hier die Signalquellen, die Sie empfangen können und die für den Betrieb des CA-Moduls \"XXX_1\" erforderlich sind.","Si prega di selezionare le sorgenti del segnale che si è in grado di ricevere, necessarie per il funzionamento del modulo CA \"XXX_1\".","Por favor, marque aqui as fontes de sinal que você é capaz de receber, que são necessários para o funcionamento do módulo AC \"XXX_1\". ","Aquí marque las fuentes de señal que pueden recibir, que son necesarias para el funcionamiento del módulo de AC \"XXX_1\".","Merci de selectionner ici, les sources que vous pouvez recevoir, qui sont nécessaires pour l'usage du module CAM \"XXX_1\".","Vennligst merk av her signalkildene du kan motta, som er nødvendige for å bruke BT-modulen \"XXX_1\".","Här, markerar signalkällan som du kan motta, som är nödvändigt för att använda VÅ modulen \"XXX_1\".","Marker venligst her de stationer, som du kan modtage, som er nødvendige for at køre CA modulet \"XXX_1\".","Merkitse ne signaalilähteet joita vastaanotat ja jotka ovat välttämättömiä CA-moduuli \"XXX_1\" toimintaa varten.","Burada, \"XXX_1\" KE modülünü çalıştırmak için gerekli olan, alabildiğiniz sinyal kaynaklarını işaretleyin.","هنا، يرجى وضع علامة على مصدر الإشارة التي يمكنك إستقبالها والتي هي ضرورية لتشغيل وحدة CA الـ\"XXX_1\"","Отметьте источники сигнала, которые можете принимать, это необходимо для работы модуля CA \"XXX_1\".","Dưới đây, xin vui lòng đánh dấu các nguồn tín hiệu qúy vị có thể nhận được, đó là cần thiết cho hoạt động của mô-đun CA \"XXX_1\".","ตอนนี้ กรุณาทำเครื่องหมายแหล่งกำเนิดสัญญาณที่คุณสามารถรับเข้าได้ ซึ่งจำเป็นสำหรับการทำงานของโมดูล CA \"XXX_1\"","ဤေနရာတြင္ သင္ လက္ခံရရွိႏိုင္သည့္ အခ်က္ျပ ရင္းျမစ္မ်ားကို မွတ္သားပါ၊ ၄င္းတို႔သည္ CA ေမာ္ဂ်ဴး \"XXX_1\" လုပ္ေဆာင္ရန္အတြက္ လိုအပ္သည္။","Bu yerda, \"XXX_1\" CA moduli ishlashi uchun zarur bo'lgan signal manbalarini belgilang.","कृप्या यहां प्राप्त सिगनल स्रोत को चुनें, जो सीए माडयूल \"XXX_1\" को चलाने के लिए ज़रूरी हैं.","Відзначте джерела сигналу, які можете приймати, це необхідно для роботи модуля CA \"XXX_1\".","Di sini, sila tandakan sumber isyarat yang anda boleh menerima, yang perlu untuk mengendalikan modul CA \"XXX_1\".","כאן, סמן את מקורות האיתות שאתה יכול לקבל, הדרושים להפעלת מודול CA \"XXX_1\"","Zde označte, prosím, zdroje signálu které jste schopni přijímat, a které jsou nezbytné pro provoz modul CA \"XXX_1\".","Tu označte, prosím, zdroje signálu ktoré ste schopní prijímať, a ktoré sú nevyhnutné pre prevádzku modul CA \"XXX_1\".","Tutaj należy wskazać źródła sygnałów, które możesz odbierać, co jest niezbędne do działania modułu CA „XXX_1”.","Kérjük, jelölje meg az Ön által fogható jelforrásokat, amelyek az \"XXX_1\" CA modul működéséhez szükségesek.","Моля тук маркирайте източниците на сигнал, които получавате, и които са необходими за работата на модула CA \"XXX_1\".","لطفا منابع سیگنال که قادر به دریافت آن هستید و برای اجرای ماژول CA \"XXX_1\" لازم هستند را مشخص کنید.","Di sini, tandai sumber sinyal yang dapat diterima untuk mengoperasikan modul CA \"XXX_1\"","N/A"],
    "The \"XXX_1\" CA module's \"XXX_2\" station list is being sorted and saved.":["","The \"XXX_1\" CA module's \"XXX_2\" station list is being sorted and saved.","Die Senderliste \"XXX_2\" für CA-Modul \"XXX_1\" wurde sortiert und gespeichert.","La lista delle stazioni \"XXX_2\" del modulo CA \"XXX_1\" è stata selezionata e salvata.","XXX_2 lista de canais do módulo AC \"XXX_1\" está a ser classificada e guardada.","La lista de estaciones \"XXX_2\" del módulo de AC \"XXX_1\" está siendo ordenada y guardada.","La liste de chaine \"XXX_2\" du module AC \"XXX_1\" est classée et sauvegardée.","\"XXX_1\"-BT-modulens \"XXX_2\"- stasjonsliste blir sortert og lagret.","\"XXX_1\" VÅ modulens \"XXX_2\" stationslista håller på att sorteras och sparas."," \"XXX_1\" CA modulets \"XXX_2\" stationsliste bliver sorteret og gemt. "," \"XXX_1\" CA-moduulin \"XXX_2\" asemalistaa lajitellaan ja tallennetaan.","XXX_1\" KE modülünün \"XXX_2\" istasyon listesi sıralanıyor ve kaydediliyor.","تم حفظ وتخزين الـ\"XXX_1\" الخاص بوحدة CA الـ\"XXX_2\".","Список станций \"XXX_2\" модуля CA \"XXX_1\" отсортирован и сохранен.","Danh sách trạm \"XXX_2\" của mô-đun CA \"XXX_1\" đang được sắp xếp và lưu lại.","รายชื่อสถานี \"XXX_2\" ของโมดูล CA \"XXX_1\" ถูกเรียงลำดับและบันทึกไว้แล้ว","\"XXX_1\" CA ေမာ္ဂ်ဴး၏ \"XXX_2\" ဌာန စာရင္းကို စီစဥ္ၿပီး သိမ္းေနသည္။","\"XXX_1\" CA modulining \"XXX_2\" stansiyasi saralanib, saqlanyapti.","\"XXX_1\" सीए माडयूल की \"XXX_2\" स्टेशन सूचि को सुरक्षित किया जा रहा","Список станцій \"XXX_2\" модуля CA \"XXX_1\" відсортовано і збережено.","Modul CA \"XXX_1\" senarai stesen \"XXX_2\" sedang disusun dan disimpan.","רשימת התחנות \"XXX_2\" של מודול CA \"XXX_1\" ממויינת ושמורה","Seznam stanic \"XXX_2\" CA modulu \"XXX_1\" je tříděný a uložen.","Zoznam staníc \"XXX_2\" CA modulu \"XXX_1\" je triedený a uložený.","Lista stacji „XXX_2” modułu CA „XXX_1” jest sortowana i zapisywana.","Az \"XXX_1\" CA modul \"XXX_2\" állomáslistája rendezés és mentés alatt van.","Списъкът със станции \"XXX_2\" на модул СА \"XXX_1\" се сортира и съхранява.","لیست ایستگاه \"XXX_2\" ماژولهای CA \"XXX_1\" در حال مرتب و ذخیره شدن است. ","Daftar stasiun \"XXX_2\" modul CA \"XXX_1\" sedang diurutkan dan disimpan.","N/A"],
    "Please wait …":["请稍后","Please wait …","Bitte warten...","Attendere prego…","Por favor aguarde…","Por favor, espere...","Veuillez patienter …","Vennligst vent...","Vänligen vänta…","Vent venligst…","Ole hyvä ja odota…","Lütfen bekleyin...","يرجى الانتظار ...","Подождите...","Vui lòng đợi...","กรุณารอ…","ေက်းဇူးျပဳ၍ ေစာင့္ပါ…","Kutib turing…","कृप्या इंतेजार करें","Зачекайте...","Sila tunggu ...","המתן בבקשה...","Čekejte, prosím ...","Čakajte, prosím ...","Proszę czekać…","Kérjük, várjon...","Моля изчакайте…","لطفا صبر کنید...","Silakan tunggu …","N/A"],
