    "Being recording or shifting. Do you want to stop?":["正在录制或时移，是否停止？","Being recording or shifting. Do you want to stop?","Aufnahme oder T.Shift aktiv. Beenden?","Vuoi fermare la registrazione in corso?","Continuar a gravação ou alterar. Deseja parar?","Grabando o cambiando. ¿Parar? ","En cours d'enregistrement ou de TimeShift. Voulez-vous arrêter?","I opptak eller tidsinnstilling. Ønsker du å stoppe?","Spelar in eller växla. Ska det stoppas?","Under optagelse eller skift. Stoppe?","Tallennus tai vaihto. Haluatko pysäyttää?","Kaydediliyor ya da kaydırılıyor. Durdurmak istiyor musunuz?","يجري التسجيل أو النقل. هل تريد أن تتوقف؟","Выполняется запись или буферизация. Хотите остановить?","Đang được ghi lại hoặc thay đổi. Quý vị muốn dừng không?","กำลังบันทึกหรือหยุดเวลา คุณต้องการหยุดหรือไม่","မွတ္တမ္းတင္ (သို႔) ကူးေျပာင္း ေနသည္။ ရပ္မလား?","Yozyapti yoki vaqtni suryapti. To'xtatmoqchimisiz?","रिकार्ड या शिफ़्ट हो रहा. क्या रोकना चाहते हैं?","Виконується запис або зсув. Хочете зупинити?","Sedang dalam rakaman atau beralih. Adakah anda mahu berhenti?","כעת בתהליך הקלטה או היסט זמן. האם ברצונך להפסיק?","Nahrává se nebo se časově posouvá. Chcete zastavit?","Nahráva sa alebo sa časovo posúva. Chcete zastaviť?","Trwa nagrywanie lub Time Shift. Czy chcesz przerwać?","Felvétel vagy eltolás (shifting) Le akarja állítani?","В момента се извършва записване или изместване. Желаете ли да прекратите операцията?","در حال ضبط یا تبدیل. متوقف شود؟","Sedang direkam atau dipindah. Anda ingin menghentikannya?","N/A"],
