    "Adjust the Aspect Ratio to stretch or zoom in on your picture.":["","Adjust the Aspect Ratio to stretch or zoom in on your picture.","Bildseitenformat einstellen, um das Bild zu strecken oder zu vergrößern.","Regola le proporzioni per allungare o ingrandire l'immagine.","Ajuste a proporção para esticar ou zoom em uma foto sua.","Ajustar la relación de aspecto para expandir o hacer zoom en la imagen.","Régler le format de l’image pour étirer ou agrandir votre image.","Juster formatforholdet for å strekke eller zoome bildet.","Justera bildformatet för att zooma ut eller in på din bild.","Juster smærmforholdet for strække eller zoome ind på billedet.","Säädä kuvasuhdetta kuvan venyttämiseksi tai suurentamiseksi.","Görüntüyü uzatmak ya da yakınlaştırmak için En Boy Oranını ayarlayın.","ضبط نسبة الطول الى العرض لتمديد أو تكبير الصورة.","Подберите такое соотношение сторон, чтобы картинка поместилась на экране.","Điều chỉnh Tỷ Lệ Co để thu hoặc phóng hình ảnh của quý vị","ปรับอัตราส่วนภาพเพื่อลดขนาดหรือซูมเข้าบนภาพของคุณ","သင့္႐ုပ္ပံုတြင္ ျပန္႔ကားေစရန္ (သို႔) ပံုႀကီးခ်ဲ႕ရန္ ႐ႈေထာင့္ အခ်ဳိး ညႇိပါ။","Tasvirni cho'zish yoki kattalashtirish uchun bo'y va en nisbatini sozlang.","चित्र को ज़ूम करने के लिए एस्पेक्ट रेशियो को एडजस्ट करें","Підберіть таке співвідношення сторін, щоб картинка помістилася на екрані.","Laraskan Nisbah Aspek untuk meregangkan atau mengezum masuk pada gambar anda.","כוון את יחס הרוחב והגובה כדי למתוח או להגדיל את התמונה שלך","Nastavení poměru stran roztažením nebo zvětšením vašeho obrázku.","Nastavenie pomeru strán roztiahnutím alebo zväčšením vášho obrázku.","Dostosuj proporcje obrazu, aby rozciągnąć lub przybliżyć oglądany obraz.","Állítsa be a nézet arányt a kép nyújtásához vagy a ráközelítéshez.","Настройване на пропорциите за увеличаване или разтягане на картината.","برای کشیدن یا بزرگنمایی تصویر خود، نسبت ابعاد را تنظیم کنید.","Menyetel Rasio Aspek untuk memperlebar atau memperbesar gambar.","N/A"],
