    "Adjust the Hue, Saturation and Brightness of colour settings.":["","Adjust the Hue, Saturation and Brightness of colour settings.","Farbton, Sättigung und Helligkeit von Farbeinstellungen konfigurieren.","Regola tono, saturazione e luminosità delle impostazioni colore.","Ajuste o matiz, saturação e brilho de configurações de cor.","Ajustar el tono, la saturación y el brillo de la configuración del color.","Régler la teinte, la saturation et la luminosité des paramètres de couleur.","Justere fargetone, metning og lysstyrke i fargeinnstillingene.","Justerar nyans, mättnad och ljusstyrka för färginställningar.","Juster farvetone, farvemætning og lysstyrke i farveindstillingerne.","Säädä värisävyn, kylläisyyden ja kirkkauden asetuksia.","Renk ayarlarının Tonunu, Doygunluğunu ve Parlaklığını ayarlayın.","ضبط الصبغة، والتشبع والسطوع الخاصة بإعدادات الألوان.","Отрегулируйте настройки оттенка, насыщенности и яркости цвета.","Điều chỉnh Màu Sắc, Độ Bão Hòa và Độ Sáng của các cài đặt màu sắc,","ปรับค่าเฉดสี ความอิ่มตัวและความสว่างของการตั้งค่าสีได้","အေရာင္သတ္မွတ္ခ်က္မ်ား၏ အေရာင္၊ အေရာင္စံုမႈႏွင့္ ေတာက္ပမႈတို႔ကို ညႇိပါ။","Tus, To'yinganlik va Yorqinlik kabi rang sozlamalarini sozlang.","कलर सेटिंग्स के रंग घटाने बढ़ाने औऱ हलका करने आदि के लिए एडजस्ट करें","Відрегулюйте налаштування відтінку, насиченості і яскравості кольору.","Laraskan Hue, Ketepuan dan Kecerahan tetapan warna.","כוון את הגדרות הגוון, רוויה ובהירות הצבע","Nastavení odstínu, sytosti a jasu nastavení barev.","Nastavenie odtieňu, sýtosti a jasu nastavenia farieb.","Dostosuj odcień, nasycenie i jasność kolorów.","Állítsa be a színbeállítások árnyalatát, telítettségét és élénkségét.","Регулиране на нюанса, наситеността и яркостта на цветовите настройки.","سایه، غلظت و روشنایی رنگ را تنظیم می‌کند.","Menyetel Rona Warna, Saturasi dan Kecerahan warna.","N/A"],
