    "Select the colour you want to adjust.":["","Select the colour you want to adjust.","Wählen Sie die einzustellende Farbe aus.","Seleziona il colore da regolare","Seleccione a cor que deseja ajustar","Seleccionar el color que desea ajustar.","Sélectionner la couleur que vous souhaitez régler.","Velg fargen du ønsker å justere.","Välj färgen som du vill justera.","Vælg den farve, du vil justere.","Valitse väri, jota haluat säätää.","Ayarlamak istediğiniz rengi seçin.","اختيار اللون الذي تريد ضبطه.","Выберите цвет, который хотите настроить.","Lựa chọn màu mà quý vị muốn điều chỉnh.","เลือกสีที่คุณต้องการปรับ","သင္ညႇိလိုသည့္ အေရာင္ကို ေရြးပါ။","Sozlamoqchi bo'lgan rangni tanlang.","एडजस्ट करने के लिए रंग चुनें","Виберіть колір, який хочете налаштувати.","Pilih warna yang anda mahu untuk menyesuaikan diri.","בחר את הצבעים שאתה רוצה להתאים","Zvolte barvu kterou chcete nastavit.","Zvoľte farbu ktorú chcete nastaviť.","Wybierz kolor, który chcesz dostosować.","Válassza ki a beállítani kívánt színt.","Изберете цвета, който желаете да настроите.","رنگی که می‌خواهید تنظیم کنید را انتخاب کنید.","Pilih warna yang ingin Anda sesuaikan.","N/A"],
