    "Adjust the green and red tone of the colour you select.":["","Adjust the green and red tone of the colour you select.","Justieren Sie den grünen und roten Ton der ausgewählten Farbe.","Regola i toni del verde e del rosso del colore selezionato.","Ajuste o tonalidade verde e vermelha da cor que pretende selecionar.","Ajustar el tóner verde y rojo del color seleccionado. Should be: Ajustar el tono verde y rojo del color seleccionado.","Régler la teinte du vert et rouge de la couleur que vous avez sélectionné.","Juster grønne og røde fargetoner for ønsket farge.","Justerar den gröna och röda tonern på färgen som du väljer.","Juster de grønne og røde toner for den farve, du vælger.","Säädä valitsemasi värin punainen ja vihreä sävy.","Seçtiğiniz rengin yeşil ve kırmızı tonlayıcısını ayarlayın.","ضبط الصبغة (الأخضر والأحمر) من الالوان التي اخترتها.","Подстройте зеленую и красную составляющие цвета, который выбрали.","Điều chỉnh tông màu xanh lá và đỏ của màu sắc quý vị chọn.","ปรับโทนสีเขียวและสีแดงของสีที่คุณเลือก","သင္ေရြးထားသည့္အေရာင္၏ အစိမ္းႏွင့္ အနီ ညႇိခ်က္ကို ခ်ိန္ညႇိပါ။","Tanlangan rangingizning yashil va qizil tonerini sozlang.","चुने हुए रंग के हरे औऱ लाल टोनर को एडजस्ट करें.","Підстройте зелену і червону складові кольору, який обрали.","Laraskan toner hijau dan merah dengan warna yang anda pilih.","כוון את הגוון הירוק והאדום של הצבע שאתה בוחר","Nastavení zelené a červené vámi zvolené barvy.","Nastavenie zelenej a červenej vami zvolenej farby.","Dostosuj natężenie barwy zielonej i czerwonej wybranego koloru.","Állítsa be a kiválasztott szín zöld és piros árnyalatait.","Регулиране на зелените и червени нюанси на цвета, който сте избрали.","سایه قرمز و سبز رنگ انتخابی‌تان را تنظیم می‌کند.","Menyetel toner hijau dan merah di warna yang Anda pilih.","N/A"],
