    "Adjust the intensity of red, green and blue lights to view the true colours of all images in the picture.":["","Adjust the intensity of red, green and blue lights to view the true colours of all images in the picture.","Stellen Sie die Intensität von rotem, grünem und blauem Licht ein, um die echten Farben aller Bilder anzuzeigen.","Regola l'intensità delle luci rosse, verdi e blu per mostrare i colori naturali delle immagini.","Ajuste a intensidade das luzes vermelhas, verdes e azuis para ver as verdadeiras cores de todas as imagens na imagem.","Ajustar la intensidad de las luces rojas, verdes y azules para ver los verdaderos colores de todas las imágenes en la imagen.","Régler l'intensité des lumières rouges, vertes et bleues pour afficher les véritables couleurs de tous les points de l'image.","Still inn intensiteten for rødt, grønt og blått lys, for å vise sanne farger for alle bildene på skjermen.","Justerar intensiteten av de röda, gröna och blåa ljus för att se de rätta färgerna av alla föremål i bilden.","Juster intensiteten af ​​rødt, grønt og blåt lys for at se de korrekte farver for alle billeder i billedet.","Luonnollisten värien saamiseksi kuvaan, säädä punaisen, vihreän ja sinisen valon voimakkuutta.","Görüntüdeki tüm ögelerin gerçek renklerini görebilmek için kırmızı, yeşil ve mavi ışık ayarlarının yoğunluğunu ayarlayın.","ضبط شدة الأضواء الحمراء والخضراء والزرقاء لعرض الألوان الحقيقية للصورة.","Настройте уровень красного, зеленого и синего цветов, чтобы получить естественное изображение.","Điều chỉnh cường độ của ánh sáng đỏ, xanh lá cây và màu xanh lam để xem các màu sắc thật sự của tất cả các hình ảnh trong bức tranh.","ปรับความเข้มของสีของภาพเพื่อการมองดูสีจริงของภาพทั้งหมดในรูป","႐ုပ္ပံုတြင္ ပံုရိပ္အားလံုး၏ မူရင္း အေရာင္မ်ား ျမင္ေတြ႕ရရန္ အနီ၊ အစိမ္းႏွင့္ အျပာေရာင္ အလင္းမ်ား ျပင္းအားကို ညႇိပါ။","Tasvirdagi haqiqiy ranglarni ko'rish uchun qizil, yashil va ko'k yorug'lik intensivligini sozlang.","चित्रों के अच्छे रूप के लिए लाल, हरे औऱ नीली लाईटों के रंग को कम ज्यादा करें","Відрегулюйте інтенсивність червоного, зеленого і синього, щоб отримати натуральні кольори на зображенні.","Melaraskan keamatan lampu merah, hijau dan biru untuk melihat warna sebenar semua imej dalam gambar.","כוון את החוזק של האורות האדומים, ירוקים וכחולים כדי לראות את הצבעים האמיתיים של כל הדמויות בתמונה","Nastavení intenzity červeného, zeleného a modrého světla pro zobrazení skutečných barev všech snímků na obrázku.","Nastavenie intenzity červeného, zeleného a modrého svetla pre zobrazenie skutočných farieb všetkých snímok na obrázku.","Dostosuj intensywność barwy czerwonej, zielonej i niebieskiej, aby uzyskać rzeczywiste kolory na wszystkich wyświetlanych obrazach.","Állítsa be a vörös, zöld és a kék fények intenzitását, ahhoz, hogy a képernyőn megjelenő képek valódi színeit láthassa.","Регулиране на интензитета на червените, зелените и сините светлини за по-истински цветове на всички изображения върху екрана.","شدت نورهای قرمز، سبز و آبی را در همه تصاویر تنظیم می‌کند.","Menyetel intensitas cahaya merah, hijau dan biru untuk melihat warna semua gambar sebenarnya.","N/A"],
