    "Restore the 10-point White Balance settings to default values.":["恢复10点白平衡到出厂状态下","Restore the 10-point White Balance settings to default values.","Die Einstellungen des 10-Punkt Weißabgleichs werden zurückgesetzt.","Ripristina le impostazioni del bilanciamento del bianco a 10 punti ai valori predefiniti di fabbrica.","Restaurar as configurações de equilíbrio de branco de 10 pontos para os valores padrão de fábrica.","Restaurar los ajustes de balance de blancos de 10 puntos a los valores predeterminados.","Restaurer les paramètres de balance des blancs 10-points aux valeurs par défaut.","Gjenopprette 10-punkts hvitbalanseinnstillinger til fabrikkinnstillinger.","Återställa 10-punkt vit balans inställningarna till standardvärdena.","Gendan indstillingerne for den 10-punkts hvidbalance til standardværdier.","Palauta 10-point Valkotasapainon asetukset oletusarvoisiksi.","10 Nokta Beyaz Dengesinin ayarları varsayılan olarak geri yüklenecek.","استعادة ضبط توازن اللون الأبيض 10 نقاط إلى القيم الافتراضية للمصنع.","Восстановить баланс белого по 10-ти точкам в заводские настройки по умолчанию.","Khôi phục các cài đặt Cân Bằng Trắng 10-điểm về các giá trị mặc định của nhà sản xuất.","คืนค่าการตั้งค่าสมดุลสีขาว 10 จุดไปสู่ค่าเริ่มต้น","၁၀-ပြိဳင့္ အျဖဴေရာင္ ဟန္ခ်က္ သတ္မွတ္ခ်က္မ်ားကို စက္႐ံုထုတ္ မူရင္းပါ တန္ဖိုးမ်ားသို႔ ျပန္သိမ္းပါ။","10 darajali oq balansi sozlamalarini sukut bo'yicha qiymatlariga qayta tiklang.","10- प्वाईंट वहाईट बैलेंस सेटिंग्स को वापस डिफाल्ट वेल्यूज़ में ले जाएं","Відновити баланс білого по 10-ти точках у заводські налаштування.","Simpan semula 10 mata tetapan Imbangan Putih kepada nilai piawai.","שחזר את הגדרות 10 נקודות האיזון הלבן לערכי ברירת המחדל","Obnoví nastavení 10-bodového vyvážení bílé na výchozí hodnoty od výrobce.","Obnoví nastavenie 10-bodového vyváženia bielej na predvolené továrenské hodnoty.","Przywróć ustawienia 10-punktowego balansu bieli do wartości domyślnych.","Állítsa vissza a 10 pontos fehéregyensúly beállításokat az alapértelmezett értékekre.","Възстановяване на настройките за десет точков баланс на бялото до фабричните им стойности.","بازگرداندن تنظیمات بالانس سفید 10 نقطه‌ای به مقادیر پیش‌فرض کارخانه.","Pulihkan pengaturan Imbangan Putih 10-poin ke nilai default.","N/A"],
