    "Change the video size settings to slightly crop the edges of the displayed image.":["","Change the video size settings to slightly crop the edges of the displayed image.","Ändern Sie die Videogröße, um die Ränder des angezeigten Bildes etwas abzuschneiden.","Cambia le impostazioni del formato video per ritagliare i bordi dell'immagine visualizzata.","Altere as configurações de tamanho de vídeo para cortar um pouco as bordas da imagem exibida.","Cambiar la configuración de tamaño de video para recortar ligeramente los bordes de la imagen visualizada.","Modifie les paramètres de format de vidéo pour découper légèrement les bords de l'image affichée.","Endre innstillinger for videostørrelsen til å beskjære kantene av bildet som vises.","Ändra videostorleksinställningarna för att något beskära kanterna på den visade bilden.","Ændring af video-indstillingerne til beskære kanterne på det viste billede lidt.","Muuta videon kokoa kuvan reunoja rajaamalla.","Ekrandaki görüntünün köşelerini hafifçe kırpmak için video boyutunun ayarlarını değiştirin.","تغيير إعدادات حجم الفيديو لاقتصاص قليلا من حواف الصورة المعروضة.","Измените размер видео, чтобы слегка обрезать края изображения.","Thay đổi các cài đặt kích thước video để cắt một chút các cạnh của hình ảnh hiển thị.","เปลี่ยนแปลงการตั้งค่าขนาดวิดีโอไปสู่การจับขอบเล็กน้อยของภาพที่แสดงออกมา","ျပ႐ုပ္၏ အနားစြန္မ်ား အနည္းငယ္ တိျဖတ္ရန္ ဗီဒီယို အရြယ္ သတ္မွတ္ခ်က္မ်ား ေျပာင္းပါ။","Ekrandagi tasvir chekkalarini ozroq qirqqan holda video o'lcham sozlamalarini o'zgartiring.","स्क्रीन पर दिखने वाली एमेज को हल्का क्राप करने के लिए विडियो साईज़ सेटिंग्स को बदलें","Змініть розмір відео, щоб злегка обрізати краї зображення.","Tukar tetapan saiz video untuk sedikit tanaman tepi imej yang dipaparkan.","שנה את הגדרות גודל הוידאו כדי לחתוך קצת מקצוות התמונה המוצגת","Změní nastavení velikosti videa pro mírné oříznutí okrajů zobrazovaného obrazu.","Zmení nastavenia veľkosti videa pre mierne orezanie okrajov zobrazovaného obrazu.","Zmień ustawienia rozmiaru wideo, aby delikatnie przyciąć krawędzie wyświetlanego obrazu.","Módosítsa a a videó méret beállításokat a megjelenített kép széleinek kisebb levágásához.","Промяна на настройките за размера на видеото с цел леко изрязване на ръбовете на показваното изображение.","تنظیمات اندازه ویدئو را به اندازه‎ای تغییر دهید که کناره‌های تصویر متناسب با اندازه صفحه نمایش شود.","Mengubah pengaturan ukuran video agar sedikit memotong tepian gambar yang ditampilkan.","N/A"],
