    "Select the TV speaker or an external speaker for sound output.":["设置电视扬声器或者外置扬声器的输出","Select the TV speaker or an external speaker for sound output.","TV-Lautsprecher oder externen Lautsprecher für die Wiedergabe auswählen.","Seleziona le casse TV o le casse esterne per l'uscita audio.","Seleccione a coluna de TV ou um alto-falante externo para saída de som.","Seleccionar el altavoz del televisor o un altavoz externo para la salida de sonido.","Sélectionner les haut-parleurs du téléviseur ou un haut-parleur externe pour la sortie audio.","Velg TV-høyttaler eller en ekstern høyttaler som lydkilde.","Välj TV-högtalaren eller en extern högtalare för ljudet.","Vælg TV-højttaleren eller en ekstern højttaler til lydoutput.","Valitse TV:n kaiuttimet tai ulkoiset kaiuttimet äänen ulostuloon.","Ses çıkışı için TV Hoparlörünü ya da harici bir hoparlörü seçin.","حدد سماعة التلفزيون أو مكبر صوت الخارجي لإخراج الصوت.","Выберите динамик ТВ или внешний динамик для вывода звука.","Lựa chọn loa TV hoặc một loa bên ngoài cho đầu ra âm thanh.","เลือกลำโพงของทีวีหรือลำโพงภายนอกสำหรับเสียงเอาท์พุต","အသံထြက္ရန္ TV စပီကာ (သို႔) ျပင္ပ စပီကာတစ္လံုးကို ေရြးပါ။","Tovush chiqishi uchun televizor karnayi yoki tashqi karnayni tanlang.","साउंड आउटपुट के लिए टीवी स्पीकर या एक्सटरनल स्पीकर चुनें","Виберіть динамік ТВ або зовнішній динамік для виведення звуку.","Pilih pembesar suara TV atau penceramah luar untuk output bunyi.","בחר את רמקול הטלוויזיה או רמקול חיצוני בשביל פלט קול","Zvolte reproduktor TV nebo externí reproduktor pro výstup zvuku.","Zvoľte reproduktor TV alebo externý reproduktor pre výstup zvuku.","Wybierz głośnik telewizora lub zewnętrzny głośnik jako wyjście dźwięku.","Válassza a TV hangszóróját vagy külső hangszórót a hangtovábbításhoz.","Избор на високоговорител на телевизора или външен високоговорител за възпроизвеждане на звук.","برای خروجی صدا بلندگوی تلویزیون یا بلندگوی خارجی را انتخاب کنید.","Pilih speaker TV atau speaker eksternal untuk output suara.","N/A"],
