    "Select the digital audio output format that best suits the audio device type.":["","Select the digital audio output format that best suits the audio device type.","Wählen Sie das digitale Audiowiedergabeformat je nach Typ des Audiogeräts aus.","Seleziona il miglior formato di uscita audio digitale in funzione del tipo di dispositivo collegato. ","Selecione o formato de saída de áudio digital que melhor se adequa ao tipo de dispositivo de áudio.","Seleccionar el formato de salida de audio digital que mejor se adapte al tipo de dispositivo de audio.","Sélectionner le format de sortie audio numérique qui convient le mieux au type de périphérique audio utilisé.","Velg et format for digital lydutgang som passer best for lydenheten.","Välj det digitala ljudutgångsformaten som bäst passar ljudenheten. ","Vælg det digitale lydudgangs-format, der passer bedst lydenhedens type.","Valitsedigitaalisen äänen ulostuloformaatti, joka parhaiten sopii äänilaitteen tyyppiin.","Ses cihazınızın türüne en uygun olan dijital ses çıkış biçimini seçin.","حدد تنسيق إخراج الصوت الرقمي الذي يناسب نوع جهاز الصوت.","Выберите формат цифрового аудиовыхода, который соответствует типу аудиоустройства.","Chọn định dạng ngõ ra âm thanh kỹ thuật số phù hợp nhất với các loại thiết bị âm thanh.","เลือกรูปแบบเอาท์พุตเสียงดิจิตอลที่เหมาะสมกับประเภทอุปกรณ์เสียงที่สุด","ေအာ္ဒီယို ပစၥည္းအမ်ဳိးအစားႏွင့္ အေကာင္းဆံုး ကိုက္ညီသည့္ ဒစ္ဂ်က္တယ္ ေအာ္ဒီယို အထြက္ပံုစံကို ေရြးပါ။","Audio qurilma turiga eng mos bo'lgan raqamli audio chiqish formatini tanlang.","ऑडियो डिवाईस टाईप के लिए डिजिटल ऑडियो आउटपुट वाले फारमेट को चुनें","Виберіть формат цифрового аудіовиходу, який відповідає типу аудіопристрою.","Pilih format audio output digital yang paling sesuai dengan jenis peranti audio.","בחר את פלט השמע הדיגיטלי המתאים ביותר לסוג מכשיר השמע","Zvolte formát digitálního audio výstupu který nejlépe vyhovuje typu audio zařízení.","Zvoľte formát digitálneho audio výstupu ktorý najlepšie vyhovuje typu audio zariadenia.","Wybierz format wyjściowy dźwięku cyfrowego, który najlepiej odpowiada danemu typowi urządzenia audio.","Válassza azt a digitális audio kimenet formátumot, amely leginkább megfelel az audio eszköz típusának.","Избор на цифров аудио изход, който най-добре съответства на вида аудио устройство.","خروجی صدای دیجیتال متناسب با نوع دستگاه صوتی را انتخاب کنید.","Memilih format output audio digital yang paling cocok dengan jenis perangkat Audio Anda.","N/A"],
