    "Adjust the digital audio output delay time to sync sound from an external speaker with the images on the TV.":["","Adjust the digital audio output delay time to sync sound from an external speaker with the images on the TV.","Einstellung der Verzögerungsdauer für die digitale Audiowiedergabe, um den Ton eines externen Lautsprechers mit den Bildern des Fernsehers zu synchronisieren.","Regola il ritardo dell'uscita audio digitale per sincronizzare l'audio delle casse esterne con le immagini della TV.","Ajuste o tempo de atraso de saída de áudio digital para sincronizar o som de um alto-falante externo com as imagens na TV.","Ajustar el tiempo de retardo de salida de audio digital para sincronizar el sonido de un altavoz externo con las imágenes en el televisor.","Régler le délai de temporisation de sortie pour synchroniser le son d'un haut-parleur externe avec le téléviseur.","Still inn forsinkelse på digital lydutgang for å synkronisere lyden fra en ekstern høyttaler med bildene på TV-skjermen.","Justera den digitala ljudutgångens fördröjningstid till att synka ljud från en extern högtalare med bilderna på TV:n. ","Indstil den digitale lydudgansgs forsinkelse for at synkronisere lyden fra en ekstern højttaler med billederne på fjernsynet.","Kohdista digitaalinen ääni vastaamaan kuvaa. ","TV ekranındaki görüntü ile harici bir hoparlörden gelen sesi senkronize etmek için dijital ses çıkışının gecikme süresini ayarlayın.","ضبط تأخير الصوت الرقمي في وقت الإخراج لمزامنة الصوت مع مكبر الصوت الخارجي و الصور على شاشة التلفزيون.","Настройте задержку цифрового аудиосигнала, чтобы синхронизировать звук с внешнего динамика с ТВ изображением.","Điều chỉnh thời gian trễ ngõ ra âm thanh kỹ thuật số sang âm thanh đồng bộ hóa từ một loa ngoài với các hình ảnh trên TV.","ปรับการหน่วงเวลาเอาท์พุตของเสียงดิจิตอลเพื่อซิงค์เข้ากับเสียงจากลำโพงภายนอกกับภาพบนจอทีวี","TV ေပၚမွ ႐ုပ္ပံုမ်ားႏွင့္ ျပင္ပ စပီကာတစ္လံုးမွ အသံခ်ိန္ညႇိရန္ ဒစ္ဂ်က္တယ္ ေအာ္ဒီယို အထြက္ ေနာက္က်ခ်ိန္ကို ညႇိပါ။","Tashqi karnaydan chiquvchi tovushni televizordagi tasvirlar bilan sinxronlash uchun raqamli audio chiqishi kechikish vaqtini sozlang.","डिजिटल ऑडियो आउटपुट डिले टाईम को अक्सटरनल स्पीकर की आवाज़ से सिंक करके टीवी पर इमेज से मिलाएं","Налаштуйте затримку цифрового аудіосигналу, щоб синхронізувати звук з зовнішнього динаміка і зображення на ТВ.","Melaraskan masa tunda audio output digital untuk menyegerakkan bunyi daripada pembesar suara luaran dengan imej-imej pada TV.","כוון את זמן פלט השמע הדיגיטלי כדי לסנכרן קול מרמקול חיצוני עם תמונות על הטלוויזיה","Nastaví čas zpoždění digitálního audio výstupu pro synchronizaci zvuku z externího reproduktoru se snímky na televizoru.","Nastaví čas oneskorenia digitálneho audio výstupu pre synchronizáciu zvuku z externého reproduktora so snímkami na televízore.","Dostosuj czas opóźnienia wyjścia dźwięku cyfrowego, aby zsynchronizować dźwięk z zewnętrznych głośników z obrazami na telewizorze.","Állítsa be a digitális audio kimenet késleltetési idejét, hogy a külső hangszóróból érkező hangot a TV-n megjelenő képekhez igazítsa.","Регулиране на забавянето във времето на цифровия аудио изход за синхронизиране на звука от външните говорители с образите на телевизора.","تاخیر خروجی صدای دیجیتال را طوری تنظیم کنید که صدای بلندگوی خارجی با تصویر تلویزیون همگام باشد.","Menyetel waktu jeda output audio digital untuk mensinkronkan suara dari speaker eksternal dengan gambar pada TV.","N/A"],
