    "Skip a channel that your TV picked up during a previous channel scan search.":["在搜索到的频道列表中选择一个频道进行跳过","Skip a channel that your TV picked up during a previous channel scan search.","Sender überspringen, die bereits während einer früheren Sendersuche gefunden wurden.","Ignora un canale che il TV ha selezionato durante una ricerca canali precedente. ","Ir de um canal que a sua TV possuí durante uma pesquisa de exploração para o canal anterior.","Omitir un canal que el televisor recogió durante una búsqueda anterior de canales.","Ignorer une chaîne que votre téléviseur a sélectionné lors d'une recherche de chaîne antérieure.","Hopp over en kanal som ble funnet under tidligere kanalsøk.","Hoppa över en kanal som din TV hittade under en tidigare kanalskanning. ","Springover en kanal, som dit TV tidligere har fundet ifm. en scanning efter kanaler","Ohittaa kanavan, jonka TV vastaanottimesi löysi edellisen haun yhteydessä.","Bir önceki kanal taraması esnasında TV'nizin bulmuş olduğu bir kanalı atlayın.","تجاهل القتوات التي عثر عليها التلفزيون خلال البحث السابق.","Телевизор ищет только новые каналы, пропуская все уже найденные во время последнего поиска.","Bỏ qua một kênh TV quý vị chọn trong quá trình quét kênh trước đó.","ข้ามช่องรายการที่ทีวีของคุณเลือกขึ้นมาในระหว่างการค้นหาสแกนช่องรายการก่อนหน้านี้","ယခင္ ခ်န္နယ္လိုင္း ရွာေဖြမႈတြင္ သင့္ TV ေရြးထားသည္ ခ်န္နယ္လိုင္းတစ္ခုကို ေက်ာ္သြားပါ။","Oldingi galgi kanallar skanerlash izlovi davomida televizor tanlagan kanalni o'tkazib yuboring.","पिछले चैनल स्कैन में टीवी द्वारा रखे गए चैनल को छोड़ें","Пропускає канал, який ТВ знайшов під час останнього сканування каналів.","Langkau saluran TV anda meningkat pada carian imbas saluran sebelumnya.","דלג על ערוץ שהטלוויזיה שלך מצאה במהלך חיפוש ערוצים קודם","Vynechat kanál, který váš televizor našel během předchozího vyhledávání kanálů.","Vynechať kanál, ktorý váš televízor našiel počas predchádzajúceho vyhľadávania kanálov.","Pomiń kanał, który został znaleziony podczas poprzedniego wyszukiwania.","A korábbi csatornapásztázás során a TV által felvett csatorna átugrása.","Пропускане на канал, който е бил избран от вашия телевизор при предишно сканиране.","از کانالی که تلویزیون در اسکن کانال قبلی یافته است پرش کنید.","Melewati saluran yang ditangkap oleh TV Anda selama pemindaian saluran sebelumnya.","N/A"],
