    "Quickly access your most-watched channels by creating a Favourites list.":["","Quickly access your most-watched channels by creating a Favourites list.","Erstellen Sie eine Favoritenliste für den schnellen Zugriff auf die meist gesehenen Sender.","Accesso rapido alla lista dei canali più visti attraverso la creazione di una lista preferiti.","Acesse rapidamente seus canais mais assistidos através da criação de uma lista de Favoritos.","Acceder rápidamente a los canales que más ve mediante la creación de una lista de favoritos.","Accéder rapidement à vos chaînes préférées en créant une liste de favoris.","Få rask tilgang til de mest sette kanalene ved å opprette en favorittliste.","Få snabbt tillgång över dina mest tittade kanaler genom att skapa en favoritlista. ","Få hurtig adgang til dine mest sete kanaler ved at oprette en favoritliste","Saat nopean pääsyn useimmin katsottuihin kanaviin luomalla pikavalikkon suosikkikanaviisi.","Bir Favorilerim Listesi oluşturarak en çok izlediğiniz kanallara hızlıca ulaşın.","الوصول بسرعة الى قنواتك الأكثر مشاهدة من قبل إنشاء قائمة المفضلة.","Быстрый доступ к наиболее часто просматриваемым каналам.","Nhanh chóng truy cập các kênh được xem nhiều nhất của mình bằng cách tạo ra một Danh sách yêu thích.","เข้าถึงอย่างเร็วของช่องรายการที่คุณรับชมมากที่สุดโดยการสร้างรายการช่องโปรด","ႏွစ္သက္ရာမ်ား စာရင္းတစ္ခုဖန္တီးၿပီး သင္ အၾကည့္ဆံုး ခ်န္နယ္လိုင္းမ်ား အျမန္ သြားလာၾကည့္႐ႈပါ။","Sevimlilar ro'yxatini yaratish orqali ko'p ko'radigan kanallaringizga tezda o'ting.","फेवरिट्स सूचि बना लें जिससे अपने सबसे अधिक देखे चैनलों तक जल्दी पहुंचें","Створивши список обраного, ви зможете швидко вибирати канали, які найчастіше переглядаються.","Cepat mengakses saluran paling menonton anda dengan mewujudkan satu senarai Kegemaran.","כנס במהירות לרשימת הערוצים שצפית בהם הכי הרבה על ידי יצירת רשימת מועדפים","Rychlý přístup k nejsledovanějším kanálům vytvořením Seznamu oblíbených.","Rýchly prístup k najsledovanejším kanálom vytvorením Zoznamu obľúbených.","Uzyskaj szybki dostęp do najczęściej oglądanych kanałów poprzez stworzenie Listy ulubionych.","A Kedvencek létrehozásával a legtöbbet nézett csatornák gyors elérését teszi lehetővé.","Бърз достъп до най-гледаните от вас канали чрез създаване на списък с любими.","با ایجاد لیست علاقه‌مندی‌ها به کانال‌های مورد علاقه‌تان دسترسی سریع‌تر داشته باشید.","Mengakses dengan cepat saluran yang paling sering Anda tonton dengan membuat daftar Favorit.","N/A"],
