    "Set up the network to gain full access of Smart TV features.":["设置网络后体验智能电视的更多功能","Set up the network to gain full access of Smart TV features.","Einrichtung des Netzwerks für einen vollständigen Zugriff auf die Smart TV Funktionen.","Configura la rete per avere accesso completo alle funzionalità Smart.","Configurar a rede para obter acesso completo aos recursos da Smart TV.","Configurar la red para tener acceso completo a las funciones del TV Inteligente.","Configurer votre accès réseau pour obtenir un accès complet aux fonctionnalités Smart TV.","Sett opp nettverket for å få full tilgang til Smart TV-funksjoner.","Ställ in nätverket för att få fullt tillgång till Smart TV-funktioner. ","Indstil netværket til at få fuld adgang til Smart TV-funktionerne.","Määritä verkko, jotta pääsisit käyttämään Smart TV:n ominaisuuksia koko laajuudessaan.","Smart TV özelliklerinin tümüne erişmek için bir ağ bağlantısı kurun.","إعداد الشبكة للوصول الكامل الى ميزات التلفزيون الذكية.","Настройка сети для получения полного доступа к функциям Смарт ТВ.","Cài đặt mạng để đạt được quyền truy cập đầy đủ các tính năng TV thông minh.","ตั้งค่าเครือข่ายเพื่อให้ได้รับการเข้าถึงอย่างเต็มที่ของคุณสมบัติสมาร์ททีวี","စမတ္ TV လကၡဏာရပ္မ်ား အျပည့္အဝ ရရွိႏိုင္ရန္ ကြန္ယက္ တပ္ဆင္ပါ။","Smart TV funksiyalaridan to'liq foydalanish imkoniyatiga ega bo'lish uchun tarmoqni sozlang.","स्मार्ट टीवी फीचर्स को पूरी तरह पाने के लिए नेटवर्क सेटअप करें","Налаштуйте мережу так, щоб отримати повний доступ до функцій Смарт ТВ.","Sediakan rangkaian untuk mendapatkan akses penuh ciri-ciri TV Pintar.","הגדר את הרשת כדי לקבל גישה מלאה לתכונות של הטלוויזיה החכמה","Nastavte síť a získejte plný přístup k funkcím Smart TV.","Nastavte sieť a získajte plný prístup k funkciám Smart TV.","Skonfiguruj ustawienia sieci, aby uzyskać pełny dostęp do funkcji Smart TV.","Állítsa be a hálózatot, az okostévé valamennyi funkciójának eléréséhez.","Настройване на мрежата за получаване на пълен достъп до функциите на смарт телевизора.","برای دسترسی کامل به قابلیت‌های تلویزیون هوشمند تلویزیون خود را تنظیم کنید.","Mengatur jaringan agar mendapat akses penuh dari fitur Smart TV.","N/A"],
