    "Turn the Internet connection On or Off.":["调整网络连接的开关","Turn the Internet connection On or Off.","Internetverbindung ein- oder ausschalten.","Attiva o disattiva la connessione a Internet.","Gire a conexão com a Internet Activar ou Desativar.","Activar o desactivar la conexión a Internet.","Activer ou Désactiver la connexion Internet.","Slå Internett-forbindelsen på eller av.","Slå på eller av internetanslutningen.","Tænd eller sluk for internetforbindelsen.","Aseta Internet yhteys Päälle/Pois.","İnternet Bağlantısını Açın ya da Kapatın","تحويل الاتصال بالإنترنت الى تشغيل أو إيقاف.","Включить или выключить подключение к интернету.","Bật hoặc Tắt kết nối Internet.","เปิดหรือปิดการเชื่อมต่ออินเตอร์เน็ต","အင္တာနက္ ခ်ိတ္ဆက္မႈ ဖြင့္ပါ (သို႔) ပိတ္ပါ။","Internetga ulanishni yoqing yoki o'chiring.","इंटरनेट कनेक्शन को आन या आफ करें","Увімкнути або вимкнути підключення до інтернету.","Hidupkan sambungan Internet Aktif atau Tak aktif.","הדלק או כבה את חיבור את האינטרנט","Zapněte nebo vypněte připojení k Internetu.","Zapnite alebo vypnite pripojenie k Internetu.","Włącz lub wyłącz połączenie internetowe.","Kapcsolja be vagy ki az internet csatlakozást.","Включване или изключване на Интернет връзката.","اتصال اینترنتی را روشن یا خاموش کنید.","Menghidupkan atau mematikan koneksi Internet","N/A"],
