    "View information about your network connection.":["浏览您的网络信息","View information about your network connection.","Informationen über Ihre Netzwerkverbindung anzeigen.","Visualizza informazioni sulla connessione di rete.","Ver informações sobre a sua conexão de rede.","Ver información sobre su conexión de red.","Afficher les informations concernant votre connexion réseau.","Vis informasjon om nettverkstilkoblingen.","Se information om din nätverksanslutning","Se oplysninger om din netværksforbindelse.","Näytä verkkoyhteyden tiedot","Ağ bağlantınız ile ilgili bilgileri görüntüleyin.","عرض معلومات حول اتصال الشبكة الخاص بك.","Посмотреть информацию о сетевом подключении.","Xem thông tin kết nối mạng của quý vị.","ดูข้อมูลเกี่ยวกับการเชื่อมต่อเครือข่ายของคุณ","သင့္ကြန္ယက္ ခ်ိတ္ဆက္မႈအေၾကာင္း အခ်က္အလက္ကို ၾကည့္႐ႈပါ။","Tarmoqqa ulanish haqidagi ma'lumotni ko'ring. ","अपने नेटवर्क कनेक्शन के बारे में जानकारी देखें","Подивитися інформацію про мережеве підключення.","Lihat maklumat mengenai sambungan rangkaian anda.","הצגת מידע אודות החיבור לרשת שלך","Zobrazení informací o vašem připojení k síti.","Zobrazenie informácií o vašom pripojení k sieti.","Zobacz informacje o Twoim połączeniu sieciowym.","Hálózati csatlakozással kapcsolatos információ megtekintése","Преглед на информацията за връзката с мрежата.","اطلاعات مربوط به اتصال شبکه را مشاهده کنید.","Melihat informasi koneksi jaringan.","N/A"],
