    "The custom name will be available after restarting the TV.":["","The custom name will be available after restarting the TV.","Der benutzerdef. Name erscheint nach dem Neustart des Fernsehers.","Il nome personalizzato verrà reso disponibile al riavvio del TV.","O nome personalizado estará disponível após reiniciar a TV.","El nombre personalizado aparecerá después de reiniciar el televisor.","Le nom personnalisé s’affichera après le redémarrage du téléviseur.","Det egendefinerte navnet vil være tilgjengelig etter en omstart av TV-apparatet.","Det anpassade namnet kommer att finnas tillgängligt efter omstart av TV:n.","Det brugerdefinerede navn vil være til rådighed efter at TV'et er genstartet.","Mukautettu nimi on käytettävissä TV:n uudelleenkäynnistyksen jälkeen.","TV'niz yeniden başladıktan sonra belirlediğiniz isim görünür olacaktır.","سيكون اسم متاح بعد إعادة تشغيل جهاز التلفزيون.","Ваше имя будет активно после перезапуска ТВ.","Tên tùy chỉnh sẽ có sau khi khởi động lại TV.","ชื่อที่กำหนดเองจะมีให้ใช้งานหลังจากรีสตาร์ตทีวี","TV ျပန္စၿပီးေနာက္ အသံုးျပဳသူအမည္ ရရွိႏိုင္မည္။","Alohida qo'yilgan nom televizorni qayta ishga tushirgandan so'ng paydo bo'ladi.","नया नाम टीवी फिर से चलाने पर उपलब्ध होगा","Змінене ім'я буде активно після перезапуску ТВ.","Nama tersesuai boleh didapati selepas memulakan semula TV.","השם המותאם אישית יהיה זמין לאחר הדלקה מחדש של הטלוויזיה","Vlastní název bude k dispozici po restartování televizoru.","Vlastný názov bude k dispozícii po reštartovaní televízora.","Niestandardowa nazwa będzie dostępna po ponownym uruchomieniu telewizora.","A személyre szabott név a TV újraindítását követően válik elérhetővé.","Потребителското име ще бъде налично след рестартиране на телевизора.","نام سفارشی پس از راه‌اندازی مجدد تلویزیون نمایش داده خواهد شد.","Nama kustom akan tersedia setelah TV di-restart.","N/A"],
    "Choose the location from where you will watch your TV.":["","Choose the location from where you will watch your TV.","Wählen Sie den Standort, an dem Sie fernsehen.","Scegli il luogo da cui stai guardando la TV.","Escolha o local de onde vai assistir TV.","Seleccionar la ubicación desde donde verá el TV.","Merci de choisir l'emplacement où se situe votre téléviseur.","Velg plasseringen for TV-apparatet.","Välj platsen från var du vill se på TV. ","Vælg den placering, hvorfra du vil se dit TV.","Valitse sijainti, jossa TV:ta katsellaan.","TV'nizi kullanacağınız bölgeyi seçin.","اختيار موقع منه ستتمكن من مشاهدة التلفزيون الخاص بك.","Выберите регион, где вы смотрите ТВ.","Chọn vị trí từ đó quý vị sẽ xem TV của quý vị.","เลือกตำแหน่งที่ตั้งจากสถานที่ที่คุณรับชมทีวีของคุณ","သင္ TV ၾကည့္႐ႈမည့္ေနရာမွ အရပ္ေဒသကို ေရြးပါ။","Telvizoringizni tomosha qiladigan joyni tanlang.","वह जगह चुनें जहां से आप टीवी देखेंगे","Виберіть місце, з якого будете дивитися ТВ.","Pilih lokasi dari mana anda akan menonton TV anda.","בחר את המיקום ממנו תצפה בטלוויזיה שלך","Vyberte zemi, odkud budete sledovat televizi.","Zvoľte krajinu, odkiaľ budete sledovať televízor.","Wybierz lokalizację, w której będziesz oglądać telewizję.","Válassza ki azt a helyszínt, ahonnan a TV-t nézni fogja.","Изберете местоположението, от което използвате вашия телевизор.","مکان تماشای تلویزیون را انتخاب کنید.","Pilih lokasi Anda akan menonton TV.","N/A"],
