    "Select whether to apply Daylight Savings Time to the TV.":["","Select whether to apply Daylight Savings Time to the TV.","Legen Sie fest, ob die Sommerzeit für den Fernseher verwendet werden soll.","Seleziona se si vuole applicare l'ora legale.","Seleccione se pretende aplicar a hora de verão para a TV.","Seleccionar si desea aplicar el horario de verano al TV.","Sélectionner si vous voulez appliquer l'heure d'été sur votre téléviseur.","Velg om du vil bruke sommer/vintertid.","Välj om du vill tillämpa sommartid till TV:n.","Vil du anvende sommertid på tv'et.","Valitse otetaanko kesäaika käyttöön.","Yaz Saatinin TV'nize uygulanıp uygulanmayacağını belirleyin.","تحديد تفعيل تطبيق التوقيت الصيفي على التلفزيون.","Укажите, нужно ли использовать летнее время в ТВ.","Lựa chọn xem có áp dụng Thời Gian Tiết Kiệm Ánh Sáng Ngày cho TV không.","เลือกว่าจะใช้การประหยัดเวลากลางวันกับทีวีหรือไม่","TV တြင္ ေန႔ခင္းအလင္း ေခြ်တာခ်က္ အခ်ိန္ က်င့္သံုးမႈရွိမရွိ ေရြးပါ။","Televizorga yozgi vaqtga o'tishni qo'llash yoki qo'llamaslikni tanlang.","टीवी पर डेलाईट सेविंग्स समय लागू करने के लिए चुनें","Вкажіть, чи потрібно використовувати літній час в ТВ.","Pilih sama ada untuk memohon Siang Simpanan Masa ke TV.","בחר האם ברצונך ליישם זמן שעון קיץ על הטלוויזיה","Zvolte, zda chcete používat na vašem televizoru letní čas.","Zvoľte, či chcete používať na vašom televízore letný čas.","Wybierz czy stosować czas letni w ustawieniach TV.","Válassza ki, hogy alkalmazza-e nyári időszámításnak megfelelő időt a TV-n.","Избор за прилагане на лятно и зимно часово време на телевизора.","گزینه صرفه‌جویی در زمان نور روز را فعال یا غیرفعال کنید.","Menerapkan waktu Daylight Savings ke TV.","N/A"],
