    "Set the date and time to automatically sync with the TV software server or cable provider.":["","Set the date and time to automatically sync with the TV software server or cable provider.","Datum und Uhrzeit für die autom. Synchronisation mit dem TV-Softwareserver oder Kabelanbieter einstellen.","Imposta la data e l'ora per sincronizzarsi automaticamente col server del TV o col provider via cavo.","Defina a data e hora para sincronizar automaticamente com o servidor de software da TV por cabo.","Configurar la fecha y la hora para sincronizar automáticamente con el servidor de software de televisión o el proveedor de cable.","Réglage de la date et l'heure pour une synchronisation automatique via un serveur internet","Angi dato og klokkeslett for automatisk synkronisering med serveren for TV-programvaren eller kabelleverandøren.","Ställ in datum och tiden för att automatiskt synkronisera med TV-programvaraservern eller kabelleverantören.","Indstil dato og tid til automatisk at synkronisere med TV-softwarens server eller kabeludbyderen.","Asettaa päivämäärän ja ajan automaattisesti tahdistumaan palvelintarjoajan tai kaapelitarjoajan mukaan.","TV yazılım sunucusu ya da kablolu yayın sağlayıcısından tarihi ve saati otomatik olarak senkronize ederek ayarlayın.","ضبط التاريخ والوقت للمزامنة مع خادم برامج التلفزيون أو مزود الكابل تلقائيا.","Установите дату и время для автоматической синхронизации с ТВ программным сервером или с провайдером кабельного ТВ.","Cài đặt ngày và thời gian để tự động đồng bộ với máy chủ phần mềm TV hoặc nhà cung cấp truyền hình cáp.","ตั้งค่าวันที่และเวลาเพื่อให้ซิงค์กับเซิร์พเวอร์ซอฟต์แวร์ทีวีหรือผู้ให้บริการเคเบิลของคุณ","TV ေဆာ့ဖ္ဝဲ ဆာဗာ (သို႔) ႀကိဳးတပ္စက္ ပံ့ပိုးေပးသူနွင့္ အလိုအေလ်ာက္ ကိုက္ညီေစရန္ ေန႔စြဲႏွင့္ အခ်ိန္ သတ္မွတ္ပါ။","Televizor dasturiy ta'minoti serveri yoki kabel xizmatlari provayderi bilan avtomatik sinxronlash uchun sana va vaqtni o'rnating.","टीवी साफ्टवेयर सर्वर या केबल प्रोवाईडर के साथ तिथी और समय ऑटोमेटिकली मिलाने के लिए सेट करें","Встановіть дату і час для автоматичної синхронізації з провайдером телевізійного ПЗ або з провайдером кабельного ТБ.","Tetapkan tarikh dan masa untuk disegerakkan secara automatik dengan perisian pelayan atau pembekal TV kabel.","הגדר את התאריך והשעה שיסונכרנו אוטומטית עם שרת תוכנת הטלוויזיה או ספק הכבלים","Nastavte datum a čas pro automatickou synchronizaci se serverem pro software televizoru nebo s poskytovatelem kabelového vysílání.","Nastavte dátum a čas pre automatickú synchronizáciu so serverom pre softvér televízora alebo s poskytovateľom káblového vysielania.","Ustaw automatyczną synchronizację daty i czasu z serwerem oprogramowania TV lub dostawcą usługi kablowej.","Állítsa be a dátumot és az időt, hogy automatikusan összehangolja a TV szoftver szerver vagy kábel szolgáltatóval.","Задаване на автоматично синхронизиране на датата и часа с предоставените от телевизионния софтуерен сървър или доставчика на кабелна телевизия.","تنظیم و همگام‌سازی تاریخ و زمان به طور خودکار با سرور نرم افزار تلویزیون و یا ارائه دهنده کابل.","Mengatur tanggal dan waktu untuk menyinkronkan otomatis dengan server perangkat lunak TV atau penyedia layanan kabel.","N/A"],
