    "Set the time to display in a 12 or 24-hour format.":["设置时间按照12小时制或者24小时制来显示","Set the time to display in a 12 or 24-hour format.","Uhrzeit für die Anzeige im 12- oder 24-Stundenformat einstellen.","Imposta la visualizzazione dell'ora nel formato 12 o 24 ore.","Ajustar a hora para ser exibida num formato de 12 ou 24 horas.","Configurar la hora para mostrar un formato de 12 o 24 horas.","Régler l'heure à afficher avec un format 12 ou 24 heures.","Velg om klokken skal vises i 12 eller 24-timers format.","Ställ in tiden för att visa i ett 12 eller 24 timmars format.","Indstil tiden til at vises i 12 eller 24-timers format.","Asettaa ajan näyttämään 12- tai 24 tunnin esitysmuotoa.","Saatin hangi saat biçimi (12 ya da 24) ile gösterileceğini ayarlayın.","ضبط الوقت لعرضه في شكل 12 أو 24 ساعة.","Установите время либо в 12-ти, либо в 24-х часовой формат.","Cài đặt thời gian hiển thị theo định dạng 12 hoặc 24 giờ.","ตั้งเวลาเพื่อให้แสดงผลในแบบ 12 หรือ 24 ชั่วโมง","အခ်ိန္ျပသရန္ ၁၂ နာရီ (သို႔) ၂၄-နာရီ ပံုစံ သတ္မွတ္ပါ။","Vaqtni12 soatlik yoki 24 soatlik formatda ko'rsatishni tanlang.","12 या 24 घंटे के फोरमेट में समय दिखाने के लिए सेट करें","Встановіть час або в 12-ти, або в 24-х годинний формат.","Tetapkan masa untuk dipaparkan dalam format 12 atau 24 jam.","הגדר את הזמן כך שיוצג בפורמט של 12 או 24 שעות","Nastavte čas pro zobrazení ve formátu 12 nebo 24 hodin.","Nastavte čas pre zobrazenie vo formáte 12 alebo 24 hodín.","Ustaw 12- lub 24-godzinny format czasu.","Állítsa be az időt, hogy 12 vagy 24 órás formátumban jelenjen meg.","Задаване на времето в 12 или 24-часов формат.","تنظیم زمان برای نمایش در قالب 12 یا 24 ساعت.","Mengatur format tampilan waktu dalam siklus 12 atau 24 jam.","N/A"],
