    "To make sure the setting is effective, please keep the power on.":["为了确保设定有效，请保持上电。","To make sure the setting is effective, please keep the power on.","Lassen Sie das Gerät eingeschaltet, damit die Einstellung aktiviert bleibt.","Per garantire il funzionamento, mantenere il pulsante di alimentazione del TV su ON.","Para se certificar que o ajuste é aplicado, por favor, mantenha o cabo de alimentação ligado.","Para asegurar la vigencia de la configuración, mantenga encendido.","Pour que le paramétrage soit effectif, merci de ne pas couper l'alimentation électrique via le bouton ON/OFF ou le câble d'alimentation.","La strømmen være på for at innstillingen skal virke.","För att säkerställa att inställningen är effektiv ska du vänligen behålla strömmen på. ","For at sikre at indstillingen forbliver aktiv, skal du sikre der er strøm på.","Varmista että asetukset ovat voimassa, älä katkaise virtaa.","Ayarların geçerli olduğundan emin olmak için lütfen cihazı açık tutun.","للتأكد من تفعيل الاعدادادت، الرجاء اترك الجهاز قيد التشغيل..","Чтобы проверить, что настройка активирована, не отключайте питание.","Để chắc chắn rằng các cài đặt có hiệu quả, xin vui lòng bật TV lên.","เพื่อให้แน่ใจว่าการตั้งค่าจะมีผลสำเร็จ กรุณาเปิดเครื่องไว้เสมอ","သတ္မွတ္ခ်က္ ထိေရာက္မႈရွိေစရန္ ပါဝါဖြင့္ထားပါ။","Ushbu sozlama kuchga kirishi uchun quvvatni yoqilgan holatda qolishini ta'minlang.","सेटिंग लागू होने के लिए, कृप्या पावर न रखें ","Щоб перевірити, що налаштування активовано, не вимикайте живлення.","Untuk memastikan tetapan yang berkesan, sila simpan kuasa pada.","כדי להבטיח שההגדרות בעלות השפעה, אנא השאר את המכשיר פועל","Pro zajištění efektivity nastavení, nechte zařízení zapnuté.","Pre zabezpečenie efektivity nastavenia, nechajte zariadenie zapnuté.","Aby upewnić się, że ustawienie jest skuteczne, nie należy wyłączać zasilania.","A beállítás érvényesítéséhez hagyja bekapcsolva","За да сте сигурни, че настройката е ефективна, поддържайте захранването включено.","برای اطمینان از اعمال تنظیمات، تلویزیون را روشن نگه دارید.","Untuk memastikan pengaturan efektif, biarkan daya tetap hidup.","N/A"],
