    "Turn On Parental Controls to block children from being able to view certain programs.":["","Turn On Parental Controls to block children from being able to view certain programs.","Aktivieren Sie die Jugendschutzeinstellungen, damit Ihre Kinder bestimmte Programme nicht ansehen können.","Attiva il Parental Control per bloccare ai bambini la visione di determinati canali.","Activar o controlo parental para bloquear as crianças de ser capaz de aceder a determinados conteúdos.","Activar el control parental para impedir que los niños puedan ver ciertos programas.","Activer le contrôle parental pour bloquer l’accès des enfants à certains programmes.","Slå på foreldrekontroll slik at barn hindres fra å kunne se visse programmer.","Sätt på barnspärr för att blockera barn från att kunna se vissa program.","Slå Forældrekontrol til for at forhindre børn i at kunne se bestemte programmer.","Ottaa käyttöön lapsilukon asetukset, joilla estetään lasta katsomasta tiettyjä ohjelmia.","Çocukların belirli yayın türlerini izlemesini engellemek için Ebeveyn Denetimlerini Açın.","قم بتفعيل المراقبة الأبوية لمنع الأطفال من استعراض بعض البرامج.","Включите родительский контроль, чтобы закрыть детям доступ к определенным программам.","Bật Kiểm Soát Cha Mẹ để ngăn trẻ em có thể tránh xem các chương trình nhất định.","เปิดการควบคุมโดยผู้ปกครองเพื่อป้องกันไม่ให้เด็กรับชมรายการที่เนื้อหาไม่เหมาะสม","ကေလးမ်ားကို အခ်ဳိ႕ေသာ ပ႐ိုဂရမ္မ်ား ၾကည့္႐ႈျခင္းမွ တားဆီးရန္ မိဘဆိုင္ရာ အထိန္းမ်ား ဖြင့္ပါ။","Bolalarning ma'lum mazmundagi dasturlarni ko'rishiga yo'l qo'ymaslik uchun ota-onalar nazorati funksiyasini yoqing.","कुछ कार्यक्रम बच्चों को देखने से रोकने के लिए पेरेंटल कंट्रोल ऑन करें ","Увімкніть батьківський контроль, щоб закрити дітям доступ до певних програм.","Hidupkan Kawalan Ibu Bapa untuk menghalang kanak-kanak daripada dapat melihat program-program tertentu.","הפעל את אפשרות בקרת ההורים כדי לחסום בפני ילדים צפייה בתכניות מסוימות","Zapněte Rodičovskou kontrolu pro zablokování dětem sledování některých programů.","Zapnite Rodičovskú kontrolu pre zablokovanie deťom pozeranie niektorých programov.","Włącz kontrolę rodzicielską, aby uniemożliwić dzieciom oglądanie określonych programów.","Kapcsolja be a Szülői felügyelet funkciót, hogy a gyerekek számára megakadályozza bizonyos programok nézését.","Включване на функцията за родителски контрол за предотвратяване възможността децата да гледат определени програми.","برای جلوگیری از کودکان در تماشای بعضی برنامه‌های خاص، کنترل‌های والدین را روشن کنید.","Nyalakan Pengawasan Orang Tua untuk mencegah anak-anak menonton program-program tertentu.","N/A"],
