    "Block certain channels and programs during certain periods of time.":["","Block certain channels and programs during certain periods of time.","Bestimmte Sender und Programme zu bestimmten Zeiten sperren.","Blocca determinati canali e programmi in un certo periodo di tempo.","Bloquear determinados canais e programas durante determinados períodos de tempo.","Bloquear ciertos canales y programas durante ciertos períodos de tiempo.","Bloquer certaines chaînes et programmes selon des horaires prédéterminés.","Blokkering for bestemte kanaler og programmer til bestemte tider.","Blockera vissa kanaler och program under vissa tidsperioder.","Blokerer bestemte kanaler og programmer i visse perioder af gangen.","Estää tiettyjen kanaient ja ohjelmien käytön tiettynä aikana.","Belirli saatlerdeki belirli kanal ya da programları engelleyin.","منع قنوات وبرامج معينة خلال فترات معينة من الزمن.","Блокирует определенные каналы и программы в течение заданных периодов времени.","Chặn các kênh và chương trình nhất định trong thời gian nhất định.","บล็อกบางช่องรายการและรายการในระหว่างช่วงเวลาหนึ่ง","သတ္မွတ္ခ်ိန္အတြင္း အခ်ဳိ႕ေသာ ခ်န္နယ္လိုင္းမ်ားႏွင့္ ပ႐ိုဂရမ္မ်ားကို တားဆီးပါ။","Ma'lum vaqt davomida ma'lum kanallar va dasturlarni bloklang.","कुछ समय के दौरान कुछ चैनल और कार्यक्रम ब्लाक करें","Блокує певні канали та програми протягом заданих періодів часу.","Menghalang saluran dan program-program tertentu semasa tempoh masa tertentu.","חסום ערוצים ותכניות מסוימות למשך פרקי זמן מוגדרים","Blokujte určité programy a pořady v určitém časovém období.","Blokujte určité programy a relácie v určitom časovom období.","Zablokuj określone kanały i programy w podanym okresie czasu.","Tiltson le bizonyos csatornákat és programokat bizonyos időszakokban.","Блокиране на определени канали и програми за зададен период от време.","مسدودسازی برخی کانال‌ها و برنامه‌ها طی مدت زمانی مشخص.","Memblokir saluran dan program tertentu selama periode waktu tertentu.","N/A"],
