    "Turn this On to automatically block programs based on the US rating.":["","Turn this On to automatically block programs based on the US rating.","Aktivieren Sie diese Einstellung, um Programme automatisch gemäß US-Einstufungen zu sperren","Attiva questa funzione per bloccare automaticamente il blocco programmi in vase al rating US.","Active essa opção para bloquear automaticamente os programas com base no rating dos EUA.","Encender para bloquear automáticamente los programas en función de la clasificación de los EE. UU.","Activer cette fonction pour bloquer automatiquement les programmes en fonction de la classification des États-Unis.","Slå på funksjonen for å automatisk blokkere programmer basert på amerikansk klassifisering.","Sätt på denna för att automatiskt blockera program baserade på US omdömen.","Slå dette til for automatisk at blokere programmer baseret på de amerikanske ratings.","Kytke päälle esto, jossa automaattisesti estetään ohjelmien näyttö perustuen US arvosteluihin.","ABD Reytinglerine göre otomatik olarak programları engellemek için bunu Açın.","تفعيل هذا الخيار يقوم بتفعيل حظر البرامج حسب تصنيف الولايات المتحدة تلقائيا.","Включите эту функцию для автоматического блокирования программ по их категории в США.","Bật ON này để tự động chặn các chương trình dựa trên xếp hạng của Mỹ.","เปิดคุณสมบัตินี้เพื่อบล็อกรายการโดยอัตโนมัติตามการจัดอันดับเนื้อหาของสหรัฐอเมริกา","၄င္းကို US ႏႈန္းထားအေပၚအေျခခံ၍ ပ႐ိုဂရမ္မ်ား အလိုအေလ်ာက္ တားဆီးရန္ ဖြင့္ပါ။","Dasturlarni AQSH reytingi asosida avtomatik tarzda bloklash uchun bu funksiyani yoqing.","यूएस रेटिंग के हिसाब से अपने आप कार्यक्रम ब्लाक करने के लिए इसे ऑन करें","Увімкніть цю функцію для автоматичного блокування програм за їх категорією в США.","Hidupkan ini secara automatik menghalang program berdasarkan Kedudukan AS.","הפעל את הפונקציה כדי לחסום באופן אוטומטי תכניות בהתבסס על דירוג אמריקני","Zapněte tuto funkci pro automatické blokování programů založené na Americkém hodnocení.","Zapnite túto funkciu pre automatické blokovanie programov založené na Americkom hodnotení.","Włącz, aby automatycznie blokować programy na podstawie systemu oceny w USA.","Kapcsolja be a programok amerikai minősítés alapján történő automatikus zárolásához.","Включване на тази функция за автоматично блокиране на програми на базата на рейтинга им за САЩ.","این تراشه وقتی در حالت روشن باشد، برنامه‌ها بر اساس رتبه‌بندی US به طور خودکار مسدود می‌شوند.","Aktifkan ini untuk memblokir program berdasarkan rating AS secara otomatis.","N/A"],
    "Current channel does not have Open V-chip data":["","Current channel does not have Open V-chip data","Aktueller Sender enthält keine Daten für Open V-Chip","Questo canale non ha attivi i dati del V-Chip","Canal actual não tem dados abertos V-chip","El canal actual no tiene datos abiertos de V-Chip.","La chaîne actuelle ne dispose pas de données Open V-chip.","Gjeldende kanal har ikke Open V-chip-data","Nuvarande kanal har inte öppen V-chip data","Den aktuelle kanal har ikke Open V-chip data","Kanavalla ei ole avointa V-Chip dataa.","Geçerli kanal V-Chip verisine sahip değil","القناة الحالية لا تمتلك بيانات Open V-Chip","В текущем канале нет информации Open V-chip","Kênh hiện tại không có thông tin V-chip Mở","ช่องรายการปัจจุบันไม่ได้เปิดข้อมูล V-chip","လက္ရွိခ်န္နယ္လိုင္းတြင္ အဖြင့္ V-chip ေဒတာ မရွိပါ","Ushbu kanalda Open V-chip ma'lumotlari yo'q","इस चैनल में V-Chip डाटा नहीं है","У поточному каналі немає інформації Open V-chip","Saluran semasa tidak mempunyai Buka data V-cip","הערוץ הנכוחי אינו בעל נתוני שבב-V","Aktuální kanál nemá Otevřené V-chip údaje","Aktuálny kanál nemá Otvorené V-chip údaje","Bieżący kanał nie posiada danych Open V-Chip","Az aktuális csatornához nem tartoznak Open V-chip adatok","Този канал не съдържа данни за работа с отворен V-Chip.","کانال فعلی فاقد داده تراشه کنترل V می‌باشد","Saluran saat ini tidak memiliki data Open V-Chip","N/A"],
