    "Block content from devices that are connected to certain TV ports.":["","Block content from devices that are connected to certain TV ports.","Sperren Sie Inhalte von Geräten, die mit bestimmten TV-Eingängen verbunden sind.","Blocca contenuti dai dispositivi connessi al TV.","Bloco de conteúdo a partir de dispositivos que estão conectados a determinadas portas da TV.","Bloquear el contenido de los dispositivos que están conectados a ciertos puertos de televisión.","Bloquer le contenu en provenance de périphériques connectés à certains ports du téléviseur.","Blokkere innhold fra enheter som er koblet til porter på TV-apparatet.","Blockera innehåll från enheter som är anslutna till särskilda TV-portar.","Bloker indhold fra enheder, der er tilsluttet visse tv-porte.","Estä automaattisesti sisältö laitteista, jotka ovat kytkettynä TV:n tiettyihin portteihin.","Belirli TV portlarına bağlı olan cihazların içerik aktarmasını engelle.","حظر محتوى الأجهزة المتصلة مع منافذ معينة على التلفزيون.","Блокирует контент от устройств, подключенных к определенным ТВ-входам.","Chặn nội dung từ các thiết bị kết nối với các cổng TV nhất định.","บล็อกเนื้อหาจากอุปกรณ์ที่ถูกเชื่อมต่อกับพอร์ตทีวีขณะนั้น","အခ်ဳိ႕ေသာ TV ဂ်က္ေပါက္မ်ားႏွင့္ ခ်ိတ္ဆက္သည့္ ကိရိယာမ်ားမွ ပါဝင္ခ်က္မ်ား တားဆီးပါ။","Televizor portlariga ulangan ma'lum qurilmalardan chiqadigan kontentni bloklang.","टीवी पोर्ट्स से जुड़े कुछ डिवाईसेज़ की सामग्री ब्लाक करें","Блокує контент від пристроїв, підключених до певних ТВ-портів.","Menghalang kandungan daripada peranti yang disambungkan ke pelabuhan TV tertentu.","חסום קלט ממכשירים המחוברים לכניסות מסוימות של הטלוויזיה","Blokuje obsah zařízení, které jsou připojeny k některým portům televizoru.","Blokuje obsah zariadení, ktoré sú pripojené k niektorým portom televízora.","Blokada treści z urządzeń podłączonych do określonych gniazd TV.","Bizonyos TV portokhoz csatlakozó eszközökről származó tartalom zárolása.","Блокиране на съдържанието от устройства, които са свързани към определени портове на телевизора.","محتوای ورودی از دستگاه‌هایی که متصل به بعضی پورت‌های تلویزیون هستند را مسدود می‌کند.","Memblokir konten dari perangkat yang tersambung ke port TV tertentu.","N/A"],
