    "Select the Closed Caption mode when you view an analog program.":["","Select the Closed Caption mode when you view an analog program.","Wählen Sie den Untertitelmodus für die Wiedergabe eines analogen Programms.","Selezionare il tipo di sottotitoli quando guardi un canale analogico.","Selecione o modo de fecho de captação quando está a ver um programa analógico.","Seleccionar el modo de subtítulos ocultos cuando ve un programa analógico.","Sélectionner le mode de sous-titrage lorsque vous visionnez un programme analogique.","Velg teksting når du ser et analogt program.","Välj det textade versionsläget när du ser ett analogt program.","Vælg undertekst når du se et analogt program.","Valitse Tekstityksen tila kun katselet analogista lähetystä.","Analog bir program izlerken İşitme Engelliler için Altyazı modunu seçin.","حدد وضع تسمية توضيحية عند عرض برنامج تناظرية.","Выбрать режим скрытых субтитров при просмотре аналоговых программ.","Chọn chế độ Phụ Đề khi quý vị xem một chương trình tương tự.","เลือกโหมดการบรรยายเสียงแบบปิดเมื่อคุณรับชมรายการอะนาล็อก","အနာေလာ့ ပ႐ိုဂရမ္တစ္ခု သင္ၾကည့္႐ႈေနသည့္အခါ ပိတ္ထားသည့္ ဇာတ္ညႊန္းစာတန္း အေနအထားကို ေရြးပါ။","Analog dasturni tomosha qilganda, yashirin titr rejimini tanlang.","अनालोग कार्यक्रम देखते समय क्लोस्ड कैपशन मोड चुनें","Вибрати режим кодованих субтитрів при перегляді аналогових програм.","Pilih mod Kapsyen Tertutup apabila anda melihat program analog.","בחר במצב כתוביות לכבדי שמיעה כאשר אתה צופה בתוכנית אנלוגית","Při zobrazení analogového programu zvolte režim Skryté titulky.","Pri zobrazení analógového programu zvoľte režim Skryté titulky.","Wybierz tryb napisów kodowanych podczas oglądania programu analogowego.","Válassza a feliratozás módot analóg program nézésekor.","Изберете режим Субтитри за хора с увреден слух, докато гледате аналогова програма.","هنگام مشاهده برنامه آنالوگ، حالت زیرنویس بسته را انتخاب کنید.","Memilih mode Keterangan Gambar saat menonton program siaran analog.","N/A"],
