    "Allow CEC-enabled devices to communicate with each other when connected through an HDMI cable.":["","Allow CEC-enabled devices to communicate with each other when connected through an HDMI cable.","Erlauben Sie CEC-fähigen Geräten miteinander zu kommunizieren, wenn diese per HDMI-Kabel verbunden sind.","Consenti ai dispositivi compatibili col CEC di comunicare tra loro quando connessi attraverso HDMI.","Permitir que os dispositivos compatíveis com CEC se comuniquem uns com os outros quando conectado através de um cabo HDMI.","Permitir que los dispositivos CEC habilitados se comuniquen entre sí cuando se conectan a través de un cable HDMI.","Autoriser les périphériques CEC habilités à communiquer les uns avec les autres lorsqu'ils sont connectés via un câble HDMI.","Tillate CEC-aktiverte enheter å kommunisere med hverandre når de er tilkoblet via HDMI-kabel.","Tillåt CEC-aktiverade enheter att kommunicera med varandra när de är anslutna via en HDMI-kabel.","Tillad at CEC-kompatible enheder må kommunikere med hinanden, når de tilsluttet via et HDMI-kabel.","Salli CEC -yhteensopivien laitteiden olla yhteydessä toistensa kanssa kun liitettynä HDMI -kaapelin välityksellä.","CEC işlevi etkinleştirilmiş cihazların HDMI kablosu bağlı olduğu zaman birbirleriyle iletişim kurmalarına izin verin.","السماح للأجهزة التي تدعم CEC بالتواصل مع بعضهم البعض عند الاتصال عبر كابل HDMI.","Разрешить CEC-совместимым устройствам общаться друг с другом по HDMI-кабелю.","Cho phép các thiết bị CEC-được kích hoạt giao tiếp với nhau khi kết nối thông qua cáp HDMI.","อนุญาติให้อุปกรณ์ที่เปิดใช้งาน CEC ทำการสื่อสารระหว่างกันได้เมื่อเชื่อมต่อกันผ่านสายเคเบิล HDMI","HDMI ႀကိဳးတစ္ေခ်ာင္းမွတဆင့္ ခ်ိတ္ဆက္ထားစဥ္ CEC သံုးႏိုင္သည့္ ကိရိယာမ်ား တစ္ခုႏွင့္တစ္ခု ဆက္သြယ္ခြင့္ျပဳပါ။","HDMI kabel yordamida ulanganda, CEC funksiyali qurilmalarga bir-biri bilan aloqa qilish imkoni bo'ladi."," सीइसी वाली डिवाईसेज़ जब एचडीएमआई केबल द्वारा जुड़ी हों तो उन्हे आपस में कमयूनिकेट करने दें","Дозволити CEC-сумісним пристроям спілкуватися один з одним по HDMI-кабелю.","Benarkan peranti CEC yang dibolehkan untuk berkomunikasi antara satu sama lain apabila disambungkan melalui kabel HDMI.","אפשר למכשירים מופעלי-CEC לתקשר אחד עם השני כשהם מחוברים בכבל HDMI ","Povolit vzájemnou komunikaci CEC zařízení při připojení pomocí HDMI kabelu.","Povoliť vzájomnú komunikáciu CEC zariadení pri pripojení pomocou HDMI kábla.","Umożliwiaj urządzeniom CEC na wzajemną komunikację przy podłączeniu przez kabel HDMI.","Engedélyezze, hogy a CEC-t engedélyező eszközök egymással kommunikáljanak, miközben HDMI kábelen keresztül csatlakoznak.","Позволява на устройства с активирана СЕС функция да комуникират помежду си, когато са свързани с HDMI кабел.","اجازه به دستگاه‌های مجهز به CEC برای ارتباط با یکدیگر هنگام اتصال از طریق کابل HDMI.","Supaya perangkat yang diaktifkan CEC dapat saling berkomunikasi saat tersambung melalui kabel HDMI.","N/A"],
