    "Set the amount of time that you'd like for the menu to display.":["","Set the amount of time that you'd like for the menu to display.","Stellen Sie die Dauer für die Anzeige des Menüs ein.","Imposta la tempistica di visualizzazione del display","Defina o tempo para a exibição do menu.","Configurar la cantidad de tiempo que desea que se vea el menú.","Régler le délai durant lequel le menu est affiché.","Angi hvor lenge du ønsker at menyen skal vises.","Ställ in hur lång tid som du vill att menyn ska visas.","Indstil den tid, som du vil have menuen vises.","Aseta aika, jonka verran haluat valikon näkyvän.","Menünün görüntülenmesini istediğiniz süre uzunluğunu ayarlayın.","تعيين مقدار الوقت الذي ترغب في عرض القائمة على الشاشة.","Установите время видимости меню на экране.","Cài đặt số lượng thời gian mà quý vị muốn cho menu hiển thị.","ตั้งค่าปริมาณของเวลาที่คุณต้องการสำหรับให้เมนูแสดงผลอยู่","မီႏူး ျပသရန္ သင္ထားလိုသည့္ အခ်ိန္ ပမာဏ သတ္မွတ္ပါ။","Menyu aks etib turadigan vaqt davomiyligini belgilang.","मेनू कितनी देर स्क्रीन पर रहे इसकी अवधि सेट कर लें","Встановіть час, протягом якого хочете бачити меню.","Tetapkan jumlah masa yang anda ingin untuk menu untuk dipaparkan.","הגדר את משך הזמן שלאורכו תרצה שהתפריט יוצג","Nastavte dobu, po kterou chcete zobrazení menu.","Nastavte dobu, po ktorú chcete zobrazenie menu.","Ustaw czas wyświetlania menu.","Adja meg azt az időt, ameddig a menüt meg kívánja jeleníteni","Задаване на времето, за което менюто ще бъде показвано.","مقدار زمانی که می‌خواهید منو نمایش داده شود را مشخص کنید.","Memilih waktu yang Anda inginkan untuk menampilkan menu.","N/A"],
