    "Set the Power Indicator light to stay On or Off when watching TV.":["","Set the Power Indicator light to stay On or Off when watching TV.","Aktivieren oder deaktivieren Sie die Betriebsanzeige für die Zeit, in der Sie fernsehen.","Imposta se mantenere il led di alimentazione acceso o spento mentre guardi la TV.","Defina o indicador de alimentação para ficar activada ou desactivada quando assiste TV.","Configurar la luz indicadora de encendido para que permanezca activada o desactivada cuando vea la televisión.","Sélectionner si le témoin d'alimentation reste allumé ou non lorsque vous regardez la télévision.","Velg om strømlyset skal være på eller av når du ser på TV.","Ställ in så att strömindikatorn är på eller av när du tittar på TV.","Sæt Strømindikatoren at være tændt eller slukket, mens du ser TV.","Aseta Virran merkkivalo Päälle tai Pois kun katselet TV:ta.","TV'yi izlerken Güç Göstergesi Işığının Açık ya da Kapalı olarak hangisinde tutulacağını ayarlayın.","تعيين ضوء مؤشر الطاقة للبقاء يعمل او لا يعمل عند مشاهدة التلفزيون.","Выбор, чтобы светодиод индикатора питания был включен или выключен при просмотре ТВ.","Cài đặt đèn Báo Nguồn để Bật hoặc Tắt khi đang xem TV.","ตั้งค่าไฟแสดงสถานะพลังงานให้สว่างแบบเปิดหรือปิดเมื่อกำลังรับชมทีวี","TV ၾကည့္ေနစဥ္ ပါဝါ ညႊန္တံ အလင္း ျပေနရန္ (သို႔) ပိတ္ရန္ သတ္မွတ္ပါ။","Televizorni tomosha qilayotganda, quvvat indikator chirog'ini yoqilgan yoki o'chirilgan holatda qolishga sozlang.","टीवी देखते समय पावर इंडिकेटर की लाईट आन या आफ पर सेट करें","Встановіть, щоб світлодіод індикатора живлення був увімкнений або вимкнений при перегляді ТВ.","Tetapkan cahaya Kuasa Petunjuk untuk tinggal Aktif atau Tak aktif semasa menonton TV.","הגדר שאור מחוון מצב ההפעלה יישאר דולק או ייכבה בעת הצפייה בטלוויזיה","Nastavte světlo indikátoru napájení aby zůstalo zapnuté nebo vypnuté při sledování televize.","Nastavte svetlo indikátora napájania aby zostalo zapnuté alebo vypnuté pri sledovaní televízie.","Ustaw włączony lub wyłączony stan lampki kontrolnej zasilania podczas oglądania TV.","Állítsa be az áram jelző fényt, hogy az bekapcsolt vagy kikapcsolt állapotban legyen-e TV nézés közben.","Избор дали светлинният индикатор на захранването да остане включен или да се изключи, докато гледате телевизия.","لامپ شاخص برق را طوری تنظیم کنید که هنگام تماشای تلویزیون روشن یا خاموش بماند.","Mengatur lampu indikator Daya agar tetap menyala atau mati saat menonton TV.","N/A"],
