    "Please enter a valid display name upto 18 characters.":["","Please enter a valid display name upto 18 characters.","Geben Sie einen gültigen Anzeigenamen mit bis zu 18 Zeichen ein.","Inserire un nome inferiore ai 18 caratteri.","Digite um nome de exibição válido até 18 caracteres.","Ingrese un nombre válido de hasta 18 caracteres.","Veuillez entrer un nom jusqu'à 18 caractères.","Angi et gyldig visningsnavn med maks 18 tegn.","Ange ett giltigt visningsnamn på upp till 18 tecken.","Indtast et gyldigt skærm-navn på op til 18 tegn.","Anna korkeintaan 18 merkkiä pitkä nimi näytölle.","Lütfen 18 karaktere kadar desteklenen geçerli bir görüntüleme adı girin.","الرجاء إدخال اسم العرض صحيح ، الحد الاقصى 18 حرفا.","Введите действительное имя для отображения не больше 18 символов.","Vui lòng nhập tên hiển thị hợp lệ lên tới 18 ký tự.","กรุณาป้อนชื่อที่แสดงผลถูกต้องไม่เกิน 18 ตัวอักษร","အကၡရာ ၁၈ လံုးရွိေသာ မွန္ကန္သည့္ ျပကြက္ အမည္ ထည့္သြင္းပါ။","18 tagacha belgidan iborat displey nomini kiriting.","कृप्या 18 केरेक्टर्स तक का डिस्पले नाम भरें","Введіть дійсне ім'я для відображення не більш 18 символів.","Sila masukkan nama paparan yang sah hingga 18 aksara."," הזן שם תצוגה חוקי בן 18 תווים לכל היותר","Zadejte prosím platný název zobrazení do18 znaků.","Zadajte prosím platný názov zobrazenia do18 znakov.","Wprowadź właściwą nazwę do 18 znaków.","Adjon meg érvényes kielző nevet, max. 18 karakter hosszú terjedelemben","Моля въведете валидно име на дисплея до запълването на 18 символа.","لطفا نام نمایش معتبر را تا 18 حرف وارد کنید.","Tulis nama tampilan yang valid maksimal 18 karakter.","N/A"],
