    "Check to ensure that your TV has received the latest firmware.":["","Check to ensure that your TV has received the latest firmware.","Überprüfen Sie, ob Ihr Fernseher die aktuellste Firmware verwendet.","Verifica se il tuo TV ha ricevuto l'ultimo aggiornamento software.","Verifique se o seu televisor recebeu o firmware mais recente.","Comprobar para asegurarse de que su TV ha recibido el último firmware.","Assurez-vous que votre téléviseur possède le dernier Firmware.","Sjekk at TV-apparatet har nyeste firmware.","Kontrollera för att säkerställa att din TV har mottagit den senaste fasta programvaran.","Kontroller, at dit tv har modtaget den nyeste firmware.","Tarkista jotta TV -vastaanottimesi on saanut uusimmat laitepäivitykset.","TV'nizin en son bellenime sahip olduğundan emin olmak için kontrol edin. ","افحص للتأكد من أن جهاز التلفزيون يعمل باحدث البرامج الثابتة.","Проверьте, установлена ли на вашем ТВ последняя версия прошивки.","Kiểm tra để đảm bảo rằng TV của quý vị đã nhận được phần mềm hệ thống mới nhất.","ตรวจสอบให้แน่ใจว่าทีวีของคุณได้รับเฟิร์มแวร์รุ่นล่าสุด","သင္၏ TV တြင္ ေနာက္ဆံုးထြက္ ဖမ္းဝဲ ရရွိမႈ ေသခ်ာေစရန္ စစ္ေဆးပါ။","Televizoringizda mikrodastur oxirgi versiyasigacha yangilanganligini tekshiring.","चेक करें कि आपके टीवी में नया फर्मवेयर हैं ","Переконайтеся, що на вашому ТВ остання версія прошивки.","Semak untuk memastikan bahawa TV anda telah menerima firmware terkini.","בדוק וודא שהטלוויזיה שלך קיבלה את הקושחה העדכנית ביותר","Zkontrolujte, zda má váš televizor nejnovější firmware.","Skontrolujte, či má váš televízor najnovší firmware.","Sprawdź, czy Twój TV ma najnowsze oprogramowanie.","Ellenőrizze, hogy meggyőződjön arról, hogy a TV megkapta a legfrissebb firmware-t.","Гарантира, че вашият телевизор е получил най-новия фърмуер.","برای اطمینان از اینکه تلویزیون شما جدیدترین سیستم عامل را دریافت کرده است آن را بررسی کنید.","Memeriksa untuk memastikan TV Anda telah menerima firmware terbaru.","N/A"],
