    "Automatically send usage information, statistics and crash reports to Hisense.":["","Automatically send usage information, statistics and crash reports to Hisense.","Nutzerdaten, Statistiken und Fehlermeldungen automatisch an Hisense senden.","Invia automaticamente informazioni di uso, statistiche e segnalazione di crash a Hisense","Automaticamente enviar informações de uso, estatísticas e relatórios de problemas da Hisense","Enviar automáticamente información de uso, estadísticas, y el informe de error a Hisense.","Envoi d'informations et de rapports d'erreur a fin statistique pour améliorer l'expérience utilisateur,","Send bruksinformasjon, statistikk, og feilrapporter til Hisense.","Skicka automatiskt användningsinformation, statistik, och kraschrapport till Hisense. ","Sende automatisk brugsoplysninger, statistik, og fejl-rapport til Hisense.","Lähetä automaattisesti käyttötietoja, tilastoja sekä kaatumisilmoituksia Hisensille.","Kullanım bilgilerini, istatistikleri ve çökme raporlarını Hisense'e otomatik olarak gönderin.","إرسال معلومات الاستخدام، والإحصاءات، وتقرير الأعطال الى هايسنس تلقائيا.","Автоматически отправляет в Hisense информацию об использовании, статистику и отчеты о сбоях.","Tự động gửi thông tin sử dụng, báo cáo thống kê và báo cáo tai nạn tới Hisense.","ส่งข้อมูลการใช้ สถิติและรายงานความล้มเหลวไปยัง Hisense โดยอัตโนมัติ","အသံုးျပဳမႈ အခ်က္အလက္၊ စာရင္းဇယားႏွင့္ ျပႆနာ အစီရင္ခံခ်က္ကို Hisense သို႔ အလိုအေလ်ာက္ ေပးပို႔ပါ။","Hisense'ga foydalanish haqida ma'lumotlar, statistika va nosozlik hisobotlarini avtomatik tarzda jo'nating.","हाईसेंस को यूसेज सूचना, डाटा और क्रैश रिपेर्ट स्वचलित भेजें ","Автоматично відправляє в Hisense інформацію про використання, статистику та звіти про збої.","Secara automatik menghantar maklumat penggunaan, statistik, dan laporan ranap kepada Hisense.","שלח באופן אוטומטי פרטי שימוש, סטטיסטיקות ודו\"חות קריסה אל Hisense","Automatické odesílání informací o využití, statistiky a zprávy o poruchách pro Hisense.","Automatické odosielanie informácií o využití, štatistiky a správy o poruchách pre Hisense.","Automatycznie wysyłaj informacje o użytkowaniu, statystyki i raporty błędów do Hisense.","Automatkusan küldjön a használattal kapcsolatos információt, statisztikát és összeomlás-jelentést a Hisense-nek.","Автоматично изпращане на данни за употребата, статистики и отчети за срив към Hisense.","ارسال خودکار اطلاعات کاربری، آمارها و گزارش به Hisense.","Mengirim informasi penggunaan, statistik, dan laporan crash ke Hisense secara otomatis.","N/A"],
