    " Formatting the Disk allows for better time shift operation. Continue?":["格式化硬盘会有更好的时移体验，是否继续？"," Formatting the Disk allows for better time shift operation. Continue?","Formatierung der Festplatte ermöglicht besseren Timeshift-Betrieb. Fortfahren?","Formattando l'HDD migliorerà l'esperienza timeshift. Sicuro di voler continuare?","A formatação do disco rígido terá uma melhor experiência de Timeshift. Claro que para continuar?","Al formatear el disco duro tendrá una mejor experiencia con Timeshift. ¿Desea continuar?","Le formatage du périphérique améliorera l'expérience TimeShift . Voulez-vous vraiment continuer?","Formatering av harddisken vil gi en bedre timeshift-opplevelse. Er du sikker på at du vil fortsette?","Formatering av hårddisken kommer att ha en bättre tidsförskjutningsupplevelse. Är du säker du vill fortsätta?","Hvis du formatterer din harddisk får du en bedre Timeshift-oplevelse. Vil du fortsætte?","Kiintolevyn alustamisella saavutetaan parempi ajansiirtokokemus, jatketaanko?","HDD'nin biçimlendirilmesi daha iyi bir zaman kaydırma deneyimi sunacaktır. Devam etmek istediğinizden emin misiniz?","سوف إعادة فرمته القرص الصلب الخاص بك لتجربة أفضل في التحكم الزمني. تأكد من المتابعة؟","Если отформатировать диск, параметры TimeShift улучшатся. Продолжить?","Việc định dạng ổ cứng HDD sẽ thực hiện thay đổi thời gian tốt hơn. Chắc chắn tiếp tục không?","การฟอร์แม็ตฮาร์ดดิสก์จะให้ประสบการณืการใช้ฟังก์ชันหยุดเวลาเพื่อบันทึกได้ดีกว่า คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","HDD ပံုစံဖြဲ႔စည္းျခင္းသည္ ပိုေကာင္းသည့္ အခ်ိန္ေျပာင္းဖမ္းယူ အေတြ႕အႀကံဳ ရွိေစမည္။ ဆက္လုပ္မလား?","Qattiq diskni formatlash vaqtni surish funksiyasi ish sifatini yaxshilaydi. Davom etmoqchi ekaningizga ishonchingiz komilmi?"," HDD को फ़ॉरमेट करके बेहतर टाईमशिफ़्ट अनुभव होगा. आगे बढ़ें ?","Якщо відформатувати HDD, показники по зсуву за часом покращаться. Продовжити?","Memformat HDD akan mempunyai pengalaman peralihan masa yang lebih baik. Pasti meneruskan?","פירמוט ה-HDD יספק חווית היסט זמן טובה יותר. האם אתה בטוח שתרצה להמשיך?","Formátováním HDD získáte lepší zážitek z časového posunu. Chcete pokračovat?","Formátovaním HDD získate lepší zážitok z časového posunu. Chcete pokračovať?","Sformatowanie HDD pozwoli na lepsze działanie funkcji Time Shift. Czy chcesz kontynuować?","A merevlemez formázása jobb timeshift élményt biztosít. Biztosan folytatja?","Форматирането на твърдия диск би подобрило работата на функцията за времеотместване. Сигурни ли сте, че желаете да продължите?","فرمت HDD منجر به بهبود شیفت زمانی خواهد شد. ادامه می‌دهید؟","Dengan memformat Hardisk, pergantian waktu akan menjadi lebih baik. Anda yakin ingin melanjutkan?","N/A"],
