    "Press the WPS button on your router; this is marked with WPS or the following symbol:":["轻按您路由器上的Wifi保护按钮，其可能被叫做WPS或含有此符号:","Press the WPS button on your router; this is marked with WPS or the following symbol:","Drücken Sie die WPS-Taste an Ihrem Router; diese ist mit WPS oder folgendem Symbol gekennzeichnet:","Premere il pulsante di protezione Wifi sul router che si può chiamare WPS o contenere simbolo:","As configurações podem levar até dois minutos para completar","Pulse el botón de protección de Wifi en el router, que puede llamarse WPS o contener este símbolo:","Appuyez sur le bouton de protection Wifi sur votre routeur, appelé aussi WPS ou contient ce symbole :","Trykk på Wifi-knappen på ruteren, den kan være merket WPS eller med dette symbolet:","Tryck på WiFi-skyddsknapp på din router, som kan kallas för WPS eller innehålla denna symbol:","Tryk på knappen \"Wi-Fi-Protected Setup\" på routeren. Den kaldes evt. WPS eler genkendes på dette symbol.","Napsauta Wifi suojapainiketta reitittimestäsi, siinä voi olla merkintä WPS tai tämä symboli:","Yönlendiricinizin üzerinde bulunan ve WPS olarak da adlandırılan Wi-Fi koruma butonuna basın. Bazen şu sembolle de gösterilir:","اضغط على زر واي فاي محمي على جهاز التوجيه الخاص بك، الذي يمكن ان يكون تحت WPS أو يحتوي على هذا الرمز.","Нажмите кнопку защиты Wi-Fi на роутере, на которой может быть нанесено WPS или такой символ:","Chạm vào nút bảo vệ Wifi trên bộ định tuyến của quý vị được gọi là WPS hoặc có chứa biểu tượng này:","แตะที่ปุ่มการป้องกัน Wi-Fi บนเราท์เตอร์ของคุณ ซึ่งอาจจะเป็น WPS ที่ถูกเรียกหรือมีสัญลักษณ์นี้:","သင္၏ ေရာက္တာတြင္ Wifi ကာကြယ္ေရး ခလုတ္ကိုႏွိပ္ပါ၊ ၄င္းကို WPS ဟု ေခၚႏိုင္သည္ (သို႔) ဤသေကၤတ ပါဝင္သည္ :","Marshrutlagichdagi Wi-Fi himoya tugmasini cherting, bu tugma \"WPS\" tugmasi deb atalishi yoki tugmada shu belgi bo'lishi mumkin:","अपने राउटर पर वाईफ़ाई प्रोटेक्शन का बटन दबाईए, जिसे WPS कहते हैं या यह चिन्ह उसमें होगा : ","Натисніть кнопку захисту Wifi на роутері, на якій може бути нанесено WPS або такий символ:","Ketik butang perlindungan Wifi pada router anda, yang boleh dipanggil WPS atau mengandungi simbol ini:","לחץ על כפתור הגנת הרשת האלחוטית (WiFi) שבנתב שלך, אשר עשוי להיקרא גם WPS או לכלול את הסמל הבא:","Klepněte na tlačítko Wifi ochrana na vašem routeru, které může být nazýváno WPS nebo může obsahovat tento symbol:","Kliknite na tlačidlo Wifi ochrana na vašom routeri, ktoré môže byť nazývané WPS alebo môže obsahovať tento symbol:","Użyj przycisku funkcji Wi-Fi Protected Setup na Twoim routerze. Może nazywać się WPS lub zawierać taki symbol:","Érintse meg a Wifi védelem gombot a routeren, amely neve WPS vagy az alábbi szimbólum jelzi:","Натиснете бутона за защита на безжичната връзка върху рутера си, който може да се нарича WPS или да съдържа следния символ:","دکمه Wifi روی روتر خود را فشار دهید. ممکن است نام آن WPS یا حاوی این حروف باشد:","Ketuk tombol pelindung Wifi di router, yang disebut juga sebagai WPS atau yang memiliki simbol ini:","N/A"],
