    "Use the TV remote to adjust the volume; TV speaker is off.":["","Use the TV remote to adjust the volume; TV speaker is off.","Lautstärke mit der TV-Fernbedienung einstellen; TV-Lautsprecher ist aus.","Usa il telecomando per regolare il volume e l'altoparlante si spegne.","Use o comando da TV para ajustar o volume e alto-falante da TV que está desligada.","Utilice el control remoto de la TV para ajustar el volumen y el altavoz de la TV está apagado.","Utilisez la télécommande pour régler le volume et les haut-parleurs du téléviseur sont éteints.","Bruk TV-fjernkontrollen for å justere volumet og TV-høyttaler slått av.","Använd fjärrkontrollen för att justera volymen och TV-högtalaren är av. ","Brug TV'ets fjernbetjening til at justere lydstyrken og TV-højttaleren er slukket.","Käytä TV:n kaukosäädintäsäätääksesi äänentasoa vaikka TV:n kaiuttimet ovat kiinni.","Sesi ayarlamak ve TV'nin hoparlörünü kapamak için TV'nin uzaktan kumandasını kullanın.","استخدام جهاز التحكم عن بعد التلفزيون لضبط مستوى الصوت وسماعة التلفزيون.","Используйте ТВ-пульт ДУ для регулирования громкости, когда динамик телевизора выключен.","Sử dụng điều khiển TV từ xa để điều chỉnh âm lượng và tắt loa TV.","ใช้รีโมททีวีเพื่อปรับระดับเสียงและปิดลำโพง","အသံ ညႇိရန္ႏွင့္ TV စပီကာ ပိတ္ရန္ TV အေဝးထိန္း ကိရိယာကို သံုးပါ။","Tovush balandligini sozlash va televizor karnayini o'chirish uchun televizor masofa pultidan foydalaning.","टीवी की आवाज़ एडजस्ट करने के लिए रिमोट का प्रयोग करें. और टीवी का स्पीकर ऑफ़ है","Використовуйте ТВ-пульт ДУ для регулювання гучності, коли динамік телевізора вимкнений.","Gunakan alat kawalan jauh TV untuk melaraskan kelantangan dan pembesar suara TV dimatikan.","השתמש בשלט הטלוויזיה כדי לכוון את עצמת השמע של הטלוויזיה ולכבות את הרמקולים ","Pomocí dálkového ovladače televizoru nastavte hlasitost a TV reproduktor je vypnutý.","Pomocou diaľkového ovládača televízora nastavte hlasitosť a TV reproduktor je vypnutý.","Użyj pilota TV, aby dostosować głośność przy wyłączonym głośniku TV.","A hangerő beállításához használja a TV távirányítóját, és a TV hangszórója kikapcsol.","Използвайте дистанционното управление на телевизора за регулиране на силата на звука и изключване на говорителите.","برای تنظیم صدا در حالیکه بلندگوی تلویزیون خاموش است، از کنترل از راه دور تلویزیون استفاده کنید.","Gunakan remote TV untuk mengatur volume dan speaker TV dalam keadaan mati.","N/A"],
    "Adjust the volume with the remote control of the amplifier or the soundbar.":["","Adjust the volume with the remote control of the amplifier or the soundbar.","Lautstärke mit der Fernbedienung des Verstärkers oder der Soundbar einstellen.","Usa l'amplificatore o il telecomando della barra audio per regolare il volume. ","Use o amplificador ou o comando da barra de som para ajustar o volume.","Utilice el control remoto de la barra de sonido o amplificador para ajustar el volumen.","Utilisez la télécommande de l'amplificateur ou de la barre de son pour régler le volume .","Bruk fjernkontroll for forsterker eller lydplanke for å justere volumet.","Använd förstärkaren eller ljud bar fjärrkontrollen för att justera volymen.","Brug forstærker eller soundbar'ens fjernbetjening til at justere lydstyrken.","Käytä vahvistinta tai soundbarin kaukosäädintä äänenvoimakkuuden muuttamiseen.","Sesi ayarlamak için sound bar'ın ya da yükselticinin uzaktan kumandasını kullanın.","استخدام مكبر للصوت أو عنصر تحكم شريط الصوت عن بعد لضبط مستوى الصوت.","Используйте пульт ДУ усилителя или саундбара для регулирования громкости.","Sử dụng các bộ khuếch đại (Amply) hoặc điều khiển từ xa thanh âm thanh để điều chỉnh âm lượng.","ใช้เครื่องขยายหรือรีโมทคอนโทรลของแถบเสียงเพื่อปรับระดับเสียง","အသံညႇိရန္ ခ်ဲ႕စက္ (သို႔) အသံဘား၏ အေဝးထိန္း ကိရိယာကို သံုးပါ။","Tovush balandligini sozlash uchun kuchaytirgich yoki tovush paneli masofa pultidan foydalaning.","आवाज़ एडजस्ट करने के लिए एंप्लीफायर या साउंड बार के रिमोट कंट्रोल का प्रयोग करें ","Використовуйте пульт ДУ підсилювача або саундбара для регулювання гучності.","Gunakan penguat atau kawalan jauh bar bunyi untuk melaraskan kelantangan.","השתמש בשלט רחוק של המגבר או של מערכת השמע כדי לכוון את עצמת השמע","Použijte dálkové ovládání zesilovače nebo Sound Bar k nastavení hlasitosti.","Použite diaľkové ovládanie zosilňovača alebo Sound Bar na nastavenie hlasitosti.","Użyj wzmacniacza lub zdalnego sterowania paskiem dźwięku, aby dostosować głośność.","A hangerő beállításához használja az erősítő vagy a hangprojektor távirányítóját.","Използвайте дистанционното управление на усилвателя или саундбара, за да настроите силата на звука.","برای تنظیم صدا، از تقویت‌کننده یا نوار صدا روی کنترل از راه دور استفاده کنید.","Gunakan amplifier atau remote kontrol soundbar untuk mengatur volume","N/A"],
