    "Wait for the external device to connect.":["等待外部设备连接","Wait for the external device to connect.","Verbindung des externen Geräts abwarten.","Attendere che il dispositivo esterno si connetta.","Aguarde até que o dispositivo externo se conecte.","Espere a que el dispositivo externo se conecte.","Attendez que l'appareil externe soit connecté.","Vent til den eksterne enheten er tilkoblet.","Vänta på att den externa enheten ska ansluta.","Vent på at den eksterne enhed forbindes.","Odota ulkoisen laitteen yhdistymistä.","Harici cihazın bağlanmasını bekleyin.","انتظر حتى يتم توصيل الجهاز الخارجي.","Подождите, пока внешнее устройство подключится.","Đợi cho thiết bị ngoại vi kết nối","รออุปกรณ์ภายนอกเชื่อมต่อ","ျပင္ပကိရိယာႏွင့္ ခ်ိတ္ဆက္ရန္ ေစာင့္ပါ။","Tashqi qurilma ulanishini kutib turing.","कनेक्शन के लिए रूकें","Зачекайте, поки зовнішній пристрій підключиться.","Tunggu untuk peranti luaran untuk bersambung.","המתן עד שהמכשיר החיצוני יתחבר","Počkejte na připojení externího zařízení.","Počkajte na pripojenie externého zariadenia.","Poczekaj na podłączenie urządzenia zewnętrznego.","Várjon a külső berendezés csatlakozására","Изчакване за свързване с външното устройство.","صبر کنید تا دستگاه خارجی متصل شود.","Tunggu perangkat eksternal untuk disambungkan.","N/A"],
