    "Are you sure you want to disconnect?":["是否确认要断开连接？","Are you sure you want to disconnect?","Wirklich trennen?","Sicuro di voler disconnettersi?","Tem certeza que deseja desconectar-se?","¿Seguro que desea desconectar?","Voulez-vous vraiment vous déconnecter?","Er du sikker på at du vil koble fra?","Är du säker du vill koppla ifrån?","Er du sikker på du vil afbryde?","Haluatko varmasti katkaista yhteyden?","Bağlantıyı kesmek istediğinizden emin misiniz?","هل تريد قطع الاتصال؟","Хотите разорвать соединение?","Quý vị chắc chắn muốn ngắt kết nối không?","คุณแน่ใจว่าต้องการตัดการเชื่อมต่อหรือไม่","ခ်ိတ္ဆက္မႈျဖဳတ္လိုသည္မွာ ေသခ်ာပါသလား။","Uzmoqchi ekaningizga ishonchingiz komilmi?","डिसकनेक्ट कर दें ?","Хочете розірвати з'єднання?","Adakah anda pasti untuk putuskan sambungan?","האם אתם בטוח שתרצה להתנתק?","Jste si jisti, že chcete odpojit?","Ste si istí, že chcete odpojiť?","Czy na pewno chcesz rozłączyć?","Biztosan szét akar kapcsolni?","Сигурни ли сте, че искате да прекъснете връзката?","آیا می‌خواهید اتصال را قطع کنید؟","Anda yakin ingin memutus koneksi?","N/A"],
    "In order to use this application, a Wi-Fi connection is required. Go to Network Settings to connect to Wi-Fi.":["只有Wi-Fi连接时，才可使用此应用。请在网络设置下连接Wi-Fi","In order to use this application, a Wi-Fi connection is required. Go to Network Settings to connect to Wi-Fi.","Für die Nutzung dieser Anwendung ist eine Wi-Fi-Verbindung erforderlich. Öffnen Sie die Netzwerkeinstellungen und verbinden Sie mit Wi-Fi.","Per utilizzare quest'applicazione, è richiesta una connessione Wi-Fi. Andare in Impostazioni di rete per connettersi al Wi-Fi.","Para utilizar esta aplicação, é necessária uma conexão Wi-Fi .Vá ao menu de configurações de rede para se conectar à conexão Wi-Fi.","Para utilizar esta aplicación, se requiere una conexión Wi-Fi. Vaya a Configuración de red para conectarse a Wi-Fi.","Pour utiliser cette application, une connexion Wi-Fi est nécessaire. Allez dans Configuration Réseau pour vous connecter au Wi-Fi.","For å bruke denne applikasjonen kreves det en Wi-Fi-tilkobling. Gå til nettverksinnstillinger for å koble deg til Wi-Fi.","För att kunna använda detta program krävs det en Wi-Fi anslutning. Gå till nätverksinställningar för att ansluta till Wi-Fi.","For at bruge dette program, kræves en Wi-Fi-forbindelse. Gå til Netværksindstillinger for at oprette forbindelse til Wi-Fi.","Tarvitset Wi-Fi-yhteyden, jotta voit käyttää tätä sovellusta.","Bu uygulamayı kullanmak için bir Wi-Fi bağlantısı gerekli. Wi-Fi bağlantısı yapmak için Ağ Ayarlarına gidin.","من أجل استخدام هذا التطبيق، مطلوب اتصال الواي فاي. انتقل إلى إعدادات الشبكة لتوصيل الواي فاي.","Чтобы использовать приложение, требуется Wi-Fi. Перейдите в \"Настройки сети\", чтобы подключиться к Wi-Fi.","Để sử dụng ứng dụng này, một kết nối Wi-Fi là cần thiết. Vào Cài Đặt Mạng để kết nối Wi-Fi. ","เพื่อที่จะใช้งานแอพพลิเคชันนี้ จะต้องมีการเชื่อมต่อ Wi-Fi ให้ไปที่การตั้งค่าเครือข่ายเพื่อเชื่อมต่อเข้ากับ Wi-Fi","ဤအပလီေကးရွင္းကို အသံုးျပဳရန္အတြက္ Wi-Fi ခ်ိတ္ဆက္မႈတစ္ခု လိုအပ္သည္။ Wi-Fi သို႔ ခ်ိတ္ဆက္ရန္ ကြန္ရက္ဆက္တင္မ်ားသို႔ သြားပါ။ ","Bu ilovadan foydalanish uchun Wi-Fi'ga ulanish talab etiladi. Wi-Fi'ga ulanish uchun tarmoq sozlamalariga kiring.","एपलिकेशन के लिए वाईफ़ाई कनेक्शन चाहिए. नेटवर्क सेटिंग्स में है वाईफ़ाई.","Щоб користуватися цією програмою, потрібно Wi-Fi з'єднання. Відкрийте меню \"Налаштування мережі\", щоб підключитися до Wi-Fi.","Untuk menggunakan aplikasi ini, sambungan Wi-Fi adalah diperlukan. Pergi ke Tetapan Rangkaian untuk bersambung kepada Wi-Fi.","על מנת להשתמש ביישום זה דרוש חיבור רשת אינטרנט אלחוטית (Wi-Fi). היכנס להגדרות הרשת על מנת להתחבר לרשת האלחוטית","Pro používání této aplikace je třeba Wi-Fi připojení. Vstupte do menu Nastavení sítě pro připojení k Wi-Fi.","Pre používanie tejto aplikácie je potrebné Wi-Fi pripojenie. Vstúpte do menu Nastavenie siete pre pripojenie k Wi-Fi.","Do korzystania z tej aplikacji wymagane jest połączenie Wi-Fi. Przejdź do ustawień sieci, aby połączyć z Wi-Fi.","Ennek az alkalmazásnak a használatához Wi-Fi kapcsolat szükséges. Lépjen be a Hálózati beállítások pontba és csatlakozzon a Wi-Fi hálózatra.","За да използвате това приложение ви е нужна Wi-Fi връзка. За да се свържете към Wi-Fi, влезте в мрежови настройки.","برای استفاده از این برنامه، اتصال وای فای الزامی است. برای اتصال به وای فای، به تنظیمات شبکه بروید.","Untuk menggunakan aplikasi ini, diperlukan koneksi Wi-Fi. Buka Pengaturan Jaringan untuk menyambung ke Wi-Fi.","N/A"],
