    "First, please connect an antenna. Start channel scan now?\n\nIf you skip this step, the channel scan can be performed later via the Menu.":["","First, please connect an antenna. Start channel scan now?\n\nIf you skip this step, the channel scan can be performed later via the Menu.","Zuerst die Antenne anschließen.\n\Sendersuche jetzt starten?\n\Wird dieser Schritt überprungen, kann er über das Menü durchgeführt werden.","Prima di tutto, collegare l'antenna. \n\n avviare scansione canali adesso? \n\n Se si salta questo passaggio, la ricerca dei canali può essere eseguita nel menu.","Primeiro, conecte a antena.\n\nIniciar o scan de canais agora?\n\nSe saltar este passo, o scan de canais pode ser realizado no Menu.","Primero, por favor conecte la antena.\n\n¿Iniciar exploración de canales ahora?\n\nSi desea saltar este paso, la exploración de canales puede realizarse en el menú.","Veuillez connecter l'antenne dans un premier temps.\n\nDémarrer la recherche des chaînes maintenant ?\n\nSi vous ignorez cette étape, la recherche des chaînes pourra être effectuée dans le Menu.","Først må du koble til en antenne.\n\nStarte kanalsøk nå?\n\nHvis du hoppe over dette trinnet, kan du starte kanalsøket fra menyen.","Först, vänligen anslut antenn.\n\nStarta kanalsökning nu ?\n\nOm du hoppar över detta steg kan kanalsökning utföras i menyn.","Først skal du tilslutte antennen.\n\nStart kanalsøgning nu?\n\nHvis du springer dette trin over, kan kanalscanningen udføres via Menuen.","Kytke aluksi antenni.\n\nAloita kanavahaku nyt ?\n\nJos hyppäät tämän osion yli, kanavahaun voi suorittaa valikosta.","Lütfen önce anteni bağlayın.\n\nKanal tarama şimdi başlatılsın mı?\n\nBu adımı atlarsanız, kanal tarama Menüde gerçekleştirilebilir.","أولا، الرجاء توصيل الهوائي.\n\n بدء مسح القنوات الآن؟\n\n إذا تخطيت هذه الخطوة، يمكنك إجراء مسح القنوات في القائمة.","Подсоедините антенну.\n\n Начать поиск каналов сейчас? \n\nПри пропуске данного шага можно выполнить поиск каналов через Меню.","Đầu tiên, hãy kết nối ăng-ten.\n\nBắt đầu quét kênh bây giờ ?\n\nNếu quý vị bỏ qua bước này, việc quét kênh có thể được thực hiện trong menu.","อันดับแรก กรุณาเชื่อมต่อเสาอากาศ\n\nเริ่มต้นสแกนช่องรายการตอนนี้หรือไม่\n\nหากคุณข้ามขั้นตอนนี้ การสแกนช่องรายการสามารถกระทำในเมนูได้","အင္တနာကို ဦးစြာ ခ်ိတ္ဆက္ပါ။\n\nယခု ခ်န္နယ္လိုင္း ရွာေဖြမႈ စတင္မလား ?\n\nဤအဆင့္ကို ေက်ာ္သြားလွ်င္ ခ်န္နယ္လိုင္း ရွာေဖြမႈကို မီႏူးတြင္ လုပ္ေဆာင္ႏိုင္သည္။","Avval antennani ulang.\n\nKanallarni skanerlashni hoziroq boshlaysizmi?\n\nAgar bu bosqichni o'tkazib yuborsangiz, kanallarni skanerlashni Menyu orqali amalga oshirishingiz mumkin.","पहले एंटिना कनेक्ट करें.\n\nचैनल स्कैन शूरू करें?\n\n अगर यह कदम छोड़ा, चैनल स्कैन मीनू में भी हो सकता है. ","Спочатку підключіть антену.\n\n Почати пошук каналів зараз?\n\nЯкщо пропустити цей крок, можна виконати пошук каналів в меню.","Pertama, sila sambungkan antena.\n\nMula imbasan saluran sekarang?\n\nJika anda melangkau langkah ini, imbasan saluran boleh dilakukan dalam Menu.","ראשית, חבר אנטנה.\n\nלהתחיל בסריקת הערוצים כעת? \n\nאם תדלג על שלב זה, סריקת הערוץ תוכל להתבצע גם מהתפריט","Nejprve připojte anténu, prosím.\n\nSpustiť skenování kanálů teď?\n\nPokud tento krok vynecháte, můžete skenování kanálů uskutečnit v Menu.","Najprv pripojte anténu, prosím.\n\nSpustiť skenovanie kanálov teraz?\n\nAk tento krok vynecháte, môžete skenovanie kanálov uskutočniť v Menu.","Najpierw podłącz antenę.\n\nRozpocznij skanowanie kanałów?\n\nJeśli pominiesz ten krok, skanowanie kanałów będzie można wykonać z poziomu menu.","Először, kérem, csatlakoztassa az antennát. /n\nCsatorna pásztázás kezdése most? /n\nHa kihagyja ezt a lépést, a csatorna pásztázást a Menüben kell elvégezni.","Първо свържете антената.\n\nЗапочнете сканиране за канали сега ?\n\nАко пропуснете тази стъпка, сканирането за канали може да бъде изпълнено от менюто.","لطفا ابتدا آنتن را وصل کنید.\n\nاسکن کانال شروع شود؟\n\nاگر این مرحله را انجام ندهید، اسکن کانال در منو انجام خواهد شد.","Pertama, sambungkan antena.\n\nMulai pemindaian saluran sekarang?\n\nJika Anda melewatkan langkah ini, pemindaian saluran dapat dilakukan di Menu.","N/A"],
