    "The channel scan may take a while to complete.\n\n":["","The channel scan may take a while to complete.\n\n","Die Sendersuche kann einige Zeit dauern.\n\n","La ricerca dei canali può richiedere del tempo per essere completata. \n\n","O scan de canais poderá demorar algum tempo a concluir.\n\n","La exploración de canal podría tardar para completarse.\n\n","La recherche des chaînes peut prendre du temps.\n\n","Kanalsøket kan ta litt tid.\n\n","Denna kanalsökning kan ta en stund att fullborda.\n\n","Kanalenscanning kan tage et stykke tid at fuldføre.\n\n","Kanavahaku saattaa kestää jonkin aikaa.\n\n","Kanal tarama işleminin tamamlanması biraz zaman alabilir.\n\n","مسح القناة قد يستغرق فترة قصيرة حتى يكتمل.\n\n","Поиск каналов может длиться некоторое время.\n\n","Quét Kênh sẽ hoàn thành trong giây lát.\n\n","การสแกนช่องรายการอาจใช้เวลาสักครู่เพื่อดำเนินการ\n\n","ခ်န္နယ္လိုင္း ရွာေဖြမႈသည္ ၿပီးစီးရန္ အခ်ိန္ အနည္းငယ္ ၾကာႏိုင္သည္။\n\n","Kanallarni skanerlash bir necha daqiqa davom etadi.\n\n","चैनल स्कैन पूरा होने में थोड़ी देर लग सकती है\n\n","Пошук каналів може тривати деякий час.\n\n","Imbasan saluran mungkin mengambil sedikit masa untuk disiapkan.\n\n","סריקת הערוץ עשויה לקחת זמן מה עד שתושלם.\n\n","Dokončení skenování kanálů může trvat delší dobu.\n\n","Dokončenie skenovania kanálov môže trvať dlhší čas.\n\n","Skanowanie kanałów może zająć kilka chwil.\n\n","A csatorna pásztázás eltarthat néhány percig.\n\n","Сканирането за канали може да отнеме известно време.\n\n","اسکن کانال ممکن است لحظاتی طول بکشد.\n\n","Pemindaian saluran membutuhkan beberapa saat untuk menyelesaikan.\n\n","N/A"],
