    "Congratulations !!\n\nCompleted Initial Setup.\n\nPlease press [ENTER] to exit the wizard.":["","Congratulations !!\n\nCompleted Initial Setup.\n\nPlease press [ENTER] to exit the wizard.","Herzlichen Glückwunsch !!\n\nErstmalige Einstellung abgeschlossen.\n\nZum Verlassen des Installationsassistenten [ENTER] drücken.","Congratulazioni!!\n\nConfigurazione Iniziale Completata.\n\nSi prega di premere [ENTER] per uscire dalla procedura guidata.","Parabéns !! \n\n A completar a configuração inicial. \n\nPor favor, pressione [ENTER] para sair do assistente.","¡¡¡Felicidades!!!\n\nFinalizada la configuración inicial.\n\nPulse [ENTER] para salir del asistente.","Félicitations !! \ \ n \ nLa configuration est terminée. \n\nVeuillez appuyez sur [ENTER] pour quitter l'assistant. ","Gratulerer!\n\nFørstegangsoppsett er fullført.\n\nTrykk [ENTER] for å avslutte veiviseren.","Grattis!!\n\nHar fullbordat inledande inställning.\n\nVänligen tryck på [ENTER] för att lämna guiden.","Tillykke !!\n\Indledende opsætning er færdig.\n\nTryk på [ENTER] for at afslutte guiden.","Onneksi olkoon !!\n\nAlkuasennus on valmis.\n\nPaina [ENTER]-painiketta päättääksesi ohjatun asennuksen.","Tebrikler!\n\nİlk Ayar Tamamlandı.\n\nSihirbazdan çıkmak için lütfen [ENTER] tuşuna basın.","تهانينا!!\n\n تم الانتهاء من التثبيت الاولي.\n\n الرجاء اضغط على [دخول] للخروج من برنامج التثبيت.","Поздравляем !!\n\nПервоначальная настройка выполнена.\n\nНажмите [ENTER] для выхода из мастера.","Xin chúc mừng !!\n\nHoàn Thành Cài Đặt Ban Đầu.\n\nHãy nhấn [ENTER] để thoát trình cài đặt.","ขอแสดงความยินดี !!\n\nการตั้งค่าแรกเริ่มสำเร็จแล้ว\n\nกรุณากด [ENTER] เพื่อออกจากตัวช่วยสร้าง","ဂုဏ္ယူပါသည္ !!\n\nကနဦး တပ္ဆင္ဖြဲ႕စည္းမႈ ၿပီးပါၿပီ။\n\nအကူအညီခန္းကို ပိတ္ရန္ [ENTER] ကို ႏွိပ္ပါ။","Tabriklaymiz !!\n\nBoshlang'ich sozlash tugallandi.\n\nYo'riqchidan chiqib ketish uchun [ENTER] ni bosing.","मुबारक हो!!\n\n शुरूआती सेट अप हो गया. \n\nअब विज़र्ड से बाहर आने के लिए [ENTER] एंटर दबाएं. ","Вітаємо !!\n\nПочаткове встановлення завершено.\n\nНатисніть [ENTER] для виходу з майстра.","Tahniah!!\n\nTetapan Awal Selesai.\n\nSila tekan [ENTER] untuk keluar dari wizard.","ברכותינו!!\n\nההתקנה הראשונית הסתיימה. \n\nבבקשה לחצו על [ENTER] ליציאה מהאשף","Gratulujeme!\n\nPočiatočné nastavení je dokončeno.\n\nProsím stiskněte tlačítko [ENTER] pro zavření průvodce.","Gratulujeme!\n\nPočiatočné nastavenie je dokončené.\n\nProsím stlačte tlačidlo [ENTER] pre zatvorenie sprievodcu.","Gratulacje! Zakończono ustawianie początkowe. \n\nNaciśnij [ENTER], aby opuścić kreatora.","Gratulálunk!!\n\nA kezdeti beállítás sikeresen lefutott.\n\nKérem, nyomja meg az [ENTER] gombot a varázslóból való kilépéshez.","Поздравления !!\n\nПървоначалната настройка е завършена.\n\nМоля натиснете [ENTER] за изключване на помощника.","تبریک!!\n\nنصب اولیه تکمیل شد.\n\nلطفا برای خروج از ویزارد [ورود] را فشار دهید.","Selamat !!\n\nPersiapan Awal Selesai.\n\nTekan [ENTER] untuk keluar dari wizard.","N/A"],
