    "You can select only one operator from the following list.":["","You can select only one operator from the following list.","Sie können nur einen Betreiber aus der nachfolgenden Liste auswählen.","È possibile selezionare solo un operatore dalla seguente lista.","Pode selecionar apenas um operador na lista a seguir.","Puede seleccionar un operador de la lista siguiente.","Vous pouvez sélectionner un seul founisseur de service dans la liste suivante.","Du kan bare velge én operatør fra listen.","Du kan välja endast en operatör från följande lista.","Du kan kun vælge én operatør på følgende liste.","Voit valita vain yhden seuraavista palveluntarjoajista.","Aşağıdaki listeden yalnızca bir operatör seçebilirsiniz.","يمكنك اختيار مشغل واحد فقط من القائمة التالية. ","Можно выбрать только одного оператора из следующего списка.","Quý vị chỉ có thể chọn một nhà cung cấp trong danh sách sau. ","คุณสามารถเลือกได้เพียงหนึ่งผู้ให้บริการเท่านั้นจากรายชื่อต่อไปนี้","ေအာက္ပါစရင္းမွ ေအာ္ပေရတာ တစ္ခုသာလွ်င္ သင္ေရြးႏိုင္သည္။","Quyidagi ro'yxatdan faqat bitta operatorni tanlashingiz mumkin.","सूचि में से केवल एक आप्रेटर चुनें","Можна вибрати тільки одного оператора з наступного списку.","Anda boleh memilih hanya satu operator daripada senarai berikut.","אתה יכול לבחור רק מפעיל אחד מתוך הרשימה הבאה","Můžete si vybrat pouze jeden operátor z následujícího seznamu.","Môžete si vybrať iba jeden operátor z nasledujúceho zoznamu.","Możesz wybrać tylko jednego operatora z poniższej listy.","Csak egy szolgáltatót választhat ki az alábbi listából.","Можете да изберете само един оператор от следния списък.","شما می‌توانید تنها یکی از اپراتورهای لیست زیر را انتخاب کنید.","Anda dapat memilih satu operator saja dari daftar berikut ini","N/A"],
