    "More than one of the IP Address, Subnet Mask and Default Gateway is invalid. Please enter again!":["","More than one of the IP Address, Subnet Mask and Default Gateway is invalid. Please enter again!","IP-Adresse, Subnetz-Maske oder Standard-Gateway ungültig. Bitte erneut eingeben!","Più di un Indirizzo IP, Subnet Mask e Gateway Predefinito non sono validi. Si prega di inserirli nuovamente! ","Mais do que um do endereço IP, inválido.Por entrar novamente!","Más de una dirección IP, máscara de subred y puerta de enlace predeterminada es invalida. ¡Introduzca de nuevo!","L'adresse IP, le masque de sous-réseau ou la passerelle par défaut, est invalide. Merci de ressaisir vos informations!","Det er en ugyldig oppføring i enten IP-adresse, nettverksmaske eller standard gateway. Legg inn på nytt!","Mer än en av IP-adresserna, Subnät och Standard gateway är ogilitiga. Vänligen ange på nytt!","Mere end en af følgende er ugyldig: ​​IP-adresse, undernetmaske og standard-gateway. Prøv at indtaste igen!","IP-osoitteen, aliverkon peitteen ja/tai oletusyhdyskäytävän tiedot ovat virheelliset. Yritä uudelleen! ","IP Adresi, Alt Ağ Maskesi ve Varsayılan Ağ Geçidi değerlerinin birinden fazlası geçersiz. Lütfen tekrar girin!","أكثر من عنوان IP وقناع الشبكة الفرعية البوابة الافتراضية غير صحيح. من فضلك ادخل القيم مرة أخرى!","IP-адрес, маска подсети или шлюз по умолчанию указаны неверно. Введите ещё раз!","Nhiều hơn một địa chỉ IP, Subnet Mask và Default Gateway là invalid.Please lòng nhập lại!","มีไอพีแอดเดรสมากกว่าหนึ่ง ซับเน็ตมาสค์และเกตเวย์เริ่มต้นไม่ถูกต้อง กรุณาป้อนใหม่อีกครั้ง!","IP လိပ္စာ၊ ကြန္ယက္ခြဲ ကုဒ္နံပါတ္ႏွင့္ မူရင္းပါပံုစံ ဂိတ္ေဝးတို႔မွ တစ္ခုမကေသာ အရာသည္ မမွန္ပါ။ ေက်းဇူးျပဳ၍ ထပ္မံ ထည့္သြင္းပါ!","Birdan ortiq IP-manzil, subtarmoq niqob va sukut bo'yicha shlyuz noto'g'ri.Qaytadan kiriting!","एक से अधिक आईपी पता, सबनेट मास्क औऱ डिफाल्ट गेटवे गलत है. फिर से भरें.","IP-адреса, маска підмережі або шлюз за замовчуванням вказані невірно. Введіть ще раз!","Lebih daripada satu alamat IP, Subnet Mask dan Default Gateway adalah tidak sah. Sila masuk lagi!","יותר מאחת מכתובות ה-IP, Subnet Mask וה-Default Gateway אינה חוקית. אנא הזן שוב!","Více než jedna z IP adresy, Masky podsítě a Výchozí brány je neplatná. Prosíme, zadejte je znovu!","Viac ako jedna z IP adresy, Masky podsiete a Predvolenej brány je neplatná. Prosíme, zadajte ich znova!","Więcej niż jeden element z następujących: adres IP, maska podsieci i brama domyślna jest nieprawidłowy. Wprowadź ponownie!","A megadott IP cím, alhálózati maszk és alapértelmezett átjáró közül több érvénytelen. Kérem, adja meg újra!","IP адреса, подмрежовата маска или шлюз по подразбиране са невалидни. Моля въведете отново!","بیش از یکی از موارد زیر نامعتبر است: آدرس IP، ماسک زیرشبکه و دروازه پیش فرض. لطفاً دوباره وارد کنید! ","Lebih dari satu Alamat IP. Subnet Mask dan Default Gateway tidak valid. Silakan masukkan lagi!","N/A"],
