    "The valid length of SSID is 1~32 characters.\nPlease check the SSID.":["","The valid length of SSID is 1~32 characters.\nPlease check the SSID.","Die SSID darf 1~32 Zeichen lang sein.\nBitte SSID überprüfen.","La lunghezza valida dell'SSID è 1-32 caratteri.\nSi prega di controllare l'SSID.","O comprimento válido para a SSID é entre 1~ 32 caracteres.\nPor favor, verifique o SSID.","La longitud válida de SSID es 1 ~ 32 caracteres.\nCompruebe el SSID.","La longueur valide d'un SSID est de 1 à 32 caractères. \nVérifiez le nom de votre SSID.","Gyldig lengde på SSID er 1~32 tegn.\nVennligst sjekk SSID.","Den giltiga längden av SSID är 1~32 tecken.\nVänligen kontrollera SSID. ","Den gyldige længde SSID er 1~32 tegn.\nKontrollér SSID.","SSID-tunnuksen tulee olla pituudeltaan 1-32 merkkiä. \nTarkista SSID-tunnus","Geçerli SSID uzunluğu 1~32 karakterdir.\nLütfen SSID bilgisini kontrol edin.","طول اسم الـSSID يجب ان يكون ما بين 1- 32 حرفا.\n الرجاء التأكد من اسم الـSSID.","Длина SSID должна составлять от 1 до 32 символов.\nПроверьте SSID.","Độ dài hợp lệ của SSID là 1 ~ 32 ký tự. \nHãy kiểm tra các SSID.","ความยาวที่ถูกต้องของ SSID คือ 1~32 อักขระ \nกรุณาตรวจสอบ SSID","SSID ၏ ပါဝင္ႏိုင္မႈ အရွည္သည္ အကၡရာ 1~32 လံုးျဖစ္သည္။\nေက်းဇူးျပဳ၍ SSID ကို စစ္ေဆးပါ။","SSID mumkin bo'lgan uzunligi 1-32 belgi. \nSSID ni tekshiring."," SSID की सही लंबाई 1 से 32 केरेक्टर्स तक. \n कृप्या SSID चेक करें.","Довжина SSID повинна становити від 1 до 32 символів.\nПеревірте SSID.","Panjang sah SSID adalah 1 ~ 32 aksara.\nSila semak SSID.","האורך החוקי של SSID הוא 1 עד 32 תוים. \n אנא בדוק את ה-SSID","Platné délka SSID je 1~32 znaků.\nZkontrolujte SSID, prosím.","Platná dĺžka SSID je 1~32 znakov.\nSkontrolujte SSID, prosím.","Prawidłowa długość SSID to 1-32 znaków. \nProszę sprawdzić SSID.","Az SSID érvényes hossza 1~32 karakter közötti.\nKérem, ellenőrizze az SSID-t.","Валидната дължина на SSID e от 1 до 32 символа.\nМоля проверете SSID.","طول مجاز SSID بین 1 تا 32 حرف است.\nلطفاً SSID را بررسی کنید.","Panjang SSID yang valid adalah 1~32 karakter.\nSilakan periksa SSID.","N/A"],
