    "There is no record schedule! Please press the \"Add\" key to add one.":["","There is no record schedule! Please press the \"Add\" key to add one.","Es gibt keinen Aufnahmetermin!Zum Hinzufügen eines Termins \"Neu\" drücken.","Non ci sono programmi registrati! Si prega di premere il tasto \"Aggiungi\" per aggiungerne uno.","Não há cronograma gravado! Por favor, pressione \"Adicionar\" para adicionar um.","No hay horario de programación. Presione \"Añadir\" para añadir uno.","Il n'y a aucun enregistrement de planifié ! Veuillez appuyer sur le bouton \"Ajouter \" pour en ajouter un. ","Det er ingen tidsplan for opptak! Trykk på \"Legg til\" for å legge til et opptak.","Det finns inget registerschema! Vänligen tryck på \"lägg till\" knappen för att lägga till en.","Der er ingen planlagt optagelse! Tryk venligst på \"Tilføj\" for at tilføje en.","Tietoja ajastetuista tallennuksista ei löydy! Paina \"Lisää\"-painiketta lisätäksesi uuden ajastetun tallennuksen. ","Hiç kayıt zamanlaması yok! Lütfen bir tane eklemek için \"Ekle\" tuşuna basın.","لا يوجد جدول زمني للتسجيل! يرجى الضغط على مفتاح \"إضافة\" للإضافة.","Нет ни одного расписания записей! Нажмите кнопку \"Добавить\" для добавления.","Không có lịch trình bản ghi!Vui lòng nhấn phím \"Thêm\" để thêm vào.","ไม่มีหมายกำหนดการบันทึกไว้! กรุณากดปุ่ม \"เพิ่ม\" เพื่อเพิ่มเข้า","မွတ္တမ္းတင္ စီစဥ္မႈ မရွိပါ! တစ္ခုထည့္ရန္ \"Add\" ခလုတ္ကို ႏွိပ္ပါ။","Yozish jadvali yo'q!Qo'shish uchun \"Qo'shish\" tugmasini bosing.","रिकार्ड शिडयूल नहीं है. कृप्या \"Add\" की दबाएं.","Немає жодного розкладу записів! Натисніть кнопку \"Додати\", щоб додати розклад.","Tiada jadual rekod! Sila tekan \"Tambah\" untuk menambah satu.","אין הקלטה בלו\"ז! אנא לחץ על \"הוסף\" כדי ליצור אחת","Nenašel se žádný seznam nahrávání! Prosím, stiskněte tlačítko \"Přidat\" pro přidání.","Nenašiel sa žiadny zoznam nahrávania!Prosím, stlačte tlačidlo \"Pridať\" pre pridanie.","Brak zaplanowanego nagrywania! Naciśnij przycisk „Dodaj”, aby dodać nową pozycję.","Nincs felvételi időzítés beállítva. Hozzáadáshoz, kérem, nyomja meg az „Add” gombot.","Няма график за записване! Моля натиснете бутон \"Add\", за да добавите такъв.","هیچ برنامه ضبطی وجود ندارد! لطفا برای افزودن، کلید \"افزودن\" را فشار دهید.","Tidak ada jadwal rekaman!Tekan tombol \"Tambah\" untuk menambahkan satu.","N/A"],
