    "Maximum number of schedules reached!":["","Maximum number of schedules reached!","Mit dem gewünschten Zeitplan wird das zulässige Limit überschritten?","Richiesta superiore al massimo consentito!","Adição de programa pedida excede o máximo permitido!","¡Recordario solicitado excede máximo permitido!","Le nombre de programmes demandés dépasse le nombre maximal autorisé !","Kan ikke legge til tidsplan, maks antall nådd!","Begärd tillägg av schema överstiger högsta tillåtna!","Anmodningen om den planlagte optagelse overstiger det maksimalt tilladte!","Syöttämillesi ajastuksille ei ole tilaa!","Zamanlama ekleme isteği, izin verilen maksimum sayıyı aşıyor!","طلبات إضافة الجداول الزمنية تجاوزت الحد الأقصى المسموح به!","Достигнут максимум записей по расписанию!","Yêu cầu thêm lịch trình đã vượt quá giới hạn cho phép! ","การเพิ่มกำหนดการที่ร้องขอเกินกว่าจำนวนที่อนุญาตแล้ว!","စီစဥ္မႈ ထည့္သြင္းရန္ ေတာင္းဆိုခ်က္သည္ အမ်ားဆံုး ခြင့္ျပဳခ်က္ကို ေက်ာ္သြားၿပီ!","So'ralgan jadval qo'shish mumkin maksimaldan oshdi!","शिडयूल अधिक्तम सीमा से अधिक है","Запитуване доповнення до розкладу перевищує максимально допустиме!","Permintaan tambah jadual melebihi had maksimum!","בקשת הוספת הארוע עולה על כמות הארועים המירבית המותרת!","Požadované přidání harmonogramu překračuje povolené maximum!","Požadované pridanie harmonogramu prekračuje povolené maximum!","Żądane dodanie zaplanowanej operacji przekracza dopuszczalne maksimum!","A kért programterv-hozzáadás meghaladja a megengedett maximumot!","Желаната добавка в графика надвишава разрешения максимум!"," برنامه زمانبندی درخواستی از حداکثر میزان مجاز بیشتر است.","Penambahan jadwal yang diminta melampaui jumlah maksimum yang diperbolehkan!","N/A"],
