    "Warning: During the process, do not disconnect the TV from the electrical outlet as this could damage the unit.":["","Warning: During the process, do not disconnect the TV from the electrical outlet as this could damage the unit.","Warnung: Während des Vorgangs nicht den Fernseher vom Netzstrom trennen, da dies das Gerät beschädigen könnte.","Attenzione: Durante il processo, si prega di non scollegare il cavo d'alimentazione dell'impianto TV in quanto può causare un guasto all'impianto TV.","Atenção: Durante o processo. Por favor, não desligue o cabo de alimentação da TV isso vai levar a definições da TV com defeito.","Advertencia: durante el proceso, no desconecte el cable de alimentación de la TV ya que dará lugar a defectos de configuración de la TV.","Attention: Pendant la mise à jour. Veuillez ne pas débrancher le cordon d'alimentation du téléviseur car cela peut l'endommager.","Advarsel: I løpet av prosessen må du ikke koble TV-apparatet fra strømmen, da dette vil føre til skade på TV-apparatet.","Varning: Under processen. Vänligen koppla inte ifrån TV strömkoden då detta kommer att leda till defekta Tv:n.","Advarsel: Under processen. Fjern ikke strømmen eller sluk for Tv'et da dette vil ødelægge TV'et","Varoitus: Älä kytke TV:n virtaa pois päivityksen aikana. Mikäli näin tapahtuu, TV ei enää jatkossa toimi normaalisti. ","Uyarı: Televizyonda kusura yol açabileceğinden, işlem sırasında lütfen televizyon güç kodunu çıkarmayın.","تحذير: خلال هذه العملية. يرجى عدم فصل جهاز التلفزيون من الطاقة لأن ذلك سوف يؤدي إلى حدوث عطل في التلفزيون.","Предупреждение: Во время обновления ПО не отключайте ТВ от сети, т.к. он может повредиться.","Cảnh báo: Trong suốt quá trình này. Xin vui lòng không tháo mã nguồn điện TV Set vì điều này sẽ dẫn đến TV Set bị lỗi.","คำเตือน: ในระหว่างกระบวนการนี้ กรุณาอย่าถอดปลั๊กสายไฟเนื่องจากอาจทำให้เกิดความเสียหายต่อทีวีได้","သတိေပးခ်က္ : ျဖစ္စဥ္အတြင္းတြင္ TV စက္ ပါဝါႀကိဳး ျဖဳတ္ျခင္းသည္ TV စက္ကို ဆိုးက်ဳိးျဖစ္ေစသည့္အတြက္ ပါဝါ မျဖဳတ္ရပါ။","Ogohlantirish: Jarayon mobaynida. Televizor quvvat simini rozetkadan uzmang, aks holda televizorda nosozlik yuzaga kelishi mumkin.","चेतावनी : प्रक्रिया के दौरान, टीवी को बंद न करें, इससे टीवी खराब हो सकता है.","Попередження: Виконується процес. Не відключайте ТВ від мережі, тому що він може пошкодитися.","Amaran: Semasa proses. Sila jangan cabut kod kuasa Set TV kerana ini akan menyebabkan kerosakan Set TV.","אזהרה: במהלך התהליך, אל תנתק את הטלוויזיה מהחשמל, שכן הדבר עשוי להזיק לטלוויזיה","Upozornění: Během procesu. Prosím, neodpojujte napájecí kabel televizoru protože to může vést k poruše televizoru.","Upozornenie: Počas procesu. Prosím, neodpájajte napájací kábel televízora pretože to môže viesť k poruche televízora.","Ostrzeżenie: Podczas procesu. Nie odłączaj kabla zasilającego, ponieważ może to spowodować uszkodzenia telewizora.","Figyelmeztetés: a folyamat során. Kérem, ne húzza ki a hálózati kábelt, mert az készüléke károsodásához vezethet.","Внимание: По време на процеса не изключвайте телевизора от захранването. Това би причинило повреди.","اخطار: لطفا در طول این فرایند تلویزیون را از برق بیرون نکشید، این کار موجب ایجاد نقص در دستگاه خواهد شد.","Peringatan: Selama proses. Jangan mencabut kode listrik TV karena ini akan menyebabkan TV rusak.","N/A"],
