    " Software Update. There is a new recommended software version on another channel. If you choose to download it, it may change to the channel automatically. Continue?":[""," Software Update. There is a new recommended software version on another channel. If you choose to download it, it may change to the channel automatically. Continue?","Softwareaktualisierung. Es gibt eine neue empfohlene Software-Version auf einem anderen Sender. Falls Sie den Download akzeptieren, wird der Sender automatisch eingeschaltet. Jetzt fortfahren?","Aggiornamento di software. Un nuovo aggiornamento di software raccomandato potrebbe esistere in un altro canale. Se accetti di scaricarlo, potrebbe cambiare il canale in automatico. Desideri farlo adesso?","Actualização de software. Uma nova atualização de software recomendado pode existir em outro canal. Se aceitar baixar, pode mudar para o canal agora?","Actualización de software. Una nueva actualización de software recomendada puede existir en otro canal. Si acepta descargarlo, puede cambiar al canal de forma automática. ¿Quieres hacerlo ahora?","Mise à jour logiciel. Une nouvelle mise à jour du logiciel existe sur une autre chaîne. Si vous acceptez de le télécharger, la chaîne peut être automatiquement changée. Souhaitez-vous l'effectuer maintenant? ","Programvareoppdatering. En ny anbefalt programvareoppdatering kan være tilgjengelig på en annen kanal. Hvis du velger å laste den ned, kan den skifte til kanalen automatisk. Ønsker du å gjøre dette nå?","Programvaruuppdatering. En ny rekommenderad programvaruuppdatering kanske existerar i en annan kanal. Om du accepterar att ladda ned den, kan den ändras till kanalen automatiskt. Vill du göra det just nu?","Software opdatering. Der findes en ny anbefalet softwareopdatering på en anden kanal. Hvis du accepterer at hente den, kan den automatisk skifte til den kanal. Vil gøre det med det samme?","Ohjelmistopäivitys. Uusi, suositeltava ohjelmistopäivitys on saatavilla toisen kanavan kautta. Jos haluat ladata tämän päivityksen, siirryt kyseiselle kanavalle automaattisesti. Haluatko tehdä tämän nyt heti?","Yazılım güncelleme. Başka bir kanalda yeni bir önerilen yazılım güncellemesi olabilir. İndirmeyi kabul ederseniz, otomatik olarak kanala değiştirebilir. Hemen şimdi yapmak ister misiniz?","تحديث البرامج. يوجد تحديث جديد لبرامج موصى به في قناة أخرى. اذا انت موافق على تحميل البرنامج، قد تغيير إلى القناة تلقائيا. هل تريد أن تفعل ذلك الآن؟ ","Обновление ПО. Новое обновление рекомендованного ПО доступно на другом канале. Если начать загрузку, возможно, произойдет автоматический переход на этот канал. Продолжить?","Cập nhật phần mềm. Một bản cập nhật phần mềm dược đề nghị mới có thể có sẵn trong các kênh khác. Nếu quý vị chấp nhận để tải về, nó có thể thay đổi vào kênh tự động. Quý vị có muốn làm điều đó ngay bây giờ?","ซอฟต์แวร์อัปเดท ชุดอัปเดทซอฟต์แวร์อัตโนมัติอาจมีอยู่ในช่องรายการอื่น หากคุณยอมรับเพื่อดาวน์โหลด มันอาจเปลี่ยนแปลงไปสู่ช่องรายการดังกล่าวโดยอัตโนมัติ คุณต้องการกระทำในตอนนี้หรือไม่","ေဆာ့ဖ္ဝဲ အပ္ဒိတ္။ အႀကံျပဳထားသည့္ ေဆာ့ဖ္ဝဲ အပ္ဒိတ္သည္ အျခားခ်န္နယ္လိုင္းကို ပိတ္သြားႏိုင္သည္။ ေဒါင္းလုတ္လုပ္ရန္ သင္လက္ခံလွ်င္ ၄င္းသည္ ခ်န္နယ္လိုင္းကို အလိုအေလ်ာက္ ေျပာင္းသြားႏိုင္သည္။ ယခုပင္ လုပ္လိုသလား?","Dasturiy ta'minotni yangilash. Yangi tavsiya etilgan dasturiy ta'minot yangilovi boshqa kanalda mavjud bo'lishi mumkin. Agar uni yuklab olishni qabul qilsangiz, u o'sha kanalga avtomatik tarzda o'zgarishi mumkin. Buni hozir amalga oshirishni xohlaysizmi?","सॉफ़्टवेयर अपडेट. नया सॉफ़्टवेयर अपडेट किसी अन्य चैनल में उपलब्ध होगा. अगर चाउनलोड करें तो चैनल खुद बदलेगा. अभी करेंगे? ","Оновлення ПЗ. Можливо, нове оновлення рекомендованого ПЗ є на іншому каналі. Якщо почати завантаження, можливо, відбудеться автоматичний перехід на цей канал. Хочете зробити це прямо зараз?","Kemas kini perisian. Perisian baharu disyorkan mungkin wujud pada saluran lain. Jika anda menerima untuk memuat turunnya, ia mungkin berubah ke saluran tersebut secara automatik. Adakah anda ingin untuk melakukannya sekarang?","עדכון תוכנה. עדכון תוכנה מומלץ חדש עשוי להתקיים בערוץ אחר. אם תאשר את ההורדה שלו, המערכת תהא רשאית לעבור לערוץ ההוא באופן אוטומטי. האם תרצה לעשות זאת כעת?","Aktualizace softwaru. Nová doporučená aktualizace softwaru může existovat na jiném kanálu. Pokud přijmete její stažení, kanál se může změnit automaticky. Chcete to udělat právě teď?","Aktualizácia softvéru. Nová odporúčaná aktualizácia softvéru môže existovať na inom kanáli. Ak prijmete jeho stiahnutie, kanál sa môže zmeniť automaticky. Chcete to urobiť práve teraz?","Aktualizacja oprogramowania. Nowa zalecana aktualizacja oprogramowania może istnieć na innym kanale. Jeśli akceptujesz jej pobranie, może nastąpić automatyczna zmiana kanału. Czy chcesz to wykonać teraz?","Szoftverfrissítés. Új javasolt szoftverfrissítése lehet elérhető egy másik csatornán. Ha elfogadja a letöltését, akkor a készülék automatikusan a másik csatornára válthat. Szeretné ezt most megtenni?","Актуализация на софтуера. Нова препоръчителна актуализация на софтуера може да съществува в друг канал. Ако приемете да я изтеглите, тя може да смени канала автоматично. Желаете ли да изпълните актуализацията сега?","به روزرسانی نرم‌افزار. ممکن است در یک کانال دیگر امکان به روزرسانی پیشنهادی جدید برای نرم‌افزار وجود داشته باشد. در صورت موافقت با بارگیری آن، ممکن است به صورت خودکار کانال عوض شود. آیا می‌خواهید الان آن را انجام دهید؟","Pembaruan perangkat lunak. Pembaruan perangkat lunak baru yang direkomendasikan mungkin ada di saluran lain. Jika Anda setuju untuk mengunduhnya, ini dapat mengubah saluran secara otomatis. Anda ingin melakukannya sekarang?","N/A"],
