    "The TV is about to turn off. Press NO to continue watching.":["","The TV is about to turn off. Press NO to continue watching.","Der Fernseher wird ausgeschaltet. NEIN drücken, um weiter fernzusehen.","La TV sta per spegnersi. Premere NO per continuare la visione.","A TV está prestes a desligar-se. Pressione Não para continuar.","La TV está a punto de apagarse. Presione NO para continuar viendo.","Le téléviseur est sur le point de s'éteindre. Appuyez sur NON pour continuer à regarder.","TV-apparatet slås straks av. Trykk NEI for å la det være på","Tv:n håller på att stängas av. Tryck på NEJ för att fortsätta titta.","TV'et er ved at slukke. Tryk på \"NEJ\" for at fortsætte med at se.","TV sammuu. Paina EI jatkaaksesi katselua.","Televizyon kapanmak üzere. İzlemeye devam etmek için HAYIR seçeneğine basın.","التلفزيون على وشك إيقاف التشغيل. اضغط رقم لمواصلة لمشاهدة.","ТВ сейчас выключится. Нажмите \"НЕТ\" для продолжения просмотра.","TV đang trong tình trạng tắt. Nhấn KHÔNG để tiếp tục xem.","ทีวีกำลังจะปิด กดปุ่ม ไม่ใช่ เพื่อรับชมต่อ","TV ပိတ္ေတာ့မည္ ျဖစ္သည္။ ဆက္လက္ ၾကည့္႐ႈရန္ NO ကို ႏွိပ္ပါ။","Televizor o'chadi. Ko'rishni davom ettirish uchun YO'Q ni bosing.","टीवी बंद होने वाला है. देखते रहने के लिए NO दबाएं","ТВ зараз вимкнеться. Натисніть \"НІ\" для продовження перегляду.","TV akan mematikan. Tekan NO untuk terus menonton.","הטלוויזיה עומדת להיכבות. אנא לחץ על \"לא\" כדי להמשיך לצפות","TV se chystá vypnout. Stisknutím tlačítka NO pokračujte ve sledování.","TV sa chystá vypnúť. Stlačením tlačidla NO pokračujte v sledovaní.","Telewizor zostanie wyłączony. Naciśnij NIE, aby kontynuować oglądanie.","A TV hamarosan kikapcsol. Nyomja meg a NO gombot, ha tovább szeretné nézni.","Телевизорът е на път да се изключи. Натиснете NO, за да продължите да гледате.","تلویزیون در حال خاموش شدن است. برای ادامه مشاهده، کلید NO را فشار دهید.","TV akan mati. Tekan tombol TIDAK untuk melanjutkan menonton.","N/A"],
