    "Flash space is insufficient! If you want to update, please re-insert USB Disk and choose Retry.":["","Flash space is insufficient! If you want to update, please re-insert USB Disk and choose Retry.","Flash-Speicher unzureichend! Für die Aktualisierung ein USB-Gerät anschließen und auf Erneut drücken.","Lo spazio della memoria flash non è sufficiente! Se desideri effettuare l'aggiornamento, inserisci l'USB e premi Riprova.","Espaço não é o suficiente! Se deseja actualizar, por favor insira um USB e pressione Repetir.","¡El espacio de flash no es suficiente! Si desea actualizar, inserte un USB y pulse Reintentar.","Vous n'avez pas assez d'espace disque! Si vous voulez mettre à jour, veuillez insérer une clé USB et appuyer sur Réessayer.","Ikke nok plass på flash! Hvis du vil oppdatere kan du sette inn en USB-pinne, og prøve igjen.","Minneskortets utrymme är inte tillräckligt! Om du vill uppdatera ska du vänligen sätta in USB och trycka på försök igen.","Flash -hukommelse er for lille! Hvis du vil opdatere, skal du indsætte USB'en og trykke på gentag.","Flash-muisti ei riitä!Jos haluat päivittää, kytke USB-tikku ja paina Yritä Uudelleen","Bellek alanı yeterli değil! Güncellemek isterseniz, lütfen USB'yi takıp Tekrar dene düğmesine basın.","مساحة الفلاش غير كافية! إذا كنت تريد التحديث، يرجى ادخال USB والضغط على إعادة المحاولة","Недостаточно места для записи! Для выполнения обновления, подключитесь по USB и нажмите \"Повторить\"."," Không gian Flash không đủ!Nếu quý vị muốn cập nhật, hãy thêm USB và nhấn: Retry","พื้นที่หน่วยความจำแฟลชไม่เพียงพอ! หากคุณต้องการอัปเดท กรุณาเสียบ USB และกด ลองใหม่","ဖလပ္ရွ္ သိုေလွာင္ခန္းေနရာ မလံုေလာက္ပါ!အပ္ဒိတ္ လုပ္လိုလွ်င္ USB ထည့္သြင္းၿပီး ထပ္မံႀကိဳးစားပါကို ႏွိပ္ပါ။","Flesh xotira joyi yetarli emas! Agar yangilashni xohlasangiz, USB'ni qo'ying va Qayta urinish'ni bosing.","फ्लैश में पर्याप्त जगह नहीं. अगर आफ अपडेट करना चाहते हैं, यूएसबी डालकर Retry दबाएं","Недостатньо місця для запису! Для виконання оновлення, підключіться по USB і натисніть \"Повторити\".","Ruang flash tidak cukup! Jika anda ingin mengemas kini, sila masukkan USB dan tekan Retry.","המקום הזמין בזכרון הפלאש אינו מספיק! אם תרצה לנסות לעדכן, אנא הכנס כונן אחסון ל-USB ולחץ על \"נסה שוב\"","\"Flash prostor nestačí! Chcete-li aktualizovat, vložte USB a stiskněte Znovu.","Flash priestor nestačí! Ak chcete aktualizovať, vložte USB a stlačte Znova.","Brak wystarczającej ilości miejsca w pamięci flash! Jeśli chcesz zaktualizować, włóż urządzenie USB i naciśnij Ponów.","Kevés hely van a flash memóriában! Ha szeretne firssíteni, kérem, helyezze be az USB eszközt és nyomja meg a Retry gombot.","Флаш пространството не е достатъчно! Ако желаете да актуализирате, моля поставете USB и натиснете Retry.","فضای موجود در فلش کافی نیست! اگر مایل هستید که به‌روزرسانی کنید، لطفاً USB را وارد کنید و کلید تلاش مجدد را فشار دهید.","Ruang Flash tidak cukup!Jika Anda ingin memperbarui, masukkan USB dan Coba Lagi.","N/A"],
