    "Please press any key to leave this page.":["","Please press any key to leave this page.","Beliebige Taste drücken, um Seite zu verlassen.","Si prega di premere qualsiasi tasto per uscire da questa pagina.","Por favor, pressione qualquer tecla para sair desta página.","Pulse cualquier tecla para salir de esta página.","Veuillez appuyer sur une touche pour quitter cette page .","Trykk en tast for å forlate denne siden.","Vänligen tryck på valfri knapp för att lämna denna sida.","Tryk venligst en tast for at forlade denne side.","Paina mitä tahansa näppäintä poistuaksesi tältä sivulta.","Bu sayfadan ayrılmak için lütfen herhangi bir tuşa basın.","يرجى الضغط على أي مفتاح لمغادرة هذه الصفحة.","Нажмите любую кнопку, чтобы покинуть эту страницу.","Hãy nhấn phím bất kỳ để thoát khỏi trang này.","กรุณากดปุ่มใดๆ เพื่อออกจากหน้านี้","ဤစာမ်က္ႏွာမွ ထြက္ခြာရန္ ခလုတ္ တစ္ခုခုကို ႏွိပ္ပါ။","Ushbu sahifani tark etish uchun istalgan tugmani bosing.","पेज छोड़ने के लिए कोई भी की दबाएं","Натисніть будь-яку кнопку, щоб залишити цю сторінку.","Tekan sebarang kekunci untuk meninggalkan halaman ini.","אנא לחץ על כל מקש על מנת לצאת מעמוד זה. ","Pro opuštění této stránky, stiskněte libovolnou klávesu, prosím.","Pre opustenie tejto stránky, stlačte ľubovoľný kláves, prosím.","Naciśnij dowolny przycisk, aby opuścić stronę.","Kérem, nyomja meg bármely gombot az oldal elhagyásához.","Натиснете произволен клавиш, за да напуснете тази страница.","لطفاً برای ترک این صفحه یکی از کلیدها را فشار دهید.","Tekan tombol apa saja untuk meninggalkan halaman ini.","N/A"],
