    "Please select the file size for timeshift.":["","Please select the file size for timeshift.","Dateigröße für Timeshift auswählen.","Si prega di selezionare la dimensione del file per timeshift.","Por favor, selecione o tamanho do arquivo para o Timeshift. ","Seleccione el tamaño de archivo para Timeshift.","Veuillez sélectionner la taille de la mémoire tampon pour la fonction TimeShift.","Velg filstørrelsen for tidsforskyvning.","Vänligen välj filstorleken för tidsförskjutning.","Vælg filstørrelse til Timeshift.","Valitse tiedostokoko timeshift-toimintoa varten ","Lütfen zaman kaydırma için dosya boyutunu seçin.","يرجى تحديد حجم الملف لالتحكم الزمني.","Выберите размер буфера TimeShift."," Vui lòng chọn kích thước file cho timeshift.","กรุณาเลือกขนาดไฟล์สำหรับฟังก์ชัน timeshift","ကူးယူမႈအတြက္ ဖိုင္အရြယ္ ေရြးပါ။","Vaqtni surish uchun fayl hajmini tanlang.","टाईमशिफ्ट के लिए फाईल साईज चुनें","Виберіть розмір файлу для відкладеного запису.","Sila pilih saiz fail untuk peralihan masa.","אנא בחר את גודל הקובץ המיועד לשינוי זמן","Vyberte, prosím, velikost souboru pro časový posun.","Vyberte, prosím, veľkosť súboru pre časový posun.","Wybierz rozmiar pliku dla funkcji Time Shift.","Kérem, válassza ki a timeshift funkcióra használandó fájlméretet.","Моля изберете размера на файла за времеотместване.","لطفاً حجم فایل برای شیفت زمانی را انتخاب کنید.","Silakan pilih ukuran file untuk pergantian waktu.","N/A"],
    "There is not enough contiguous free space for this size. For better performance, it is recommended to select a smaller size or format the disk.":["","There is not enough contiguous free space for this size. For better performance, it is recommended to select a smaller size or format the disk.","Zusammenhängender Speicher unzureichend für diese Größe. Bitte eine kleinere Größe wählen oder Disk formatieren.","Non c'è sufficiente spazio libero contiguo per questa dimensione. Per avere una migliore resa, consigliamo di selezionare una dimensione più piccola o di formattare il disco.","Não há espaço livre suficiente para este tamanho. Para ter um melhor desempenho, recomendamos que selecione um tamanho menor ou formate o disco.","No hay suficiente espacio libre contiguo para este tamaño. Para tener un mejor rendimiento, le recomendamos que seleccione el tamaño más pequeño o formatee el disco.","Il n'y a pas assez d'espace libre contigu pour cette taille. Pour une meilleure performace, nous vous recommandons de choisir une plus petite taille ou de formater le dispositif de stockage . ","Det er ikke nok sammenhengende ledig plass for denne størrelsen. For å få en bedre ytelse, anbefaler vi å velge en mindre størrelse eller formatere disken.","Det finns inte tillräckligt med intilliggande utrymme för denna storlek. För att få bättre prestanda rekommenderar vi att du väljer en mindre storlek eller formatera disken.. ","Der er ingen tilstrækkelig sammenhængende ledig plads til denne størrelse. For at opnå bedre ydelse, anbefaler vi at vælge en mindre størrelse eller formatere disken.","Levyllä ei ole riittävästi yhtenäistä tilaa tätä kokoa varten. Paremman suorituskyvyn varmistamiseksi suosittelemme, että alustat levyn tai valitset pienemmän koon.","Bu boyut için yeterli bitişik boş alan yok. Daha iyi performans elde etmek için, daha küçük boyut seçmenizi veya diski biçimlendirmenizi öneririz.","لا يوجد ما يكفي من المساحة الحرة لهذا الحجم. للحصول على أداء أفضل، نحن نوصي بتحديد حجم أصغر أو تهيئة القرص.","Нет свободного места для такого буфера. Рекомендуем выбрать меньший размер буфера или отформатировать диск.","Không có đủ không gian trống liền kề với kích thước này. Để có hiệu suất tốt hơn, chúng tôi khuyên quý vị nên chọn kích thước nhỏ hơn hoặc định dạng đĩa.","มีพื้นที่ว่างแบบต่อเนื่องกันไม่เพียงพอสำหรับขนาดดังกล่าว หากต้องการสมรรถนะการทำงานดีขึ้น เราขอแนะนำให้เลือกขนาดที่เล็กกว่าหรือฟอร์แม็ตดิสก์","ဤအရြယ္အစားအတြက္ ဆက္တိုက္ ေနရာလြတ္မရွိပါ။ ပိုမိုေကာင္းစြာ စြမ္းေဆာင္ႏိုင္ရန္ အရြယ္ အေသးစားကို ေရြးပါ (သို႔) သိုေလွာင္ကိရိယာကို ရွင္းလင္းပံုစံခ်ပါ။","Bu hajm uchun yetarli bo'sh joy yo'q. Yaxshi ishlashi uchun kichikroq hajmni tanlash yoki diskni formatlash tavsiya etiladi.","इस साईज के लिए पर्याप्त जगह नहीं है. बेहतर होगा, छोटे साईज चुनें या डिस्क फारमेट करें","Для такого розміру немає безперервного вільного місця. Для більшої ефективності рекомендуємо вибрати менший розмір або відформатувати диск.","Tidak ada ruang kosng berdampingan cukup untuk saiz ini. Untuk mempunyai prestasi yang lebih baik, kami mencadangkan untuk memilih saiz yang lebih kecil atau memformat cakera.","אין מספיק מקום פנוי רציף בשביל גודל זה. לביצועים טובים יותר, אנו ממליצים לבחור גודל קטן יותר או לפרמט את הכונן","Neexistuje dostatek souvislého volného místa pro tuto velikost. Pro získání lepšího výkonu, doporučujeme zvolit menší velikost, nebo formátovat disk.","Neexistuje dostatok súvislého voľného miesta pre túto veľkosť. Pre získanie lepšieho výkonu, odporúčame zvoliť menšiu veľkosť, alebo formátovať disk.","Brak wolnego jednolitego miejsca dla tego rozmiaru. Dla uzyskania lepszych osiągów zalecamy wybranie mniejszego rozmiaru lub sformatowanie dysku.","Ehhez a mérethez nem áll rendelkezésre elegendő szabad, összefüggő lemezterület. Jobb teljesítmény érdekében, javasoljuk, hogy válasszon kisebb méretet, vagy formázza a lemezt.","Няма достатъчно непрекъснато свободно място за този размер. За по-добра ефективност Ви препоръчваме да изберете по-малък размер или да форматирате USB устройството.","فضای خالی کافی برای این حجم وجود ندارد. برای عملکرد بهتر، توصیه می‌کنیم حجم کمتری انتخاب کنید یا دیسک را فرمت نمایید","Tidak cukup ruang yang bersebelahan untuk ukuran ini. Untuk performa yang lebih baik, kami anjurkan untuk memilih ukuran yang lebih kecil atau mem-format disk.","N/A"],
