    "Please press \"Add\" key to add one.":["","Please press \"Add\" key to add one.","Zum Hinzufügen die Taste \"Neu\" drücken.","Si prega di premere il tasto \"Aggiungi\" per aggiungere uno.","Por favor, pressione \"Adicionar\" para adicionar um.","Pulse \"Agregar\" para agregar uno.","Veuillez appuyer sur le bouton \"Ajouter\" pour en ajouter un.","Trykk på \"Legg til\" for å legge til en oppføring.","Vänligen tryck på \"Lägg till\" knappen för att lägga till en.","Tryk venligst på \"Tilføj\" for at tilføje en.","Paina \"Lisää\" -painiketta lisätäksesi sellaisen.","Lütfen bir tane eklemek için \"Ekle\" tuşuna basın.","يرجى الضغط على مفتاح [إضافة] لإضافة عنصر. ","Нажмите кнопку \"Добавить\" для добавления"," Vui lòng nhấn nút \"Add\" để thêm một.","กรุณากดปุ่ม \"เพิ่ม\" เพื่อเพิ่มกำหนดดการ","တစ္ခုကို ထည့္ရန္ \"Add\" ခလုတ္ကို ႏွိပ္ပါ။","Qo'shish uchun \"Qo'shish\" tugmasini bosing.","कृप्या जोड़ने के लिए \"Add\" दबाएं ","Натисніть кнопку \"Додати\", щоб додати розклад.","Sila tekan \"Tambah\" untuk menambah satu.","אנא לחץ על המקש \"הוסף\" כדי להוסיף אחת","Prosím, stiskněte tlačítko\" \"Přidat\" \"pro přidání.","Prosím, stlačte tlačidlo \"Pridať\" pre pridanie.","Naciśnij przycisk „Dodaj”, aby dodać.","Kérem, nyomja meg az „Add” gombot, hogy hozzáadjon egyet.","Моля натиснете бутон \"Add\" за да добавите такъв."," لطفا برای افزودن، کلید \"افزودن\" را فشار دهید.","Tekan tombol \"Tambahkah\" untuk menambahkan satu.","N/A"],
