    "There is a scheduled reminder, watch now?":["","There is a scheduled reminder, watch now?","Es gibt eine Terminerinnerung; jetzt ansehen?","C'è un promemoria programmato, desideri iniziare la visione?","Não é um lembrete de calendário, deseja quer marcar?","Hay un recordatorio de programación. ¿Desea empeza a ver?","Il existe un rappel, voulez-vous le visionner?","Det er en påminnelse i tidsplanen, vil du se nå?","Där är en schemapåminnare, vill du börja titta?","Der er en optagelses-påmindelse vil du begynde at se programmet?","Ohjelma josta on muistutus alkaa, haluatko katsoa ohjelman?","Bir zamanlama hatırlatıcı var. İzlemeye başlamak ister misiniz?","هناك تذكير في الجدول الزمني، هل تريد أن بدء المشاهدة؟","Сработало напоминание, хотите начать просмотр?","Có một nhắc nhở lịch trình, quý vị có muốn bật xem?","มีการแจ้งเตือนที่ตั้งกำหนดการไว้ คุณต้องการเริ่มต้นรับชมหรือไม่","စီစဥ္သတ္မွတ္ထားသည့္ သတိေပးခ်က္တစ္ရပ္ ရွိသည္၊ ေစာင့္ၾကည့္မႈ စတင္မလား?","Jadval eslatgichi bor,ko'rishni boshlaysizmi?","शिड्यूल रिमांईडर है, क्या आप देखना शुरू करेंगे ?","Спрацював встановлений нагадувач, хочете почати перегляд?","Terdapat peringatan jadual, adakah anda ingin mula menonton?","קיימת תזכורת קבועה בלו\"ז, האם תרצה להתחיל לצפות?","Připomínač harmonogramu je k dispozici, chcete spustit sledování?","Pripomienkovač harmonogramu je k dispozícii, chcete spustiť sledovanie?","Zaplanowano przypomnienie, czy chcesz rozpocząć oglądanie?","Időzített emlékeztető: szeretné megnézni a programot?","Има напомняне по график, желаете ли да започнете да гледате?","یک یادآور زمانبندی‌شده وجود دارد، آیا می‌خواهید تماشا کنید؟","Tidak ada pengingat jadwal, Anda ingin mulai menonton?","N/A"],
