    "A recording will start within 30 minutes. Do you still wish to enter Smart?":["","A recording will start within 30 minutes. Do you still wish to enter Smart?","In 30 Minuten startet eine Aufnahme. Smart Home einschalten?","Una registrazione inizierà entro 30 minuti. Inserirai la funzione smart?","A gravação será iniciada dentro de 30 minutos. Vai entrar no modo inteligente?","Una grabación comenzará en 30 minutos. ¿Va a entrar en Smart?","Un enregistrement va démarrer dans 30 minutes. Voulez-vous entrer dans Smart?","Et opptak vil starte om 30 minutter. Vil du gå inn i Smart?","En inspelning kommer att börja inom 30 minuter. Kommer du att gå in i Smart?","En optagelse begynder inden for 30 minutter. Vil du benytte Smart?","Tallennus alkaa 30 minuutin sisällä. Haluatko siirtyä Smart-tilaan?","30 dakika içinde bir kayıt başlayacak. Akıllı moda girecek misiniz?","سيبدأ التسجيل في غضون 30 دقيقة. سوف تدخل في الوضع الذكي؟","Запись начнется через 30 минут. Зайти в Smart?","Một bản ghi sẽ bắt đầu trong vòng 30 phút nữa. Quý vị sẽ nhập Thông Minh?","การบันทึกจะเริ่มต้นในอีก 30 นาที คุณจะเข้าสู่โหมดสมาร์ทหรือไม่","မိနစ္ 30 အတြင္းမွတ္တမ္းကူးယူမႈ စတင္လိမ့္မည္။ စမတ္ကို ထည့္သြင္းမလား?","Yozish 30 daqiqa ichida boshlanadi. Smartga kirasizmi?","30 मिनट में रिकार्डिंग सुरू होगी. स्मार्ट में प्रवेश करेंगे?","Запис почнеться протягом 30 хвилин. Зайти в Smart?","Rakaman akan bermula dalam tempoh 30 minit. Anda akan memasuki Pintar?","הקלטה תתחיל בעוד 30 דקות. האם להיכנס אל ה-Smart?","Nahrávání začne v průběhu 30 minut. Chcete spustit Smart?","Nahrávanie začne v priebehu 30 minút. Chcete spustiť Smart?","Nagrywanie rozpocznie się za 30 minut. Włączyć funkcję Smart?","Felvétel kezdődik 30 percen belül. Belép a Smart módba?","Записването ще започне след 30 минути. Желаете ли да влезете в Smart?","ضبط ظرف 30 دقیقه شروع خواهد شد. وارد Smart می‌شوید؟","Rekaman akan dimulai dalam 30 menit. Masukkan Smart?","N/A"],
