    "All settings and channel lists will be lost. This will go to Installation Guide. Do you want to continue?":["","All settings and channel lists will be lost. This will go to Installation Guide. Do you want to continue?","Alle Einstellungen und Senderlisten werden gelöscht. Installationsanleitung wird geöffnet. Fortfahren?","Tutte le impostazioni e liste di canali andranno persi. Si passerà a Guida di Installazione. Continuare?","Todas as configurações e listas de canais serão perdidos. Isto irá percorrer todo o Guia de Instalação. Deseja continuar?","Todos los ajustes y las listas de canales se perderán. Esto irá a la Guía de Instalación. ¿Quiere continuar?","Tous les réglages et les listes de chaînes seront perdues. Vous serez dirigé vers l'assistant de configuration. Voulez-vous continuer? ","Alle innstillinger og kanallister vil bli slettet. Dette vil gå til installasjonsveiledningen. Vil du fortsette?","Alla inställningar och kanaler kommer att förloras. Detta kommer att gå till installationsguide. Vill du fortsätta?","Alle indstillinger og kanallister vil gå tabt. Dette vil gå til Installationsguiden. Vil du fortsætte?","Kakki valinnat ja kanavalistat poistetaan, jos siirryt asennusohjeisiin. Haluatko jatkaa?","Tüm ayarlar ve kanal listeleri kaybedilecek. Bu, Kurulum Kılavuzuna gidecektir. Devam etmek istiyor musunuz?","سيتم فقدان كافة الإعدادات وقوائم القنوات. هذا سوف تذهب إلى دليل التثبيت. هل تريد الاستمرار؟","Все настройки и списки каналов были утеряны. Вы хотите продолжить?","Tất cả cài đặt và các danh sách kênh sẽ bị mất. Điều này sẽ cần Hướng Dẫn Cài Đặt. Quý vị có muốn tiếp tục không?","การตั้งค่าและรายชื่อช่องรายการทั้งหมดจะสูญหายไป สามารถดูได้ที่คู่มือการติดตั้ง คุณต้องการดำเนินการต่อหรือไม่","သတ္မွတ္ခ်က္မ်ားအားလံုးႏွင့္ ခ်န္နယ္စာရင္းမ်ား ေပ်ာက္သြားၿပီး ၎တို ့သည္ ထည့္သြင္းမႈလမ္းညႊန္သို ့ေရာက္သြားမည္။ သင္ဆက္လုပ္ခ်င္သလား?","Barcha sozlamalar va kanallar ro'yxati o'chadi. Bu O'rnatish qo'llanmasiga olib boradi. Davom etasizmi?","सारी सेटिंग्स और चैनल सूचि मिट जाएगी. यह इंस्टलेशन गाईड में जाएगा. आगे बढ़ें ?","Всі налаштування і списки каналів будуть втрачені. Відбудеться перехід до Посібника з інсталяції. Бажаєте продовжити?","Semua tetapan dan senarai saluran akan hilang. Ini akan pergi ke Panduan Pemasangan. Adakah anda mahu teruskan?","כל ההגדרות ורשימות הערוצים יימחקו. התפריט יעבור למדריך ההתקנה. האם ברצונך להמשיך?","Všechna nastavení a seznamy kanálů se ztratí. Přechod na Příručku instalací. Chcete pokračovat?","Všetky nastavenia a zoznamy kanálov sa stratia. Prechod na Príručku inštaláciou. Chcete pokračovať?","Wszystkie ustawienia i listy kanałów zostaną utracone. Nastąpi przejście do przewodnika instalacji. Czy chcesz kontynuować?","Minden beállítás és csatornalista elveszik. A Telepítési útmutató megjelenítése következik. Szeretné folytatni?","Всички настройки и списъци с канали ще бъдат изгубени. Това ще ви отведе в ръководството за инсталиране. Желаете ли да продължите?","همه تنظیمات و لیست کانال‌ها از دست خواهد رفت. این در راهنمای نصب آمده است. ادامه می‌دهید؟","Semua pengaturan dan daftar saluran akan hilang. Ini akan menuju ke Panduan Pemasangan. Anda ingin melanjutkan?","N/A"],
