    "This will reset all security settings to factory mode. Do you want to continue?":["","This will reset all security settings to factory mode. Do you want to continue?","Alle Sicherheitseinstellungen werden auf die Fabrikeinstellungen zurückgesetzt. Möchten Sie fortfahren?","Questo ripristinerà tutte le impostazioni di sicurezza nelle modalità di fabbrica. Continuare?","Isso irá redefinir todas as configurações de segurança para o modo de fábrica. Deseja continuar?","Esto restablecerá todos los parámetros de seguridad a modo de fábrica. ¿Desea continuar?","Cela entraînera la réinitialisation par défaut des réglages Sécurité. Voulez-vous continuer?","Dette vil tilbakestille alle sikkerhetsinnstillingene til fabrikkinnstillinger. Vil du fortsette?","Detta kommer att återställa alla säkerhetsinställningar till fabriksinställningar. Vill du fortsätta?","Dette vil nulstille alle sikkerhedsindstillinger til fabrikstilstand. Vil du fortsætte?","Tämä toiminto palauttaa tehtaalla asetetut turva-asetukset. Haluatko jatkaa?","Bu, tüm güvenlik ayarlarını fabrika moduna sıfırlayacak. Devam etmek istiyor musunuz?","هذا سوف يقوم بإعادة تعيين كافة إعدادات الأمان الى وضع المصنع. هل تريد الاستمرار؟","Сброс всех настроек безопасности к заводским настройкам. Продолжить?","Điều này sẽ cài lại tất cả các cài đặt bảo mật ở chế độ nhà máy. Quý vị có muốn tiếp tục không?","นี่จะเป็นการรีเซ็ตการตั้งค่าความปลอดภัยทั้งหมดไปสู่โหมดจากโรงงาน คุณต้องการดำเนินการต่อหรือไม่","လံုၿခံဳေရး သတ္မွတ္ခ်က္မ်ားကို စက္႐ံုထုတ္အေနအထားသို ့ ျပန္လည္သတ္မွတ္သြားမည္။ သင္ဆက္လုပ္ခ်င္ပါသလား?","Bu bilan barcha xavfsizlik sozlamalari zavod rejimiga qayta sozlanadi. Davom etasizmi?","इससे सारी सिक्योरिटी सेटिंग्स फैक्ट्री मोड में रिसेट हो जाएंगी. आगे बढ़ें ?","Це скине всі налаштування безпеки в заводські установки. Бажаєте продовжити?","Ini akan menetapkan semula semua tetapan keselamatan ke mod kilang. Adakah anda mahu teruskan?","הפעולה תשחזר את כל הגדרות האבטחה להגדרות ברירת המחדל. האם ברצונך להמשיך?","Tím se obnoví všechny bezpečnostní nastavení na režim nastavený z výroby. Chcete pokračovat?","Tým sa obnovia všetky bezpečnostné nastavenia na režim nastavený z výroby. Chcete pokračovať?","Spowoduje to zresetowanie wszystkich ustawień zabezpieczeń do wartości domyślnych. Czy chcesz kontynuować?","Ezzel minden biztonsági beállítás a gyári beállításra áll vissza. Szeretné folytatni?","Това ще върне всички настройки за безопасност към фабричния им вид. Желаете ли да продължите?","این همه تنظیمات امنیتی را به حالت کارخانه بازمی‌گرداند. ادامه می‌دهید؟","Ini akan me-reset semua pengaturan ke mode pabrik. Anda ingin melanjutkan?","N/A"],
    "This will reset all picture settings to factory mode. Do you want to continue?":["","This will reset all picture settings to factory mode. Do you want to continue?","Alle Bildeinstellungen werden auf die Fabrikeinstellungen zurückgesetzt. Möchten Sie fortfahren?","Ciò consentirà di ripristinare tutte le impostazioni delle immagini in modalità iniziale. Vuoi continuare?","Irá reiniciar todas as definições de imagem para o modo de fábrica. Deseja continuar?","Esto restablecerá los ajustes de imagen a la modalidad de fábrica. ¿Desea continuar?","Cela entraînera la réinitialisation par défaut des réglages Image. Voulez-vous continuer?","Dette vil tilbakestille alle bildeinnstillingene til fabrikkinnstillinger. Vil du fortsette?","Detta kommer att återställa alla bildinställningar till fabriksinställningar. Vill du fortsätta?","Dette vil nulstille alle billedindstillinger til fabrikstilstand. Vil du fortsætte?","Tämä toiminto palauttaa tehtaalla asetetut kuva-asetukset. Haluatko jatkaa?","Bu, tüm resim ayarlarını fabrika moduna sıfırlayacak. Devam etmek istiyor musunuz?","هذا سوف يقوم بإعادة تعيين كافة إعدادات الصورة الى وضع المصنع. هل تريد الاستمرار؟","Это вернет все настройки изображения к заводским значениям. Вы хотите продолжить?","Điều này sẽ cài lại tất cả các cài đặt ảnh ở chế độ nhà máy. Quý vị có muốn tiếp tục không ","นี่จะเป็นการรีเซ็ตการตั้งค่ารูปภาพทั้งหมดไปสู่โหมดจากโรงงาน คุณต้องการดำเนินการต่อหรือไม่","ပံုရိပ္ သတ္မွတ္ခ်က္မ်ားကို စက္႐ံုထုတ္အေနအထားသို ့ ျပန္လည္သတ္မွတ္သြားမည္။ သင္ဆက္လုပ္ခ်င္ပါသလား?","Bu bilan barcha tasvir sozlamalari zavod rejimiga qayta sozlanadi. Davom etasizmi?","इससे सारी पिक्चर सेटिंग्स फैक्ट्री मोड में रिसेट हो जाएंगी. आगे बढ़ें ?","Це поверне всі налаштування зображення до режиму заводських налаштувань. Бажаєте продовжити?","Ini akan menetapkan semula semua tetapan gambar untuk mod kilang. Adakah anda mahu teruskan?","הפעולה תשחזר את כל הגדרות התמונה להגדרות ברירת המחדל. האם ברצונך להמשיך?","Tím se obnoví všechna nastavení obrazu na výchozí režim. Chcete pokračovat?","Tým sa obnovia všetky nastavenia obrazu na režim nastavený z výroby. Chcete pokračovať?","Spowoduje to zresetowanie wszystkich ustawień obrazu do wartości domyślnych. Czy chcesz kontynuować?","Ez valamennyi képbeállítást visszaállítja gyári üzemmódba. Folytatja?","Това ще върне всички настройки на картината към фабричния им вид. Желаете ли да продължите?","این تنظیمات تصویر را به حالت کارخانه بازمی‌گرداند. ادامه می‌دهید؟","Ini akan me-reset semua pengaturan gambar ke mode pabrik. Anda ingin melanjutkan?","N/A"],
