    "This will reset component settings to factory mode. Do you want to continue?":["","This will reset component settings to factory mode. Do you want to continue?","Alle Komponenteneinstellungen werden auf die Werkseinstellungen zruückgesetzt. Möchten Sie fortfahren?","Ciò consentirà di ripristinare le impostazioni dei componenti al modo della fabbrica. Vuoi continuare?","Ista acção irá redefinir as definições de componente para o modo de fábrica.\nDeseja continuar?","Esto restablecerá todos los ajustes de componente a la modalidad de fábrica.\n¿Desea continuar?","Cela entraînera la réinitialisation par défaut des réglages Composante.\nVoulez-vous continuer?","Dette vil tilbakestille alle komponentinnstillingene til fabrikkinnstillinger. Vil du fortsette?","Detta kommer att återställa alla komponentsinställningar till fabriksinställningar. Vill du fortsätta?","Dette vil nulstille indstillinger for komponenten til fabrikstilstand. Vil du fortsætte?","Tämä toiminto palauttaa tehtaalla asetetut laiteasetukset. Haluatko jatkaa?","Bu, bileşen ayarlarını fabrika moduna sıfırlayacak. Devam etmek istiyor musunuz?","هذا سوف يقوم بضبط اعدادات الصوت الى وضع المصنع.\n هل ترغب في الاستمرار؟","Это вернет все компонент.настройки к заводским значениям. Вы хотите продолжить?"," Điều này sẽ cài lại cài đặt thành phần đến chế độ nhà máy. Quý vị có muốn tiếp tục không?","นี่จะเป็นการรีเซ็ตการตั้งค่าคอมโพเนนท์ทั้งหมดไปสู่โหมดจากโรงงาน คุณต้องการดำเนินการต่อหรือไม่","ပါဝင္သည့္ သတ္မွတ္ခ်က္မ်ားကို စက္႐ံုထုတ္အေနအထားသို ့ ျပန္လည္သတ္မွတ္သြားမည္။ သင္ဆက္လုပ္ခ်င္ပါသလား?","Bu bilan komponent sozlamalari zavod rejimiga qayta sozlanadi. Davom etasizmi?","इससे कंपोनेंट सेटिंग्स फैक्ट्री मोड में रिसेट हो जाएंगी. आगे बढ़ें ?","Будуть оновлені всі заводські налаштування компонентів. Бажаєте продовжити?","Ini akan menetapkan semula tetapan komponen ke mod kilang. Adakah anda mahu teruskan?","הפעולה תשחזר את כל הגדרות הרכיבים להגדרות ברירת המחדל. האם ברצונך להמשיך?","Tím se obnoví všechna nastavení komponent na výchozí režim. Chcete pokračovat?","Tým sa obnovia všetky nastavenia komponentov na predvolený režim. Chcete pokračovať?","Spowoduje to zresetowanie wszystkich ustawień komponentu do wartości domyślnych. Czy chcesz kontynuować?","Ezzel a lépéssel az összes komponens beállítás visszaáll a gyári állapotba. Biztosan folytatja?","Това ще върне компонентните настройки към фабричния им вид.\nЖелаете ли да продължите? Желаете ли да продължите?","این همه تنظیمات کامپوننت را به حالت کارخانه بازمی‌گرداند. ادامه می‌دهید؟","Ini akan me-reset semua pengaturan komponen ke mode pabrik. Anda ingin melanjutkan?","N/A"],
