    "The following will be reset to default:\n All general settings.\n All skipped channels.":["","The following will be reset to default:\n All general settings.\n All skipped channels.","Folgende Einstellungen werden zurückgesetzt:\n Alle allgemeinen Einstellungen.\n Alle zu überspringenden Sender.","Quelli che seguono saranno ripristinati nelle impostazioni predefinite:\n Tutte le impostazioni generali.\n Tutti i canali saltati","A seguir será redefinido para as definições padrão: \ em todas as configurações gerais /e canais.","Lo siguiente reiniciará por defecto:\n Todos los ajustes generales.\n Todos los canales omitidos","Les paramètres suivants vont être réinitialisés par défaut:\n Tous les réglages généraux \n Toutes les chaînes passées","Følgende vil bli tilbakestilt til standardinnstillinger:\n Alle generelle innstillinger.\n Alle ignorerte kanaler.","Följande kommer att återställas till standard:\n Alla allmänna inställningar.\ Alla över hoppade kanaler. ","Følgende vil blive nulstillet til standard:.\nAlle generelle indstillinger\nAlle oversprungne kanaler.","Palautetaan seuraavat oletusasetukset:\n Kaikki yleiset asetukset.\n Kaikki ohitetut kanavat.","Aşağıdakiler varsayılana sıfırlanacak:\n Tüm genel ayarlar.\n Tüm atlanan kanallar.","سيتم إعادة تعيين العناصر ادناه إلى الافتراضي :\n جميع الإعدادات العامة. \n كل القنوات التي تم تخطيها.","Сбросится к настройкам по умолчанию:\n Все общие настройки.\n Все пропущенные каналы.","Cái dưới đây sẽ được cài mặc định lại:\n Tất cả cài đặt chung.\n Tất cả các kênh bỏ lỡ.","รายการต่อไปนี้จะถูกรีเซ็ตไปสู่ค่าเริ่มต้น:\n การตั้งค่าทั่วไปทั้งหมด \nช่องรายการที่ข้ามไปทั้งหมด","ေအာက္ပါမူရင္းပံုစံသို ့ျပန္လည္သတ္မွတ္သြားမည္ :\n အေထြေထြသတ္မွတ္ခ်က္္မ်ားအားလံုး။\n ေက်ာ္ထားသည့္ခ်န္နယ္မ်ား အားလံုး။","Quyidagi sukut bo'yicha qiymatga qaytadi:\n Barcha umumiy sozlamalar.\n Barcha o'tkazib yuborilgan kanallar.","निम्न को डिफाल्ट में रिसेट करेंगे: सारी सामान्य सेटिंग्स, सारे छुटे हुए चैनल ","Наступне буде скинуто в значення за замовчуванням:\n Всі загальні налаштування.\n Всі пропущені канали.","Berikut akan ditetapkan semula kepada lalai:.\n Semua tetapan umum.\n Semua saluran dilangkau.","ההגדרות הבאות ישוחזרו אל ברירת מחדל: \n כל הגדרות הכלליות. \n כל הערוצים שדולגו","Následující budou nastaveny na výchozí:\n Všechna obecná nastavení.\n Všechna vynechané kanály.","Nasledujúce budú nastavené na predvolené:\n Všetky všeobecné nastavenia.\n Všetky vynechané kanály.","Przywrócone zostaną domyślne ustawienia: Wszystkie ustawienia ogólne. Wszystkie pominięte kanały.","A következő visszaállítása alapértelmezett értékre:\nMinden általános beállítás.\nMinden kihagyott csatorna.","Следните ще бъдат върнати до фабрично зададения им вид:\n Всички общи настройки.\n Всички пропуснати канали.","تنظیمات زیر به پیش‌فرض بازنشانی خواهد شد:\n همه تنظیمات عمومی.\n همه کانال‌های عبورشده.","Yang berikut ini akan di-reset ke default:\n Semua pengaturan umum.\n Semua saluran yang dilewati.","N/A"],
