    "The following will be reset to default:\n All general settings.\n All skipped channels.\n All blocked channels.\n Age rating, and parental password.":["","The following will be reset to default:\n All general settings.\n All skipped channels.\n All blocked channels.\n Age rating, and parental password.","Folgende Einstellungen werden zurückgesetzt:\n Alle allgemeinen Einstellungen.\n Alle zu überspringenden Sender.\n Alle gesperrten Sender.\n Altersbegrenzung, und Passwort für Elternsicherung. ","Quelli che seguono saranno ripristinati nelle impostazioni predefinite:\n Tutti i canali saltati.\n Tutti i canali bloccati.\n Valutazione età e password genitori.","A seguir será redefinido para as definições padrão:. \n Todas as configurações gerais \n Todos os canais \n Todos os canais bloqueados \n Classificação etária e senha parental...","Lo siguiente reiniciará por defecto:\n Todos los ajustes generales.\n Todos los canales omitidos.\n Todos los canales bloqueados.\n Calificación por edades y contraseña de los padres.","Les paramètres suivants vont être réinitialisés par défaut:\n Tous les réglages généraux \n Toutes les chaînes passées \n Toutes les chaînes bloquées.\Classes d'âge et mot de passe du contrôle parental.","Følgende vil bli tilbakestilt til standardinnstillinger:\n Alle generelle innstillinger.\n Alle ignorerte kanaler.\n Alle blokkerte kanaler.\n Aldersklassifisering og foreldrelås. ","Följande kommer att återställas till standard:\n Alla allmänna inställningar.\ Alla över hoppade kanaler.\n Alla blockerade kanaler.\n Åldersgräns och föräldrar lösenord.","Følgende vil blive nulstillet til standard:.\nAlle generelle indstillinger.\n Alle oversprungne kanaler.\n Alle blokerede kanaler.\nAldersbegræsning og forældrenes password...","Palautetaan seuraavat oletusasetukset:\n Kaikki yleiset asetukset.\n Kakki ohitetut kanavat.\n Kaikki estetyt kanavat. Ikäraja ja aikuisten salasana.","Aşağıdakiler varsayılana sıfırlanacak:\n Tüm genel ayarlar.\n Tüm atlanan kanallar.\n Tüm engellenen kanallar.\n Yaş derecelendirmesi ve ebeveyn şifresi.","سيتم إعادة تعيين العناصر ادناه إلى الافتراضي:\n جميع الإعدادات العامة.\n كل القنوات التي تم تخطيها. جميع القنوات المحظورة.\n تصنيف العمر، وكلمة مرور الوالدين.","Сбросится к настройкам по умолчанию:\n Все общие настройки.\n Все пропущенные каналы.\n Все заблокированные каналы.\n Рейтинг и родительский пароль.","Sau đây sẽ được thiết lập lại để mặc định:.\n Tất cả các cài đặt chung.\n Tất cả kênh được bỏ qua.\n Tất cả các kênh bị chặn.\n Đánh giá tưởi, và mật khẩu của cha mẹ...","รายการต่อไปนี้จะถูกรีเซ็ตไปสู่ค่าเริ่มต้น:\n การตั้งค่าทั่วไปทั้งหมด \nช่องรายการที่ข้ามไปทั้งหมด \n ช่องรายการที่ถูกบล็อกไว้ทั้งหมด \nการจัดอันดับตามอายุ และรหัสผ่านสำหรับฟังก์ชันผู้ปกครอง","ေအာက္ပါတို ့သည္ မူရင္းပါပံုစံသို ့ျပန္လည္သတ္မွတ္သြားမည္မွာ :\n အေထြေထြသတ္မွတ္ခ်က္မ်ားအားလံုး။\n ေက်ာ္ထားသည့္ ခ်န္နယ္မ်ားအားလံုး။\n ပိတ္ဆီးထားသည့္ ခ်န္နယ္မ်ားအားလံုး။\n အသက္အရြယ္ ႏႈန္းထားေပးမႈႏွင့္ မိဘဆိုင္ရာ စကားဝွက္တို႔ျဖစ္သည္။","Quyidagi sukut bo'yicha qiymatga qaytadi:\n Barcha umumiy sozlamalar.\n Barcha o'tkazib yuborilgan kanallar.\n Barcha bloklangan kanallar. \n Yosh bo'yicha cheklov va ota-onalar nazorati paroli.","निमन डिफाल्ट में रिसेट होगा: \n सारी सामान्य सेटिंग्स. \n सारे छुटे हुए चैनल्स. \n सारे ब्लाक हुए चैनल्स. \n आयु रेटिंग और पेरेंटल पासवर्ड.","Наступне буде скинуто в значення за замовчуванням:\n Всі загальні налаштування.\n Всі пропущені канали.\n Всі заблоковані канали.\n Категоріювання за віком і батьківський пароль.","Berikut akan ditetapkan semula kepada lalai:\n Semua tetapan umum.\n Semua saluran dilangkau.\n Semua saluran disekat.\n Penarafan Umur, dan kata laluan ibu bapa...","ההגדרות הבאות ישוחזרו אל ברירת מחדל: \n כל ההגדרות הכלליות. \n כל הערוצים שדולגו. \n כל הערוצים החסומים. \n דירוג גיל, וסיסמת הורים","Následující budou nastaveny na výchozí:\n Všechna obecná nastavení.\n Všechny vynechány kanály.\n Všechny blokované kanály\n hesla pro Hodnocení podle věku a Rodičovské hesla. ","Nasledujúce budú nastavené na predvolené:\n Všetky všeobecné nastavenia.\n Všetky vynechané kanály.\n Všetky blokované kanály.\n Heslá pre Hodnotenie podľa veku a Rodičovské heslá. ","Przywrócone zostaną domyślne ustawienia:\n Wszystkie ustawienia ogólne.\n Wszystkie pominięte kanały.\n Wszystkie zablokowane kanały.\n System klasyfikacji wiekowej i hasło rodzicielskie. ","A következő visszaállítása alapértelmezett értékre:\nMinden általános beállítás.\nMinden kihagyott csatorna.\nMinden zárolt csatorna.\nKor-besorolás, és szűlői jelszó.","Следните ще бъдат върнати до фабрично зададения им вид:\n Всички общи настройки.\n Всички пропуснати канали.\n Всички блокирани канали.\n Възрастова категория и родителски пароли.","تنظیمات زیر به پیش‌فرض بازنشانی خواهد شد:\n همه تنظیمات عمومی.\n همه کانال‌های عبورشده.\n همه کانال‌های مسدودشده.\n رتبه‌بندی سن و رمز عبور والدین.","Yang berikut ini akan di-reset ke default:\n Semua pengaturan umum.\n Semua saluran yang dilewati.\n Semua saluran yang diblokir.\n Peringkat usia, dan sandi orang tua. ","N/A"],
