    "The valid length of SSID is 1-32 characters. Please check the SSID.":["","The valid length of SSID is 1-32 characters. Please check the SSID.","Die SSID darf 1~32 Zeichen lang sein. Bitte SSID überprüfen.","La lunghezza valida dell'SSID è 1-32 caratteri. Si prega di controllare l'SSID.","O comprimento válido para a SSID é entre 1~ 32 caracteres. Por favor, verifique o SSID.","La longitud válida de SSID es 1 ~ 32 caracteres. Compruebe el SSID.","La longueur valide d'un nom de SSID est de 1 à 32 noms. Vérifiez le nom de votre SSID.","Gyldig lengde på SSID er 1~32 tegn. Vennligst sjekk SSID.","Den giltiga längden av SSID är 1~32 tecken. Vänligen kontrollera SSID. ","Den gyldige længde SSID er 1~32 tegn. Kontrollér SSID.","SSID-tunnuksen tulee olla pituudeltaan 1-32 merkkiä. Tarkista SSID-tunnus","Geçerli SSID uzunluğu 1~32 karakterdir. Lütfen SSID bilgisini kontrol edin.","طول اسم الشبكة SSID الفعال يجب ان يكون من 1- 32 حرفا. الرجاء التحقق من اسم الشبكة.","Длина SSID должна составлять от 1 до 32 символов. Проверьте SSID.","Độ dài hợp lệ của SSID là 1 ~ 32 ký tự. Hãy kiểm tra các SSID.","ความยาวที่ถูกต้องของ SSID คือ 1~32 อักขระ กรุณาตรวจสอบ SSID","SSID ၏ ပါဝင္ႏိုင္မႈ အရွည္သည္ အကၡရာ 1~32 လံုးျဖစ္သည္။ ေက်းဇူးျပဳ၍ SSID ကို စစ္ေဆးပါ။","SSID mumkin bo'lgan uzunligi 1-32 belgi. SSID ni tekshiring."," SSID की सही लंबाई 1 से 32 केरेक्टर्स तक. कृप्या SSID चेक करें.","Довжина SSID повинна становити від 1 до 32 символів. Перевірте SSID.","Panjang sah SSID adalah 1 ~ 32 aksara.Sila semak SSID.","האורך החוקי של SSID הוא 1 עד 32 תוים. אנא בדוק את ה-SSID","Platné délka SSID je 1~32 znaků. Zkontrolujte SSID, prosím.","Platná dĺžka SSID je 1~32 znakov. Skontrolujte SSID, prosím.","Prawidłowa długość SSID to 1-32 znaków. Proszę sprawdzić SSID.","Az SSID érvényes hossza 1~32 karakter közötti. Kérem, ellenőrizze az SSID-t.","Валидната дължина на SSID e от 1 до 32 символа.Моля проверете SSID.","طول مجاز SSID بین 1 تا 32 حرف است.لطفاً SSID را بررسی کنید.","Panjang SSID yang valid adalah 1~32 karakter. Harap periksa SSID.","N/A"],
    "Please ensure the following PIN code is installed to the Access Point before you click the below ‘Next’ button.":["","Please ensure the following PIN code is installed to the Access Point before you click the below ‘Next’ button.","Vergewissern Sie sich, dass die nachfolgende PIN mit AP installiert ist, bevor Sie unten auf die Taste \"Next\" klicken.","Assicurarsi il seguente codice PIN è installato all'AP prima di fare clic sul pulsante in basso 'Avanti'.","Assegure-se que o seguinte código PIN está instalado no AP antes de clicar no botão \"Seguinte\".","Por favor asegúrese de que el siguiente código PIN sea instalado en el PA antes de hacer clic abajo en el botón \"Siguiente\"","Assurez-vous que le code PIN suivant est celui du Point d'Accès avant de cliquer sur le bouton 'Suivant' .","Sørg for at følgende PIN-kode lagt inn før du klikker deg videre.","Vänligen se till att följande PIN-kod är installerad till AP:n innan du klickar på nedanstående \"Nästa\" knapp. ","Sørg følgende PIN-kode er installeret til AP, før du klikker på nedenstående knap 'Næste'.","Varmista, että seuraava PIN-koodi on tallennettu PP:seen ennen kuin painat alla olevaa \"Seuraava\"-painiketta.","Lütfen alttaki 'Sonraki' düğmesine tıklamadan önce aşağıdaki PIN kodunun Erişim Noktasına yüklendiğinden emin olun.","يرجى التأكد من اعداد رمز PIN لنقاط الوصول قبل النقر فوق الزر [التالي] أدناه ","Перед нажатием \"Следующий\" убедитесь, что в узле доступа установлен следующий PIN.","Hãy đảm bảo rằng mã PIN sau đó được lắp đặt các AP trước khi bạn nhấp vào nút bên dưới 'Next'.","กรุณาตรวจสอบให้แน่ใจว่ารหัส PIN ต่อไปนี้ได้รับการติดตั้งไปยัง AP ก่อนที่คุณจะคลิกที่ปุ่ม 'ถัดไป'","ေအာက္တြင္ရွိေသာ ‘Next’ ခလုတ္ကို သင္မႏွိပ္မွီ ေပးထားေသာ PIN ကုဒ္နံပါတ္ကို ထည့္သြင္းထားမႈ ရွိ မရွိ ေသခ်ာပါေစ။","Quyidagi 'Keyin' tugmasini bosishdan quyidagi PIN kod AP ga ulanganligiga ishonch hosil qiling.","‘Next’ बटन दबाने से पहले कृप्या सुनिश्चित कर लें कि निम्न पिन कोड एपी में इंस्टाल्ड है","Перед натисненням кнопки \"Наступний\" переконайтеся, що у вузлі доступу встановлено наступний PIN.","Sila pastikan kod PIN berikut dipasang kepada AP sebelum anda klik butang 'Next'.","אנא וודא שמפתח ה-PIN מותקן אל ה-AP לפני שאתה לוחץ על כפתור ה-\"הבא\" למטה","Ujistěte se prosím, aby byl následující kód PIN nainstalován na AP před tím, než kliknete na níže uvedené tlačítko 'Next' ('Další').","Uistite sa prosím, aby bol nasledujúci kód PIN nainštalovaný na AP pred tým, než kliknete na nižšie uvedené tlačidlo ‘Next’ ('Ďalší').","Przed kliknięciem przycisku „Dalej” upewnij się, że poniższy kod PIN został przypisany do punktu dostępu.","Kérem, telepítse a következő PIN-kódot a hozzáférési ponthoz, mielőtt az alábbi \"Next\" (Következő) gombra kattint.","Моля уверете се, че следният PIN код е въведен в АР преди да натиснете бутон \"Next\".","لطفاً قبل از کلیک روی دکمه «بعدی» در زیر، مطمئن شوید که پین کُد زیر روی AP نصب شده باشد.","Pastikan kode PIN berikut ini diinstal ke AP sebelum Anda mengeklik tombol di bawah 'Berikutnya'.","N/A"],
