    "Please press WPS button on the Access Point within 120 seconds after you click the below ‘Next’ button.":["","Please press WPS button on the Access Point within 120 seconds after you click the below ‘Next’ button.","Bitte drücken Sie die Taste auf dem AP innerhalb von 120 Sekunden nachdem Sie unten auf \"Next \" geklickt haben.","Si prega di premere Pulsante sull'AP entro 120 secondi dopo aver fatto clic sul pulsante qui sotto 'Avanti'.","Pressione o botão Push no AP dentro de 120 segundos antes de clicar no botão \"Seguinte\".","Por favor presione el pulsador del PA dentro de 120 segundos después de que haga clic en el botón \"Siguiente\"","Veuillez appuyer sur le Bouton de Connexion du Point d'Accès dans les 120 secondes après que vous ayez cliqué sur le bouton 'Suivant'.","Trykk på knappen på tilgangspunktet innen 120 sekunder etter at du har klikket på \"Neste\".","Vänligen tryck på Tryck knappen på AP:n inom 120 sekunder efter att du har tryckt på nedanstående \"Nästa\" knapp.","Tryk venligst på knappen AP inden for 120 sekunder efter, at du klikker på nedenstående knap 'Næste'.","Paina PP:n painiketta 120 sekunnin sisällä siitä, kun olet painanut alla olevaa \"Seuraava\"-painiketta.","Lütfen alttaki ‘Sonraki’ düğmesine tıkladıktan sonra 120 saniye içinde Erişim Noktasındaki İtmeli Düğmeye basın.","الرجاء الضغط على زر الدفع في نقط الوصول ضمن 120 ثانية بعد الضغط على زر [التالي] أدناه.","Нажмите кнопку \"Push\" на точке доступа в течении 120 секунд после нажатия кнопки \"Следующий\".","Hãy nhấn Push Button trên AP trong vòng 120 giây sau khi quý vị bấm vào nút bên dưới","กรุณากดปุ่ม ดัน บน AP ภายใน 120 วินาทีหลังจากคุณคลิกปุ่ม 'ถัดไป' ดานล่าง","ေအာက္တြင္ရွိေသာ ‘Next’ ခလုတ္ကို သင္ႏွိပ္ၿပီးေနာက္ 120 စကၠန္ ့အတြင္း AP ေပၚရွိ အဖြင့္ခလုတ္ကို ႏွိပ္ပါ။","Quyidagi 'Keyin' tugmasini bosgadan keyin 120 soniya ichida AP dagi Push tugmasini bosing.","‘Next’ बटन दबाने के बाद कृप्या एपी पर 120 सेकेंड के अंदर Push Button दबाएं.","Натисніть кнопку вузла доступу впродовж 120 секунд після натискання кнопки \"Наступний\".","Sila tekan Push Button pada AP dalam tempoh 120 saat selepas anda klik butang 'Next' di bawah.","אנא לחץ על כפתור \"Push\" על ה-AP בתוך 120 שניות לאחר שלחצת על הכפתור \"הבא\" למטה","Prosím stiskněte tlačítko Push Button na AP v průběhu 120 sekund po kliknutí na níže uvedené tlačítko 'Next' ('Další').","Prosím stlačte tlačidlo Push Button na AP v priebehu 120 sekúnd po kliknutí na nižšie uvedené tlačidlo ‘Next’ ('Ďalší').","Naciśnij przycisk na punkcie dostępu w ciągu 120 sekund od kliknięcia poniższego przycisku „Dalej”.","Kérem, nyomja meg a hozzáférési ponton található nyomógombot az alábbi \"Next\" (Következő) gombra történt kattintást követő 120 másodpercen belül","Моля натиснете бутонът на АР в рамките на 120 секунди след като сте натиснали бутон \"Next\".","لطفاً ظرف 120 ثانیه بعد از کلیک روی دکمه «بعدی» در زیر، دکمه «Puch» روی AP را فشار دهید.","Tekan Tombol Tekan pada AP dalam 120 detik setelah Anda mengeklik tombol 'Berikutnya' di bawah ini.","N/A"],
