    "More than one of the IP Address,Length of Prefix and Default Gateway is invalid.Please enter again!":["","More than one of the IP Address,Length of Prefix and Default Gateway is invalid.Please enter again!","IP-Adresse, Präfix-Länge oder Standard-Gateway ist ungültig. Bitte erneut eingeben!","Più indirizzi IP, Lunghezza di Perfix e Gateway predefinito non validi. Accedere di nuovo!","Mais que um endereço de IP, Comprimento de Prefixo e Gateway Padrão é inválido. Introduza novamente!","Más de una Dirección IP, Extensión de prefijo y Puerta de entrada predeterminada es inválida. ¡Por favor ingréselos otra vez!","Plusieurs de ces valeurs ne sont pas valides: Adresse IP, longueur du Préfixe, Passerelle par défaut. Veuillez les resaisir!","Det er en ugyldig oppføring i enten IP-adresse, lengde på prefix, eller standard gateway. Tast inn på nytt!","Mer än en av IP-adresserna, läng av prefix och standard gateway är ogiltig. Vänligen ange igen!","Mere end en af følgende er ugyldig: IP-adresse, længde af prefix eller standardgateway. Indtast venligst igen!","Antamasi IP-osoite, alkutunnisteen pituus ja/tai default gateway on virheellinen. Yritä uudelleen!","IP Adresi, Önek Uzunluğu ve Varsayılan Ağ Geçidi bilgilerinin birinden fazlası geçersiz. Lütfen tekrar girin!","أكثر من عنوان IP وقناع الشبكة الفرعية البوابة الافتراضية غير صحيح. من فضلك ادخل القيم مرة أخرى!","Несколько параметров (IP адрес, код города и шлюз) недействительны. Повторите ввод!","Nhiều hơn một Địa Chỉ IP, Chiều dài của Tiền Tố và Cổng Mặc Định là không hợp lệ. Vui lòng nhập lại!","มีไอพีแอดเดรสมากกว่าหนึ่ง ความยาวนำหน้าและเกตเวย์เริ่มต้นไม่ถูกต้อง กรุณาป้อนใหม่อีกครั้ง!","တစ္ႀကိမ္ထက္ပိုေသာ IP လိပ္စာ၊ Perfix ၏အလ်ားႏွင့္ နဂိုမူလသတ္မွတ္ထားေသာ ဂိတ္ေဝးသည္မွန္ကန္မႈမရွိပါ။ ေက်းဇူးျပဳ၍ ေနာက္တစ္ႀကိမ္ ထည့္သြင္းပါ!","Birdan ortiq IP manzil, Prefiks uzunligi va sukut bo'yicha shlyuz noto'g'ri. Qaytadan kiriting!","एस के अधिक आईपीवी6 पता, परफिक्स की लंबाई औऱ डिफाल्ट गेटवे सही नहीं. कृप्या फिर से भरें","Адреса IP, довжина коду зони чи шлюз за замовчуванням недійсні. Повторіть введення!","Lebih daripada satu alamat IP, Panjang Prefix dan Default Gateway adalah tak sah. Sila masuk lagi!","ביותר מאחת מכתובות IP, אורך התחילית ושער ברירת המחדל לא חוקי. אנא הזן שנית!","Více než jedna z IP adresy, délky Prefixu a Výchozí brány je neplatná. Prosíme zadejte je znovu!","Viac ako jedna z IP adresy, dĺžky Prefixu a Predvolenej brány je neplatná. Prosíme zadajte ich znova!","Więcej niż jeden element z następujących: adres IP, długość prefiksu i i brama domyślna jest nieprawidłowy. Wprowadź ponownie!","Több mint egy IP cím, a prefix-hossz és az alapértelmezett átjáró érvénytelen. Kérem, adja meg újra!","Някои от IP адрес, дължина на префикс или шлюз по подразбиране са невалидни. Моля въведете отново!","بیش از یک آدرس IP، طول پیشوند و درگاه پیش‌فرض نامعتبر است. لطفاً دوباره وارد کنید!","Lebih dari satu Alamat IP, Panjang Awalan dan Gateway Default tidak valid.Silakan masukkan lagi!","N/A"],
