    "Channel network information changes. Sure to update? If yes, the channel list and channel editing may vary":["频道网络信息发生变化，是否进行更新？如果更新，您的频道列表和频道编辑可能会发生变化","Channel network information changes. Sure to update? If yes, the channel list and channel editing may vary","Netzwerkdaten des Senders werden geändert. Wirklich aktualisieren? Falls ja, können Senderliste und Senderbearbeitung varrieren","L'informazione del canale di rete cambia. Sicuro di aggiornare? Se sì, la lista di canali e la modifica di canale può variare","Informação de rede de canal alterada. Deseja actualizar? Se sim, a lista de canal e edição de canal poderão alterar","Cambios en la información de la red de canales. ¿Seguro que desea actualizar? En caso afirmativo, la edición de la lista de canales y el canal puede variar","la numérotations des chaînes changent. Voulez-vous les mettre à jour? Si oui, la liste des chaînes et l'édition de la chaîne peuvent être modifiés","Kanalinformasjonen endres. Vil du oppdatere? Hvis ja, kan kanallisten og kanalredigering endres","Kanal nätverksinformation ändras. Är du säker du vill uppdatera? Om ja, kan kanallistan och kanalredigering variera","Kanalens netværksoplysninger ændres. Er du sikker på du vil opdatere? Hvis ja, kan kanalliste og redigeringen af kanalerne variere","Kanavan verkon tiedot muuttuvat. Haluatko varmasti päivittää? Jos kyllä, kanavalista ja kanavan muokkaus voivat vaihdella","Kanal ağ bilgisi değişiklikleri. Güncellemek istediğinize emin misiniz? Yanıtınız evetse, kanal listesi ve kanal düzenleme değişiklik gösterebilir","تغييرات شبكة معلومات القنوات. تأكد من التحديث؟ إذا كان الجواب نعم، قد تختلف قائمة القنوات وقناة التحرير","В сетевой информации канала появились изменения. Хотите выполнить обновление? Если да, список каналов и предыдущие правки каналов могут измениться","Thông tin mạng kênh thay đổi. Có chắc chắn muốn cập nhật không? Nếu có, danh sách kênh và việc chỉnh sửa kênh có thể thay đổi","ข้อมูลเครือข่ายช่องสัญญาณถูกเปลี่ยน แน่ใจหรือว่าจะอัพเดท หากใช่ รายการช่องสัญญาณและการแก้ไขช่องสัญญาณอาจหลากหลาย","ခ်န္နယ္လိုင္း ကြန္ယက္ အခ်က္အလက္မ်ား ေျပာင္းထားသည္။ အပ္ဒိတ္လုပ္မွာ ေသခ်ာလား? ေသခ်ာလွ်င္ ခ်န္နယ္လိုင္း စာရင္းႏွင့္ ခ်န္နယ္လိုင္း ေျပာင္းလဲမႈမ်ား ကြဲလြဲႏိုင္သည္","Kanal tarmog'i haqida ma'lumot o'zgaradi. Yangilamoqchi ekaningizga ishonchingiz komilmi? Agar ha bo'lsa, kanallar ro'yxati va kanal tahrirlash farq qilishi mumkin","चैनल नेटवर्क की सूचना बदल गई. अपडेट करें? अगर हां, चैनल सीटि औऱ चैनल एडिटिंग फर्क होगी ","У мережевої інформації каналу з'явилися зміни. Хочете виконати оновлення? Якщо так, список каналів і попередні правки каналів можуть змінитися","Perubahan maklumat rangkaian saluran. Pasti untuk mengemas kini? Jika ya, senarai saluran dan pengeditan saluran mungkin berbeza","רשת המידע בערוץ השתנתה. האם אתה בטוח שתרצה לעדכן? אם כן, רשימת הערוצים ועריכות הערוצים עשויות להשתנות","Byly změněny síťové informace kanálu. Opravdu chcete aktualizovat? Pokud ano, seznam kanálů a editace kanálů se mohou lišit","Boli zmenené sieťové informácie kanála Naozaj chcete aktualizovať? Ak áno, zoznam kanálov a editácia kanálov sa môžu líšiť","Zmiana informacji sieciowych o kanale Czy na pewno chcesz zaktualizować? Jeśli tak, lista kanałów i edytowane kanały mogą ulec zmianie","Csatornahálózati információ változásai. Biztos, hogy frissít? Amennyiben igen, a csatornalista és a csatorna szerkesztés változhat","Промяна в мрежовата информация на канала. Сигурни ли сте, че желаете да актуализирате? В случай че отговорът е да, списъкът с канали и редакцията на каналите може да варира.","تغییرات اطلاعات شبکه کانال به‌روزرسانی می‌کنید؟ در صورت تایید، فهرست کانال و ویرایش کانال ممکن است متفاوت باشند","Informasi jaringan saluran berubah. Yakin akan memperbarui? Jika ya, daftar saluran dan pengeditan saluran mungkin berbeda","N/A"],
