    "The Netflix service is not available currently in this country.":["此地区暂不支持Netflix服务。","The Netflix service is not available currently in this country.","Der Netflix-Dienst ist in diesem Land aktuell nicht verfügbar.","Il servizio Netflix attualmente non è disponibile in questa nazione.","O serviço Netflix não está disponível de momento.","El servicio Netflix no está disponible actualmente en este país.","Le service Netflix est actuellement indisponible dans ce pays.","Netflix-tjenesten er foreløpig ikke tilgjengelig i dette landet.","Netflix-tjenesten er i øjeblikket ikke tilgængelig i dette land.","Netflix-tjenesten er i øjeblikket ikke tilgængelig i dette land.","Netflix palvelu ei ole saatavilla tässä maassa.","Netflix hizmeti şu an için bu ülkede kullanılamıyor.","خدمة نيتفليكس غير متوفرة حاليا في هذه الدولة.","К сожалению, на данный момент сервисы Netflix недоступны в вашей стране.","Dịch vụ Netflix hiện tại không sẵn có tại quốc gia này.","บริการ Netflix ไม่มีให้ในขณะนี้ในประเทศนี้","Netflix ဝန္ေဆာင္မႈသည္ ဤႏုိင္ငံတြင္ ေလာေလာဆယ္ မရႏိုင္ပါ။","Bu davlatda hozircha Netflix xizmati mavjud emas. ","इस देश में अभी नेटफ़्लिक्स सेवा उपलब्ध नहीं है","Сервіси Netflix на жаль зараз не доступні у вашому регіоні.","Perkhidmatan Netflix tidak tersedia pada masa ini di negara ini.","שירותי Netflix אינם זמינים כרגע במדינה זו. ","Služba Netflix v současné době není k dispozici v této zemi.","Služba Netflix v súčasnej dobe nie je k dispozícii v tejto krajine.","Usługa Netflix nie jest obecnie dostępna w tym kraju.","A Netflix szolgáltatás jelen pillanatban ebben az országban nem elérhető.","В момента услугата Netflix не е налична в тази държава.","سرویس Netflix در حال حاضر در این کشور غیرفعال است","Layanan Netflix belum tersedia di negara ini.","N/A"],
