    "This function allows you to correct the images seen by the left and right eye":["对于右-左格式的3D影片，可以尝试用本功能修正左右眼看到的图像","This function allows you to correct the images seen by the left and right eye","Mit dieser Funktion können Sie für Rechts-Links 3D-Bilder die vom linken und rechten Auge gesehenen Bilder korrigieren","Per l'immagine in formato 3D destra-sinistra, è possibile correggere le immagini viste dall'occhio sinistro e dall'occhio destro con questa funzione","Para a imagem em 3D com o formato direito-esquerdo, pode corrigir as imagens vistas pelo olho esquerdo e pelo olho direito com esta função","Para la imagen en formato 3D derecha-izquierda, puede corregir las imágenes vistas por el ojo izquierdo y el ojo derecho con esta función","Concernant le format d'image 3D droite-gauche, vous pouvez corriger les images vues par l'œil gauche et droit à l'aide de cette fonction","Splitter ett bilde i overlappende venstre og høyre bilde for å skape 3D-effekten","För höger-vänster format 3D-bild, kan du rätta bilderna som ses av det vänstra och högra ögat med denna funktion.","For højre-venstre format 3D-billede, kan du rette billederne set af venstre øje og højre øje med denne funktion","3D-kuvan vasen-oikea asetukset, voit säätää vasempaan ja oikeaan silmään näkyviä kuvasignaaleja tämän toiminnon avulla","Sağ-sol biçimli 3 boyutlu resim için, sol ve sağ gözlerle görülen resimleri bu işlevle düzeltebilirsiniz","بالنسبة للصورة صور 3D يمين-يسار، يمكنك تصحيح الصور التي تشاهدها العين اليسرى والعين اليمنى بواسطة هذه الوظيفة ","Для 3D-изображений, основанных на раздельном проецировании, с помощью этой функции можно корректировать изображения для левого и правого глаза","Đối với hình ảnh 3D định dạng phải-trái, bạn có thể chỉnh sửa hình ảnh được nhìn thấy bằng mắt trái và mắt phải bằng chức năng này","สำหรับภาพสามมิติในรูปแบบซ้าย-ขวา คุณสามารถปรับแก้ภาพที่เห็นได้โดยตาข้างซ้ายและตาข้างขวาได้ด้วยฟังก์ชันนี้","ညာ-ဘယ္ ပံုစံ 3D ႐ုပ္ပံုအတြက္ ဘယ္ဘက္မ်က္လံုးႏွင့္ ညာဘက္မ်က္လံုးတို႔ျဖင့္ ျမင္ရေသာ ႐ုပ္ပံုမ်ားကို ဤလုပ္ေဆာင္ခ်က္ႏွင့္ အမွန္ျပင္ႏိုင္သည္။","O'ng-chap format 3D tasvirda bu funksiya yordamida chap ko'z va o'ng ko'z bilan ko'rilgan tasvirlarni to'g'rilashingiz mumkin.","3डी पिक्चर के दाएं-बाएं फ़ॉर्मेट के लिए, आप इस फ़ंक्शन से दाईं औऱ बाईं आंख से दिखने वाली पिक्चर सही कर सकते हैं ","Для 3D-зображень, заснованих на роздільному проектуванні, за допомогою цієї функції можна коригувати зображення для лівого і правого ока","Untuk format gambar 3D kanan kiri, anda boleh membetulkan gambar yang dilihat oleh mata kiri dan mata kanan dengan fungsi ini","עבור פורמט תמונה תלת-מימדית ימין-שמאל, עליכם לתקן את התמונה הנראית בעין שמאל ובעין ימין בעזרת פונקציה זו","S touto funkcí můžete pro pravý-levý formát 3D obrazu opravit obrázky zobrazované pro levé a pravé oko","S touto funkciou môžete pre pravý-ľavý formát 3D obrazu opraviť obrázky zobrazované pre ľavé a pravé oko","Dla formatu „prawo-lewo” obrazu 3D, funkcja ta umożliwia skorygowanie obrazów widzianych przez lewe i prawe oko","A 3D kép jobb-bal formátuma érdekében, ennek a funkciónak a segítségével javíthatja a képet.","С тази функция можете да коригирате картината, видима за лявото и дясното око при 3D формат \"ляво-дясно\".","برای تصویر سه‌بعدی با قالب راست-چپ، می‌توانید با استفاده از این قابلیت می‌توانید تصاویر مشاهده‌شده توسط چشم چپ و چشم راست را اصلاح کنید","Untuk gambar 3D dengan format kanan-kiri, Anda dapat membetulkan gambar yang dilihat mata kiri dan mata kanan dengan fungsi ini","N/A"],
