    "Make sure you have selected the desired language. The remote control should be re-paired if the language is changed":["请确认你已选择了需要的语言，若要更换语言需重新配对遥控器才可完成。","Make sure you have selected the desired language. The remote control should be re-paired if the language is changed","Vergewissern Sie sich, dass Sie die gewünschte Sprache ausgewählt haben. Bei Änderung der Sprache muss die Fernbedienung neu gekoppelt werden","Assicurarsi di aver selezionato la lingua desiderata. Il telecomando dovrebbe essere riabbinato se si modifica la lingua","Garantir que selecionou o idioma desejado. O controle remoto deve ser reemparelhado se o idioma é mudado","Asegúrese de que ha seleccionado el idioma deseado. El control remoto debe volverse a vincular si se cambia el idioma","Assurez-vous que vous avez sélectionné la langue souhaitée. La télécommande doit être ré-appairée si la langue est modifiée","Sørg for at du riktig språk. Fjernkontrollens kobling bør gjenopprettes hvis språket endres ","Säkerställ att du har valt det önskade språket. Fjärrkontrollen bör återparas om språket ändras","Sørg for, at du har valgt det ønskede sprog. Fjernbetjeningen skal være re-parret, hvis sproget er ændret","Varmista, että olet valinnut haluamasi kielen. Kauko-ohjauksen pari tulee asettaa uudelleen, mikäli kieli haluaan vaihtaa","İstediğiniz dili seçtiğinizden emin olun. Dil değiştirilirse uzaktan kumanda yeniden eşleştirilmelidir."," تأكد من أنك قمت بتحديد اللغة المطلوبة. جهاز التحكم عن بعد يجب إعادة -المقارنة إذا تم تغيير اللغة ","Проверьте, что выбран правильный язык. Если изменился язык, пульт ДУ необходимо повторно ввести в сопряжение","Hãy đảm bảo rằng bạn đã chọn ngôn ngữ mong muốn. Nên chỉnh lại điều khiển từ xa nếu ngôn ngữ được thay đổi","โปรดตรวจสอบว่าได้เลือกภาษาที่ต้องการแล้ว เนื่องจากรีโมทคอนโทรลควรได้รับการจับคู่ใหม่เมื่อทำการเปลี่ยนภาษา","သင္ လိုခ်င္ေသာ ဘာသာစကားကို ေရြးထားေၾကာင္း ေသခ်ာေအာင္ ျပဳလုပ္ပါ။ ဘာသာစကားကို ေျပာင္းလိုက္ပါက အေဝးထိန္းခ်ဳပ္မႈကို ျပန္တြဲဖက္သင့္သည္။","Kerakli tilni tanlaganingizga ishonch hosil qiling. Agar til o'zgartirilsa, masofa pulti qayta bog'lanishi kerak.","सुनिश्चित कर लें आपने सही भाषा चुनी है. अगर भाषा बदली है तो रिमोट कंट्रोल की री-पैरिंग करना पड़ेगी.","Перевірте, що вибрано правильну мову. Якщо змінилася мова, пульт ДУ необхідно повторно ввести в сполучення","Pastikan anda telah memilih bahasa yang dikehendaki. Alat kawalan jauh perlu dipasangkan semula jika bahasa berubah","ודאו שבחרתם בשפה הרצויה. יש לבצע זיווג-מחדש של השלט רחוק אם בוצע שינוי בשפה","Ujistěte se, že jste vybrali požadovaný jazyk! Při změně jazyka je třeba znovu spárovat dálkové ovládání","Ubezpečte sa, že ste vybrali požadovaný jazyk! Pri zmene jazyka je potrebné znovu spárovať diaľkové ovládanie","Upewnij się, że wybrałeś odpowiedni język. Jeśli zmieniono język, należy ponownie sparować pilota","Győződjön meg róla, hogy a megfelelő nyelvet választotta. Ha megváltozott a nyelv, a távirányító újbóli párosítása szükséges","Уверете се, че сте избрали желания език. В случай че езикът бъде променен, дистанционното управление трябва да бъде сдвоено отново.","مطمئن شوید که زمان مورد نظر را انتخاب کرده‌اید. در صورت تغییر زبان، کنترل از راه دور باید دوباره جفت‌سازی شود","Pastikan Anda sudah memilih bahasa yang diinginkan. Remote control harus disandingkan ulang jika bahasa diubah","N/A"],
