    "The Ginga service is not available currently in this country.":["本地区暂不支持Ginga服务","The Ginga service is not available currently in this country.","Ginga ist momentan nicht in diesem Land verfügbar.","Il servizio Ginga non è disponibile attualmente in questa nazione.","O serviço Ginga não está actualmente disponível para este país.","El servicio Ginga no está disponible actualmente para este país.","Le service Ginga n'est actuellement pas disponible dans ce pays.","Ginga-tjenesten er for øyeblikket ikke tilgjengelig i dette landet.","Ginga-tjänsten är för tillfället inte tillgängligt i detta land.","Ginga-service er ikke tilgængelig i øjeblikket i dette land.","Ginga-sovellus ei ole käytettävissä tässä maassa.","Ginga hizmeti şu anda bu ülkede kullanılamıyor.","خدمة جينجا غير متوفره حاليا في هذا البلد","В этой стране сервис Ginga сейчас не работает.","Các dịch vụ Ginga hiện nay chưa có sẵn ở đất nước này.","บริการ Ginga ไม่พร้อมใช้งานในประเทศนี้ในขณะนี้","ဤႏုိင္ငံတြင္ Ginga ဝန္ေဆာင္မႈကို ေလာေလာဆယ္ မရႏုိင္ပါ။","Bu mamlakatda hozirda Ginga xizmatidan foydalanish imkoniyati yo'q.","इस देश में फिलहाल जिंगा सेवा उपलब्ध नहीं","У цій країні сервіс Ginga зараз не працює.","Perkhidmatan Ginga tidak boleh didapati pada masa ini di negara ini.","שירות Ginga אינו זמין כרגע במדינה זו. ","V současné době v této zemi služba Ginga není k dispozici.","V súčasnej dobe v tejto krajine služba Ginga nie je k dispozícii.","Usługa Ginga nie jest aktualnie dostępna w tym kraju.","A Ginga szolgáltatás jelenleg az Ön országában nem elérhető.","В момента у слугата Ginga не е достъпна за Вашия район.","سرویس Ginga در حال حاضر در این کشور فعال نیست.","Layanan Ginga belum tersedia di negara ini.",""],
