    "Use the number keys to quickly locate the channel":["","Use the number keys to quickly locate the channel","Drücken Sie die Zifferntasten um den Kanal direkt anzuwählen.","Premere i tasti numerici per trovare rapidamente il canale.","Pressione as teclas de número para entrar no canal de imediato.","Pulse las teclas numéricas para localizar el canal inmediatamente.","Appuyez sur les touches numériques pour trouver immédiatement la chaîne.","Bruk talltastene for å gå til kanalen umiddelbart.","Tryck på sifferknapparna för att snabbt hitta kanalen.","Tryk på taltasterne for hurtigt at finde kanalen med det samme.","Paina numeronäppäimiä vaihtaaksesi suoraan haluamaasi kanavaan.","Kanalı hızla bulmak için rakam tuşlarına basın.","اضغط على مفاتيح الأرقام لتحديد القناة فورا.","Для быстрого выбора канала воспользуйтесь цифровыми кнопками.","Bấm các phím số để xác định vị trí các kênh ngay lập tức.","กดที่ปุ่มตัวเลขเพื่อค้นหาช่องได้ทันทีอย่างรวดเร็ว","ခ်န္နယ္ကို ခ်က္ခ်င္း ျမန္ျမန္ ေနရာခ်ရန္ နံပါတ္ခလုတ္မ်ားကို ႏွိပ္ပါ။","Kanalni tez o'rnatish uchun raqamli tugmani bosing ","चैनल जल्दी ढूंढने के लिए नंबर की दबाएं","Для швидкого вибору каналу скористайтеся цифровими кнопками.","Tekan kekunci nombor untuk cepat mencari saluran dengan segera.","לחצו על כפתורי המספרים על מנת לאתר ערוץ במהירות ומיד. ","Stiskněte číselná tlačítka pro rychlé okamžité lokalizování kanálu.","Stlačte číselné tlačidlá pre rýchle okamžité lokalizovanie kanála.","Użyj klawiszy numerycznych, aby szybko wybrać kanał.","Nyomja meg a szám billentyűket a csatorna azonnali gyors lokalizálásához.","Натиснете цифровите бутони за незабавно избиране на канал.","برای تعیین مکان سریع کانال، دکمه‌های اعداد را فشار دهید.","Tekan tombol angka untuk berpindah saluran dengan cepat.",""],
