    "Adjust current picture mode to apply to all sources or just current source.":["","Adjust current picture mode to apply to all sources or just current source.","Aktuelle Bildeinstellungen auf alle oder den aktuellen Eingang anwenden.","Regola la modalità foto corrente e applica a tutte le sorgenti o solo alla sorgente corrente.","Ajustar o modo de imagem actual para aplicar a todas as fontes ou só à fonte actual.","Ajuste el modo de imagen actual, aplique a todas las fuentes o simplemente a la fuente actual.","Ajuster le mode Image actuel, appliquer à toutes les sources ou uniquement la source actuelle.","Angi gjeldende bildemodus for alle kilder eller bare gjeldende kilde.","Justera det nuvarande bildläget så att det gäller för alla källor eller bara den nuvarande källan.","Justering af aktuelle billedtilstand gælder for alle kilder eller blot aktuelle kilde.","Valitse haluatko käyttää nykyisiä kuva-asetuksia kaikkiin lähteisiin tai vain nykyiseen lähteeseen.","Geçerli resim modunu tüm kaynaklara veya yalnızca geçerli kaynağa uygulayın.","ضبط وضع الصورة الحالية لجميع المصادر أو لضبط المصدر الحالي فقط.","Укажите, применять текущий режим картинки ко всем источникам или только к текущему.","Điều chỉnh chế độ hình ảnh hiện tại áp dụng cho tất cả các mã nguồn,hoặc chỉ cho nguồn hiện tại ","ปรับโหมดรูปภาพใช้กับทุกแหล่งกำเนิดหรือเฉพาะแหล่งกำเนิดปัจจุบัน","႐ုပ္ပံုမုဒ္ကို ရင္းျမစ္အားလံုး သို႔မဟုတ္ လက္ရွိရင္းျမစ္တြင္ အသံုးျပဳရန္ ခ်ိန္ပါ။","Joriy tasvir rejimini joriy rejimini barcha manbalarga yoki joriy manbaga sozlang ","मौजूदा पिक्चर मोड को सभी स्रोत या सिर्फ़ मौजूदा स्रोत पर लागू करें","Вкажіть, застосовувати поточний режим картинки до всіх джерел або тільки до поточного.","Laraskan mod gambar semasa kepada semua sumber atau hanya sumber semasa.","התאימו את מצב התמונה הנוכחי והחילו אותו לכל מקור או רק למקור הנוכחי. ","Nastavení aktuálního režimu obrazu platí pro všechny zdroje, nebo jen pro aktuální zdroj.","Nastavenie aktuálneho režimu obrazu platí pre všetky zdroje, alebo len pre aktuálny zdroj.","Wybierz zastosowanie bieżącego trybu obrazu do wszystkich źródeł lub tylko do aktualnego źródła.","Aktuális kép mód szabályozásának alkalmazása minden forrásra vagy csak az aktuális forrásra.","Прилагане на текущия картинен режим към всички източници или само към текущия източник.","حالت عکس فعلی را در همه منابع یا فقط منبع فعلی تنظیم کنید.","Setel mode gambar sekarang untuk semua sumber atau hanya sumber sekarang.",""],
