    "Select the colour gamut to best suit the content you're viewing.":["","Select the colour gamut to best suit the content you're viewing.","Auswahl des Farbraums : Norm entspricht natürlichen Farben, Nativ bietet etwas kräftigere Farben","Seleziona la gamma di colore che meglio si adatta al contenuto visualizzato.","Seleccione a gama de cor para se adequar ao conteúdo que está a visualizar.","Seleccione la gama de colores para adaptar mejor el contenido que está viendo.","Sélectionnez la gamme de couleurs la plus adaptée au contenu que vous visionnez.","Velg fargespekteret som passer best for innholdet du ser på.","Välj den färgskala som passar bäst för innehållet du tittar på.","Vælg den farveskala der bedst passer det indhold, du ser.","Valitse se värialue, joka sopii sisältöösi parhaiten.","İzlemekte olduğunuz içeriğe en uygun renk dizisini seçin.","حدد التدرج اللوني ليتناسب بشكل افضل مع المحتوى الذي تعرضه.","Выберите цветовую гамму, наилучшим образом подходящую для просмотра контента.","Chọn gam màu phù hợp nhất với nội dung bạn đang xem.","เลือกขอบเขตช่วงสีให้เหมาะกับเนื้อหาที่คุณกำลังดู","သင္ၾကည့္ေနေသာ အေၾကာင္းအရာႏွင့္ အေကာင္းဆံုးသင့္ေလ်ာ္ေသာ အေရာင္စံုကို ေရြးပါ။","Siz ko'rayotgan tasvirga eng mos keladigan ranglar yo'plamini tanlang ","जो सामग्री आप देख रहे हैं उसके लिए रंग गैमट चुनें","Виберіть кольорову гамму, що найкращим чином пасує до перегляду контенту.","Pilih gamut warna yang sesuai dengan kandungan yang anda tonton.","בחרו במכלול הצבע המתאים ביותר לתכן בו אתם צופים.","Zvolte barevný gamut, aby co nejlépe odpovídal obsahu, který prohlížíte.","Zvoľte farebný gamut, aby čo najlepšie zodpovedal obsahu, ktorý prezeráte.","Wybierz gamę kolorów najlepiej dopasowaną do oglądanych materiałów.","Válassza ki a szín gamutot, hogy a megjelenített tartalomhoz leginkább megfeleljen.","Изберете цветовата гама, която най-добре подхожда на възпроизвежданото съдържание.","برای مشاهده بهتر محتوایی که در حال تماشای آن هستید، وسعت رنگ را انتخاب کنید.","Pilih gamut warna yang paling cocok dengan konten yang sedang Anda tonton.",""],
    "Adjust advanced picture settings on current source.":["","Adjust advanced picture settings on current source.","Erweiterte Bildeinstellungen für den aktuellen Eingang","Regola le impostazioni avanzate di immagine nella sorgente corrente.","Ajuste as definições de imagem avançada na fonte actual.","Ajuste la configuración avanzada de la imagen en la fuente actual.","Ajuster les paramètres avancés de l'image sur la source actuelle.","Juster avanserte bildeinnstillinger i gjeldende kilde.","Justera avancerade bildinställningar i nuvarande källan.","Juster avancerede billedindstillinger i aktuelle kilde.","Säädä nykyiselle lähteelle asetettuja kuvan lisäasetuksia.","Geçerli kaynakta gelişmiş resim ayarlarını yapın.","ضبط إعدادات الصورة المتقدمة في المصدر الحالي.","Настройте расширенные настройки изображения для текущего источника.","Điều chỉnh cài đặt hình ảnh nâng cao trong nguồn hiện tại.","ปรับการตั้งค่ารูปภาพขั้นสูงในแหล่งกำเนิดปัจจุบัน","အဆင့္ျမင့္႐ုပ္ပံုဆက္တင္မ်ားကို လက္ရွိရင္းျမစ္တြင္ ခ်ိန္ပါ။","Joriy manbada eng mos keladigan ko'rsatkichlarni o'rnating","मौजूदा स्रोत में एडवांसड पिक्चर सेटिंग एडजस्ट करें","Налаштуйте розширені налаштування зображення для поточного джерела.","Laraskan tetapan gambar lanjutan dalam sumber semasa.","התאימו את הגדרות התמונה המתקדמות עבור המקור הנוכחי. ","Nastavte pokročilé nastavení obrazu v aktuálním zdroji.","Nastavte pokročilé nastavenia obrazu v aktuálnom zdroji.","Dostosuj zaawansowane ustawienia obrazu dla aktualnego źródła.","Részletes kép beállítások szabályozása az aktuális forráshoz.","Регулиране на разширените настройки на картината за текущия източник.","تنظیمات پیشرفته عکس در منبع فعلی را تنظیم کنید.","Setel pengaturan gambar lanjut di sumber sekarang.",""],
