    "Adjust current sound mode to apply to all source or just current source.":["","Adjust current sound mode to apply to all source or just current source.","Aktuelle Toneinstellungen auf alle oder den aktuellen Eingang anwenden.","Regola la modalità suono corrente e applica a tutte le sorgenti o solo alla sorgente corrente","Ajustar o modo de som actual para aplicar a todas as fontes ou só à fonte actual.","Ajustar el modo de sonido actual se aplicará a todas las fuentes o simplemente a la fuente actual.","Ajuster le mode audio actuel, appliquer à toutes les sources ou uniquement la source actuelle.","Angi gjeldende lydmodus for alle kilder eller bare gjeldende kilde.","Justera det nuvarande ljudläget så att det gäller för alla källor eller bara den nuvarande källan.","Justering af aktuelle lydtilstand gælder for alle kilder eller blot aktuelle kilde.","Valitse haluatko käyttää nykyisiä ääniasetuksia kaikkiin lähteisiin tai vain nykyiseen lähteeseen.","Geçerli ses modunu tüm kaynaklara veya yalnızca geçerli kaynağa uygulayın.","ضبط وضع الصوت الحالي لجميع المصادر أو لضبط المصدر الحالي فقط.","Укажите, применять текущий режим звука ко всем источникам или только к текущему.","Điều chỉnh chế độ âm thanh hiện tại áp dụng cho tất cả các mã nguồn, hoặc chỉ nguồn hiện tại.","ปรับโหมดเสียงใช้กับทุกแหล่งกำเนิดหรือเฉพาะแหล่งกำเนิดปัจจุบัน","အသံမုဒ္ကို ရင္းျမစ္အားလံုး သို႔မဟုတ္ လက္ရွိရင္းျမစ္တြင္ အသံုးျပဳရန္ ခ်ိန္ပါ။","Joriy tosush rejimini joriy rejimini barcha manbalarga yoki joriy manbaga sozlang ","मौजूदा साउंड मोड को सभी स्रोत या सिर्फ़ मौजूदा स्रोत पर लागू करें","Вкажіть, застосовувати поточний режим звуку до всіх джерел або тільки до поточного.","Laraskan mod bunyi semasa kepada semua sumber atau hanya sumber semasa.","התאימו את מצב השמע הנוכחי והחילו אותו ללכל מקור או רק למקור הנוכחי.","Nastavení aktuálního režimu zvuku platí pro všechny zdroje, nebo jen pro aktuální zdroj.","Nastavenie aktuálneho režimu zvuku platí pre všetky zdroje, alebo len pre aktuálny zdroj.","Wybierz zastosowanie bieżącego trybu dźwiękowego do wszystkich źródeł lub tylko do aktualnego źródła.","Aktuális hang mód szabályozásának alkalmazása minden forrásra vagy csak az aktuális forrásra.","Прилагане на текущия звуков режим към всички източници или само към текущия източник.","حالت صدای فعلی را در همه منابع یا فقط منبع فعلی را تنظیم کنید.","Setel mode suara sekarang untuk semua sumber atau hanya sumber sekarang.",""],
    "Disable TV speaker when you are using sound bar, ARC or any other external audio amplifier.":["","Disable TV speaker when you are using sound bar, ARC or any other external audio amplifier.","Deaktivieren der TV-Lautsprecher bei Verwendung einer Soundbar, ARC (Audio Return Channel) oder eines externen Audio-Verstärkers.","Disattiva l'altoparlante TV quando utilizzi la barra del suono, ARC o qualsiasi altro amplificatore audio esterno.","Desactive a coluna de TV quando estiver a utilizar a barra de som, ARC ou qualquer outro amplificador de áudio externo.","Desactive el altavoz del televisor cuando se utiliza la barra de sonido, ARC o cualquier otro amplificador de audio externo.","Désactiver le haut-parleur de la TV, lorsque vous utilisez la barre de son, ARC, ou tout autre amplificateur audio externe.","Deaktiver TV-høyttaler når du bruker lydplanke, ARC eller annen ekstern lydforsterker.","Avaktivera TV-högtalare när du använder en ljudplanka, ARC eller någon annan extern förstärkare.","Deaktiver TV-højttaler, når du bruger lyd-bar, ARC eller enhver anden ekstern audio-forstærker.","Poista TV:n kaiutin käytöstä soundbar-kaiuttimen, ARC:n muun äänentoistolaitteen käytön ajaksi.","Ses çubuğu, ARC veya başka bir harici ses yükseltici kullanırken televizyon hoparlörünü devre dışı bırakın.","تعطيل سماعة التلفزيون عند استخدام شريط الصوت، ARC اواي مكبر صوت خارجي اخر.","Отключите динамик ТВ, когда используете саундбар, ARC или любой другой внешний аудиоусилитель.","Vô hiệu hóa loa TV khi bạn đang sử dụng thanh âm, ARC hoặc bất kỳ khuếch đại âm thanh bên ngoài khác.","ปิดลำโพงทีวีเมื่อคุณกำลังใช้แถบเสียง ARC หรือเครื่องขยายเสียงจากภายนอกอื่น ๆ","အသံဘား၊ ARC သို႔မဟုတ္ အျခားျပင္ပအသံခ်ဲ႕စက္တစ္ခုခုကို သံုးေနေသာအခါ TV စပီကာကို ပိတ္ပါ။","Agar tovush paneli, magnitofon yoki boshqa tashqi audio kuchaytirgichdan foydalanayotgan bo'lsangiz, akkustik TV tizimni o'chiring ","साउंड बार, ए आर सी या अन्य बाहरी ऑडियो एंप्लीफाइर प्रयोग करते समय टीवी स्पीकर डिसेबल कर दें","Вимкніть динамік ТВ, коли використовуєте саундбар, ARC або будь-який інший зовнішній аудіопідсилювач.","Matikan pembesar suara TV apabila anda menggunakan bar bunyi, ARC atau mana-mana penguat audio luaran.","נטרלו את רמקולי הטלוויזיה כשאתם משתמשים בשורת מצב השמע, ARC או כל מגבר שמע חיצוני אחר. ","Zakáže reproduktory TV, pokud používáte Soundbar, ARC nebo jakékoliv jiný externí audio zesilovač.","Zakáže reproduktory TV, ak používate Soundbar, ARC alebo akékoľvek iný externý audio zosilňovač.","Wyłącz głośnik telewizora podczas używania listwy dźwiękowej, kanału zwrotnego ARC lub innego zewnętrznego wzmacniacza dźwięku.","TV hangszóró letiltása, amikor Soundbart, ARC-t vagy más külső erősítőt használ.","Деактивиране на телевизионния говорител при използване на саундбар, ARC или друг външен аудио усилвател.","هنگامی که از ساندبار، ARC یا سایر تقویت‌کننده‌های صوتی خارجی استفاده می‌کنید، بلندگوی تلویزیون را غیرفعال کنید.","Matikan speaker TV saat menggunakan soundbar, ARC atau amplifier audio eksternal lainnya.",""],
