    "Internal Subwoofer provides a better bass effect.":["","Internal Subwoofer provides a better bass effect.","Ein interner Subwoofer kann einen besseren Bass-Effekt bereitstellen","Il Subwoofer interno può fornire un effetto basso migliore. ","Subwoofer Interno pode oferecer um efeito de baixo melhor.","El subwoofer interno puede proporcionar un mejor efecto de los bajos.","Le Subwoofer interne peut fournir un meilleur effet de basse.","Den innebygde basshøyttaleren kan gi bedre basseffekt.","Intern subwoofer kan ge bättre baseffekt.","Intern Subwoofer kan give bedre baseffekt.","Kytke laitteen subwoofer päälle, jos haluat paremman bassotoiston.","Dâhili derin bas hoparlör daha iyi bas efekti sağlayabilir.","مضخم الصوت الداخلي يوفر تأثيرات افضل.","Внутренний сабвуфер дает лучшие басы.","Loa Subwoofer bên trong có thể cung cấp hiệu ứng âm bass tốt hơn.","ซับวูฟเฟอร์ภายในสามารถให้เสียงทุ้มที่ดีกว่าได้","စက္တြင္းပါ Subwoofer သည္ ပိုေကာင္းေသာ အနိမ့္သံအထူးျပဳလုပ္ခ်က္ကို ေပးႏိုင္သည္။","Ichki sabvufer past ovozlarni samarali chiqaradi ","अंदरूनी सबवूफर अच्छा बास एफेक्ट दे सकता है","Внутрішній сабвуфер дає кращі баси.","Subwoofer dalaman boleh memberikan kesan bass yang lebih baik.","סאבוופר פנימי יכול לספק אפקט בס טוב יותר. ","Interní Subwoofer může poskytnout lepší basové efekty.","Interný Subwoofer môže poskytnúť lepšie basové efekty.","Wewnętrzny subwoofer może zapewnić lepsze efekty basowe.","A beépített Subwoofer jobb basszushatást nyújt.","Вътрешният събууфър предоставя дълбочина в ниските честоти.","ساب ووفر داخلی می‌تواند جلوه بم بهتری ارائه کند.","Subwoofer Internal dapat memberikan efek bass yang lebih baik.",""],
    "Adjust the bass effect to suit the type of content you are listening to.":["","Adjust the bass effect to suit the type of content you are listening to.","Den Bass einstellen, entsprechend der Art des gerade laufenden Inhalts","Regola l'effetto basso per adattarlo al tipo di contenuto che stai ascoltando.","Ajuste o efeito de baixo para se adequar ao tipo de conteúdo que estiver a ouvir.","Ajuste el efecto de graves en función del tipo de contenido que está escuchando.","Ajuster l'effet de basse en fonction du type de contenu que vous écoutez.","Juster basseffekten i henhold til det du lytter til.","Justera den baseffekt som passar bäst för den typ av innehåll du lyssnar på.","Juster baseffekten, så den passer til den type indhold, du lytter til.","Säädä bassotoistoa, jotta se korostaa toistettavaa sisältöä mahdollisimman hyvin.","Dinlemekte olduğunuz içeriğin türüne uygun bas efektini ayarlayın.","ضبط تأثير الصوت الجهور كي يناسب المحتوى الذي تستمع اليه.","Настройте басы в соответствии с типом прослушиваемого контента.","Điều chỉnh các hiệu ứng âm bass cho phù hợp với các loại nội dung bạn đang nghe.","ปรับเอฟเฟ็คท์เสียงทุ้มให้เหมาะกับประเภทของเนื้อหาที่คุณรับฟัง","သင္နားေထာင္ေနေသာ အေၾကာင္းအရာအမ်ဳိးအစားႏွင့္ သင့္ေလ်ာ္ေသာ အနိမ့္သံအထူးျပဳလုပ္ခ်က္ကို ခ်ိန္ပါ။","O'zingizga moslab, past ovozlarni sozlang ","जो सामग्री आप सुन रहे हैं उसके लिए बास एफेक्ट को एडजस्ट करें","Налаштуйте баси відповідно до типу контенту, що прослуховується.","Menyesuaikan kesan bass untuk disesuaikan dengan jenis kandungan yang anda sedang dengar.","כווננו את אפקט הבס כך שיתאים לסוג התכן לו אתם מאזינים. ","Nastavte basy, aby vyhovovaly typu obsahu, který posloucháte.","Nastavte basy, aby vyhovovali typu obsahu, ktorý počúvate.","Wybierz efekty basowe najlepiej dopasowane do słuchanych materiałów.","Basszus hatás szabályozása a hallgatott tartalom típusához.","Регулиране на ниските честоти за най-добро качество на звука на възпроизвежданата програма.","جلوه بم را متناسب با نوع محتوایی که مشغول به گوش کردن به آن هستید تنظیم کنید.","Pilih efek bass yang cocok dengan jenis konten yang sedang Anda dengarkan.",""],
