    "Change your PIN that you use to access Parental Controls, Auto Channel Scan and Reset To Factory Default.":["","Change your PIN that you use to access Parental Controls, Auto Channel Scan and Reset To Factory Default.","Vergabe der System PIN für Kindersicherung, Sendersuchlauf und Werkseinstellungen","Cambia il PIN che usi per accedere al Controllo Parentale, alla Scansione Automatica dei Canali e al Reset delle impostazioni di fabbrica.","Altere o PIN que utiliza para aceder aos Controlos Parentais, Pesquisa de Canais Automática e Reiniciar Para Padrões de Fábrica.","Cambie el PIN que utiliza para acceder a los controles parentales, búsqueda automática de canales y restablecer los ajustes de fábrica.","Changer le code PIN que vous utilisez pour accéder aux contrôles parentaux, balayage automatique des chaînes et réinitialisation des paramètres par défaut.","Endre PIN-koden du bruker for å få tilgang til Foreldrekontroll, Automatisk kanalsøk og Tilbakestill til fabrikkinnstillinger.","Ändra PIN-koden som du använder för föräldrakontroll, automatisk kanalsökning och återställ till fabriksinställningar.","Skift din PIN-kode, du bruger til at få adgang til Forældrekontrol, Auto-kanalscanning og Nulstil til fabriksindstillinger.","Vaihda PIN-koodi, jota tarvitset ohjelmarajoitusten asettamiseen, automaattisen kanavahaun tekemiseen ja tehdasasetusten palauttamiseen.","Ebeveyn Denetimleri, Otomatik Kanal Tarama ve Fabrika Varsayılanına Sıfırla işlevlerine erişmek için kullandığınız PIN kodunuzu değiştirin.","تغيير الرقم السري الخاص بك الذي يسمح لك بالوصول الى تحكم الوالدين، البحث التلقائي عن القنوات، وضبط المصنع.","Изменить пин-код для доступа к родительскому управлению, автоматическому сканированию каналов и сбросу в заводские настройки.","Thay đổi mã PIN bạn sử dụng để truy cập Kiểm soát của cha mẹ, Quét kênh tự động và Mặc định khởi động lại máy. ","เปลี่ยนรหัส PIN ที่คุณใช้เข้าถึงการควบคุมแบบผู้ปกครอง สแกนช่องรายการอัตโนมัติและรีเซ็ตไปสู่ค่าเริ่มต้นจากโรงงาน","ပင္မထိန္းခ်ဳပ္မႈမ်ားကို သံုးရန္၊ အလိုအေလ်ာက္ ခ်န္နယ္ရွာရန္ႏွင့္ စက္႐ုံပံုေသအတိုင္း ျပန္သတ္မွတ္ရန္ သံုးေသာ သင့္ PIN ကို ေျပာင္းပါ။","Ota-ona nazorati, Kanallarni avtomatik skanerlash, va Zavod sozlashlarini bekor qilish bo'limlariga kirish uchun Siz ishlatadigan PIN-kodga almashtiring ","पेरेंटल कंट्रोल, ऑटो चैनल स्कैन और रिसेट टू फैक्ट्री डिफॉल्ट के लिए पिन बदलें","Змінити пін-код для доступу до батьківського управління, автоматичного сканування каналів і скидання в заводські налаштування.","Tukar PIN anda yang anda gunakan untuk mengakses Kawalan Ibu Bapa, Auto Imbas Saluran dan Tetapan Kilang lalai.","שנו את קוד PIN המשמש אתכם לכניסה למערכת בקרת הורים, סריקת ערוצים אוטומטית ואתחול הגדרות ברירת מחדל. ","Změňte svůj PIN kód, který používáte pro přístup do Rodičovský zámek, do Automatického skenování kanálů a pro Obnovení továrního nastavení.","Zmeňte svoj PIN kód, ktorý používate na prístup do Rodičovskej kontroly, do Automatického skenovania kanálov a pre Obnovenie továrenského nastavenia.","Wprowadź kod PIN, aby uzyskać dostęp do funkcji kontroli rodzicielskiej, automatycznego skanowania kanałów i przywracania ustawień domyślnych.","A szülői ellenőrzéshez, automatikus csatorna-pásztázáshoz és az alapértelmezett gyári beállítások visszaállításához használható PIN kód megváltoztatása.","Смяна на ПИН кода за достъп до Родителски контрол, Автоматично сканиране на каналите и Връщане на настройките към фабричния им вид.","پین مورد استفاده برای دسترسی به کنترل والدین، اسکن خودکار کانال و بازنشانی به تنظیمات کارخانه را تغییر دهید.","Ganti PIN yang dapat digunakan untuk mengakses Kontrol Parental, Pindai Saluran Otomatis dan Reset ke Default Pabrik.",""],
