    "Set the date and time to automatically sync with internet/broadcast or manual setup by yourself.":["","Set the date and time to automatically sync with internet/broadcast or manual setup by yourself.","Wahl der Zeit und Datums Einstellung: manuell oder automatisch über das TV Signal / Internet","Imposta la data e l'ora per sincronizzare automaticamente con internet/broadcast o imposta manualmente. ","Define a data e hora para sincronizar automaticamente com a internet/transmissão ou defina manualmente.","Ajuste la fecha y la hora para sincronizar automáticamente con Internet / difusión o configure manualmente usted mismo.","Régler la date et l'heure pour synchroniser automatiquement avec internet/diffusion ou accéder au réglage manuel","Angi dato og klokkeslett for automatisk synkronisering med Internett/TV eller manuelt oppsett.","Ställ in datum och tid så att de synkroniseras automatiskt med internet/TV-sändning eller ställ in den manuellt.","Indstil dato og tid til automatisk at synkronisere med internet/udsendelse eller opsæt manuelt.","Aseta päivämäärä ja aika päivittymään automaattisesti internetin/lähetysten kautta tai määrittele asetukset itse.","Internet'le/Yayınla otomatik olarak eşitlemek için tarihi ve saati ayarlayın veya kendiniz elle kurun.","تعيين الوقت والتاريخ تلقائيا باستخدام اعدادات التزامن الداخلي/البث حسب طلبك.","Установите дату и время для автоматической синхронизации с интернет/ТВ передачей или выберите ручную настройку.","Thiết lập ngày và thời gian để tự động đồng bộ với internet / truyền hình hoặc thiết lập của chính bạn.","ตั้งวันที่และเวลาเพื่อซิงค์อัตโนมัติกับอินเทอร์เน็ต/การแพร่กระจายสัญญาณ หรือการตั้งค่าด้วยตัวเอง","အင္တာနက္/ထုတ္လႊင့္မႈႏွင့္ အလိုအေလ်ာက္ အခ်ိန္ကိုက္ ညႇိရန္ သို႔မဟုတ္ သင္ကိုယ္တိုင္ သတ္မွတ္ရန္ ရက္စြဲႏွင့္အခ်ိန္ကို သတ္မွတ္ပါ။","Avtomatik sinxronizatsiya uchun Internet/TV ko'rsatuvlar tizimi orqali yoki qo'lda vaqtni va sanani o'rnating ","तिथि और समय को इंटरनेट / ब्राडकास्ट से स्वचलित सिंक करें या खुद ही सेटअप करें","Встановіть дату і час для автоматичної синхронізації з інтернет/ТВ передачею або виберіть ручне налаштування.","Tetapkan tarikh dan masa untuk menyelaras secara automatik dengan internet/siaran atau persediaan manual sendiri.","הגדירו את התאריך והשעה כך שיסונכרנו באופן אוטומטי מול האינטרנט / השידור או הגדירו אותם ידנית בעצמכם. ","Nastavte datum a čas pro automatickou synchronizaci s internetovým vysíláním / nebo manuálně nastavte sami.","Nastavte dátum a čas pre automatickú synchronizáciu s internetovým vysielaním / alebo manuálne nastavte sami.","Ustaw automatyczną synchronizację daty i czasu z internetem/telewizją lub wprowadź je ręcznie.","Állítsa be a pontos idő automatikus szinkronizálását interneten/sugárzott jel alapján, vagy állítsa be az időt manuálisan saját maga.","Задаване на автоматично синхронизиране на датата и часа с предоставените от Интернет / телевизионната програма или ръчно настройване.","تاریخ و زمان همگام‌سازی خودکار با اینترنت/پخش یا نصب دستی را تعیین کنید.","Atur tanggal dan waktu untuk disinkronkan secara otomatis dengan internet/siaran atau atur sendiri secara manual.",""],
