    "This mode has a higher energy consumption. Are you sure you wish to continue?":["当前模式功能较高，是否继续？","This mode has a higher energy consumption. Are you sure you wish to continue?","Aktueller Modus hat höhere Funktionalität. Wirklich fortfahren?","Questa modalità ha un maggior consumo energetico. Sicuro di voler continuare?","O modo atual tem funções superiores. Tem a certeza que quer continuar?","El modo actual tiene una función superior. ¿Quiere continuar?","Le mode actuel a une fonctionnalité plus élevée. Voulez-vous continuer?","Gjeldende modus har høyere funksjon. Er du sikker på at du vil fortsette?","Nuvarande läge har högre funktion. Är du säker på att du vill fortsätta?","Nuværende tilstand har højere funktion. Er du sikker på at du vil fortsætte?","Nykyisessä tilassa on korkeampi toiminto. Haluatko jatkaa?","Geçerli mod daha yüksek işleve sahip. Devam etmeye emin misiniz?","الوضع الحالي يمتلك وظيفة أعلى. تأكد من المتابعة؟","Этот режим потребляет больше энергии. Продолжить?","Chế độ hiện tại có chức năng cao hơn. Chắn chắn tiếp tục không?","โหมดปัจจุบันมีฟังก์ชันมากกว่า คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","လက္ရွိ အေနအထားတြင္ အဆင့္ျမင့္ လုပ္ေဆာင္ခ်က္ရွိသည္။ ဆက္လုပ္မလား?","Ayni damdagi rejim yuqori funksiyaga ega. Davom etmoqchi ekaningizga ishonchingiz komilmi?","मौजूदा मोड में अधिक फन्कशन हैं. आगे बढ़ना चाहते हैं ?","Поточний режим має більш високий пріоритет. Продовжити?","Mod semasa mempunyai fungsi yang lebih tinggi. Pasti meneruskan?","המצב הנוכחי בעל תפקוד טוב יותר. האם אתה בטוח שתרצה להמשיך?","Aktuální režim má vyšší funkci. Chcete pokračovat?","Aktuálny režim má vyššiu funkciu. Chcete pokračovať?","Bieżący tryb ma wyższą funkcję. Czy chcesz kontynuować?","Az aktuális üzemmód magasabb funkcióval rendelkezik. Biztosan folytatja?","Текущият режим е с по-високи функции. Сигурни ли сте, че желаете да продължите?","حالت فعلی کاربرد بیشتری دارد. ادامه می‌دهید؟","Mode saat ini memiliki fungsi yang lebih tinggi. Anda yakin ingin melanjutkan?","N/A"],
