    "No channels are available. Are you sure you wish to continue?":["您当前没有可以观看的频道，是否继续？","No channels are available. Are you sure you wish to continue?","Kein Sender verfügbar. Wirklich fortfahren?","Nessun canale disponibile. Sicuro di voler continuare?","Não existem canais disponíveis. Tem a certeza que quer continuar?","No hay ningún canal disponible. ¿Quiere continuar?","Pas de chaîne disponible. Voulez-vous Continuer?","Ingen kanaler er tilgjengelig Er du sikker på at du vil fortsette?","Ingen kanal är tillgänglig. Är du säker på att du vill fortsätta?","Ingen kanal tilgængelig. Er du sikker på at du vil fortsætte?","Kanavia ei löydy. Haluatko jatkaa?","Hiç kanal yok. Devam etmeye emin misiniz?","لا توجد اي قناة متاحة. تأكد من المتابعة؟","Каналы отсутствуют. Продолжить?"," Không có kênh nào có sẵn. Chắn chắn tiếp tục không?","ไม่พบช่องรายการ คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","မည္သည့္ ခ်န္နယ္လိုင္းမွ် မရႏိုင္ပါ။ ဆက္လုပ္မလား?","Kanal yo'q. Davom etmoqchi ekaningizga ishonchingiz komilmi?","कोई चैनल उपलब्ध नहीं है. आगे बढ़ें ?","Канали відсутні. Продовжити?","Tiada saluran disediakan. Pasti meneruskan?","אין ערוצים זמינים. האם אתה בטוח שתרצה להמשיך?","Nejsou k dispozici žádné kanály. Chcete pokračovat?","Nie sú k dispozícii žiadne kanály. Chcete pokračovať?","Brak dostępnych kanałów. Czy chcesz kontynuować?","Nincs elérhető csartorna. Biztosan folytatja?","Няма налични канали. Сигурни ли сте, че желаете да продължите?","کانالی موجود نیست. ادامه می‌دهید؟","Tidak ada saluran yang ditemukan. Anda yakin ingin melanjutkan?","N/A"],
