    "Automatically send usage informaiton, statistics, and crash reports to Hisense.":["自动发送使用信息，统计信息和崩溃报告给海信。","Automatically send usage informaiton, statistics, and crash reports to Hisense.","Nutzerdaten, Statistiken und Fehlermeldungen automatisch an Hisense senden.","Invia automaticamente informazioni di uso, statistiche e segnalazione di crash a Hisense","Automaticamente enviar informações de uso, estatística e relatórios da Hisense.","Envía automáticamente información de uso, estadísticas y el informe de denuncia a Hisense.","Envoi automatiquement les informations d'utilisation, les statistiques, et les rapports d'erreurs à Hisense .","Send bruksinformasjon, statistikk, og feilrapporter til Hisense.","Skicka automatiskt användningsinformation, statistik, och kraschrapport till Hisense. ","Send automatisk forbrugsinformation, statistik, og fejlrapport til Hisense.","Lähetä automaattisesti käyttötietoja, tilastoja sekä kaatumisilmoituksia Hisensille.","Kullanım bilgilerini, istatistikleri ve çökme raporlarını Hisense'e otomatik olarak gönderin.","إرسال معلومات الاستخدام، والإحصاءات، وتقرير الأعطال الى هايسنس تلقائيا.","Автоматически отправляет в Hisense информацию об использовании, статистику и отчеты о сбоях.","Tự động gửi thông tin sử dụng, thống kê và báo cáo tai nạn tới Hisense.","ส่งข้อมูลการใช้ สถิติและรายงานความล้มเหลวโดยอัตโนมัติ","အသံုးျပဳမႈ အခ်က္အလက္၊ စာရင္းဇယားႏွင့္ ျပႆနာ အစီရင္ခံခ်က္ကို Hisense သို႔ အလိုအေလ်ာက္ ေပးပို႔ပါ။","Hisense'ga foydalanish haqida ma'lumotlar, statistika va nosozlik hisobotlarini avtomatik tarzda jo'nating.","हाईसेंस को यूसेज सूचना, डाटा और क्रैश रिपेर्ट स्वचलित भेजें ","Автоматично відправляє в Hisense інформацію про використання, статистику та звіти про збої.","Menghantar maklumat penggunaan, statistik, dan laporan ranap Hisense secara automatik.","שלח באופן אוטומטי פרטי שימוש, סטטיסטיקות ודו\"חות קריסה של Hisense. ","Automatické odesílání informací o využití, statistiky a zprávy o poruchách pro Hisense.","Automatické odosielanie informácií o využívaní, štatistík, a správ o poruchách pre Hisense.","Automatycznie wysyłaj informacje o użytkowaniu, statystyki i raporty błędów do Hisense.","Automatikusan küldjön használattal kapcsolatos információt, statisztikákat és összeomlás-jelentést a Hisense-nek.","Автоматично изпращане на данни за употребата, статистики и отчети за срив към Hisense.","به طور خودکار اطلاعات کاربری، آمارها و گزارش Hisense را ارسال می‌کند.","Mengirimkan informasi pengguna, statistik, dan laporan kerusakan ke Hisense secara otomatis.","N/A"],
