    "Automatically send usage informaiton, statistics and crash report to us.":["自动发送使用信息，状态和系统故障给我们.","Automatically send usage informaiton, statistics and crash report to us.","Benutzerdaten, Statistiken und Fehlerberichte autom. an uns senden.","Invio automatico di informazioni di utilizzo, statistiche e report di crash.","Enviar informação de utilização, estatísticas e relatório de crash automaticamente.","Enviarnos automáticamente información de uso, estadísticas e informe de incidencias","Envoyez-nous automatiquement les informations d'utilisation, les statistiques et les rapports d'erreur","Send bruksinformasjon, statistikk og feilrapporter til oss automatisk.","Skicka automatiskt användarinformation, statistik och kraschrapport till oss.","Send automatisk forbrugsinformationer, statistik og fejl-rapporter til os.","Lähettää meille käyttötietoja, statistiikkaa ja kaatumisraportin automaattisesti","Kullanım bilgisini, istatistikleri ve çökme raporunu bize otomatik olarak gönderin.","إرسال تلقائيا جميع معلومات الاستخدام والإحصاءات وتقرير الفشل النا.","Автоматически отправляет нам информацию об использовании, статистику и отчеты о сбоях.","Tự động gửi các thông tin, thống kê và báo cáo sự cố hữu ích cho chúng tôi.","ส่งข้อมูลการใช้ สถิติ และความล้มเหลวมายังเราโดยอัตโนมัติ ","အခ်က္ျပ မရွိပါ","Foydalanish haqidagi ma'lumotlar, statistika va xatolik hisobotlarini bizga avtomatik tarzda jo'nating.","यूसेज सूचना, सांख्यिकि और क्रैश रिपोर्ट हमें स्वत: भेजें","Автоматично відправляє нам інформацію про використання, статистику та звіти про збої.","Menghantar maklumat penggunaan, statistik dan laporan ranap secara automatik kepada kami.","שלח פרטי שימוש, סטטיסטיקה ודו\"חות קריסה אלינו באופן אוטומטי","Automatické odesílání informací o využití, statistiky a zprávy o poruchách pro nás.","Automatické odosielanie informácií o využívaní, štatistík, a správ o poruchách pre nás.","Automatycznie wysyłaj informacje o użytkowaniu, statystyki i raporty błędów.","Automatikusan küldjön használattal kapcsolatos információt, statisztikákat és összeomlás-jelentést.","Автоматично изпращане към нас на данни за употребата, статистики и отчети за срив.","اطلاعات استفاده، آمار و گزارش خرابی را به صورت خودکار به ما ارسال کنید.","Otomatis mengirim informasi penggunaan, statistik dan laporan macet kepada kami.","N/A"],
