    "CI Plus Network search schedule time reached,you may search to update network!":["","CI Plus Network search schedule time reached,you may search to update network!","Zeitlimit der CI-Plus-Netzwerksuche erreicht, Sie können nach einer Netzwerk- Aktualisierung suchen! ","Schedulazione della ricerca della rete CI Plus Network ottenuta, si può aggiornare la rete.","Hora de agendamento de procura da Rede CI Plus atingida, pode procurar para atualizar a rede!","Programación de búsqueda de red Plus CI alcanzada - puede buscar para actualizar la red","La durée planifiée pour une recherche de Réseau CI+ est dépassée, il est recommandé d'effecter une mise à jour réseau!","CI Plus planlagt søk, søk for å oppdatere nettverket!","CI Plus Nätverkssökning schemalagd tid nått, du måste söka för att uppdatera nätverk!","CI Plus Netsøgning tidsplan tid nået, søg for at opdatere netværk!","CI plus verkon haulle asetettu aika on saavutettu; voit hakea päivittääksesi verkon!","CI Plus Ağı arama planı zamanına ulaşıldı; ağı güncellemek için arama yapabilirsiniz!","انتهت مهلة زمن جدولة شبكة CI+ ، يمكنك البحث لتحديث الشبكة!","Пришло время поиска сети CI+, можно выполнить поиск новой сети!","Thời gian tiến độ tìm kiếm Mạng CI Plus đã đạt được, quý vị có thể tìm kiếm để cập nhật mạng!","ถึงเวลาตามที่กำหนดไว้สำหรับการค้นหาเครือข่าย CI+ คุณอาจทำการค้นหาเพื่ออัปเดทเครือข่าย!","CI Plus ကြန္ယက္ ရွာေဖြမႈ သတ္မွတ္ခ်ိန္ ရွာထားသည္၊ ကြန္ယက္ အပ္ဒိတ္လုပ္ရန္ သင္ ရွာႏိုင္သည္!","CI Plus tarmog'ini izlash vaqtiga yetdi, tarmoqni yangilash uchun izlashingiz mumkni!","CI+ नेटवर्क खोजने का समय, नेटवर्क को अपडेट करने के लिए खोजें","Прийшов час пошуку мережі CI Plus, можна виконати пошук нової мережі!","CI Plus Network masa jadual carian dicapai, anda boleh mencari untuk mengemaskini rangkaian!","הגיע השעה לחיפוש הקבוע בלו\"ז של רשת CI+, אתה יכול לחפש עדכון לרשת! ","Časový rozvrh vyhledávání CI Plus Sítě byl dosažen, můžete vyhledávat pro aktualizaci sítě!","Časový rozvrh vyhľadávania CI Plus Siete bol dosiahnutý, môžete vyhľadávať pre aktualizovanie siete!","Nadszedł zaplanowany czas wyszukiwania sieci CI Plus, możesz wyszukać, aby zaktualizować sieć!","A Cl Plus hálózat keresésre előirányzott idő elérve, kereshet a hálózat frissítése érdekében!","Достигнат времеви лимит за търсене на CI Plus мрежа, можете да потърсите актуализация на мрежата!","زمان جستجوی برنامه‌ریزی‌شده شبکه CI Plus فرا رسیده است، می‌توانید برای به‌روزرسانی شبکه جستجو کنید! ","Waktu jadwal pencarian Jaringan CI Plus dicapai, Anda dapat mencari untuk memperbarui jaringan!","N/A"],
