    "Delete all planned recordings?":["是否清除所有预约记录","Delete all planned recordings?","Werden alle reservierten Aufnahmen gelöscht oder nicht?","Eliminare tutte le registrazioni pianificate?","Todos os registo de reserva são apagados ou não?","¿Todos los registros de reserva se borran o no? ","Si toutes les programmations d'enregistrements seront effacées ou non?","Skal alle reservasjoner slettes?","Om alla reservationsposter är raderade eller inte?","Hvis alle reservation registreringer slettes eller ej?","Poistetaanko kaikki varaukset vai ei?","Tüm ayırma kayıtları silinsin mi silinmesin mi?","هل تريد مسح جميع التسجيلات المسبقله؟","Удалить все запланированные записи?","Liệu tất cả các lịch ghi âm được xoá hoàn toàn hay không?","หากการบันทึกตามที่ตั้งเวลาทั้งหมดถูกลบแล้ว จะตกลงหรือไม่","ႀကိဳတင္မွတ္တမ္း အားလံုးကို ဖ်က္မလား (သို႔) မဖ်က္ဘူးလား?","Barcha zaxira yozishlar o'chirilsinmi yoki yo'qmi?","सारे रिज़र्वेशन रिकार्ड मिट गए या नहीं ?","Всі зарезервовані записи стерті чи ні?","Jika semua rekod tempahan dipadamkan atau tidak?","האם למחוק את כל ההקלטות השמורות או לא?","Pokud jsou všechny záznamy rezervace vymazány, nebo ne?","Ak sú všetky záznamy rezervácie vymazané, alebo nie?","Usunąć wszystkie zaplanowane nagrywania?","Valamennyi előirányzott felvételt törölje?","Изтрити ли са всички записвания по план?","همه ضبط های رزرو شده پاک شوند یا خیر؟","Apakah semua rekaman terjadwal dihapus atau tidak?","N/A"],
