    "Two channels are already recording. Can't switch the channel!":["已经有两路录制，无法进行切台！","Two channels are already recording. Can't switch the channel!","Es werden bereits zwei Sender aufgezeichnet. Sender kann nicht gewechselt werden!","È in corso la registrazione di due canali. Non è possibile cambiare canale!","Dois canais já estão a gravar. Não é possível mudar o canal.","Los dos canales ya están grabando. ¡No se puede cambiar el canal!","Deux chaînes sont déjà en cours d'enregistrement. Impossible de changer de chaîne!","To kanaler er allerede under innspilling. Kan ikke bytte kanal!","Två kanaler spelar redan in. Kan inte växla kanalen!","To kanaler optager allerede. Kan ikke skifte kanalen.","Tallennus on käynnnissä jo kahdella kanavalla. Et voi vaihtaa kanavaa!","İki kanal zaten kaydediyor. Kanal değiştirilemez!","جار التسجيل في قناتين. لا يمكن تبديل القناة!","Два канала уже записываются. Нельзя переключить канал!","Hai kênh đang được thu âm lại. Không thể chuyển kênh!","มีช่องรายการสองช่องถูกทำการบันทึกแล้ว ไม่สามารถสลับช่องได้!","ခ်န္နယ္လိုင္း ႏွစ္ခုသည္ ဖမ္းယူေနၿပီးျဖစ္သည္။ ခ်န္နယ္လိုင္း ေျပာင္း၍မရပါ!","Ikki kanal allaqachon yozmoqda. Kanalga o'tib bo'lmaydi!","दो चैनल रिकार्डिंग कर रहे हैं. चैनल बदल नहीं सकते.","Два канали вже записуються. Не можна перемкнути канал!","Dua saluran dalam rakaman. Tidak boleh beralih saluran!","שני ערוצים מקליטים כבר. אינכם יכולים להחליף ערוץ!","Dva kanály se již nahrávají. Není možné přepnout kanál!","Dva kanály sa už nahrávajú. Nie je možné prepnúť kanál!","Obecnie nagrywane są dwa kanały. Nie można zmienić kanału!","Két csatornán már felvétel készül. Nem válthat csatornát!","Два канала са вече на запис. Каналът не може да бъде превключен!","دو کانال در حال ضبط هستند. امکان تعویض کانال وجود ندارد!","Dua saluran telah direkam. Tidak dapat mengganti saluran!","N/A"],
