    "Disconnection. Are you sure you want to continue?":["即将断开连接是否继续","Disconnection. Are you sure you want to continue?","Verbindung wird getrennt. Wirklich fortfahren?","Disconnessione. Sei sicuro di voler continuare?","Para desligar. Tem a certeza que quer continuar?","Para desconectar. ¿Quiere continuar?","Déconnection. Etes vous sur de vouloir continuer?","Koble fra. Er du sikker på at du vil fortsette?","Koppla bort. Är du säker på att du vill fortsätta?","Hvis du vil afbryde. Sikker på at du vil fortsætte?","Haluatko katkaista yhteyden?","Bağlantıyı kesmek için. Devam etmeye emin misiniz?","قطع الاتصال. هل تريد المتابعة؟","Отключение. Хотите продолжить?"," Ngắt kết nối. Chắn chắn tiếp tục không?","สำหรับการตัดการเชื่อมต่อนี้ คุณแน่ใจว่าต้องการดำเนินการหรือไม่","ခ်ိတ္ဆက္မႈ ျဖဳတ္ရန္။ ဆက္လုပ္မလား?","Uzish. Davom etmoqchi ekaningizga ishonchingiz komilmi?","डिस्कनेक्ट कर दें. आगे बढ़ें ?","Відключити. Продовжити?","Untuk memutuskan sambungan. Pasti meneruskan?","לנתק. האם אתה בטוח שתרצה להמשיך?","Odpojení Chcete pokračovat?","Odpojenie Chcete pokračovať?","Odłączanie. Czy chcesz kontynuować?","Kapcsolat bontása Biztosan folytatja?","Прекъсване. Сигурни ли сте, че желаете да продължите?","قطع اتصال. ادامه می‌دهید؟","Untuk memutus sambungan. Anda yakin ingin melanjutkan?","N/A"],
    "Device XXX requests connection. Are you sure you want to continue?":["设备XXX请求连接，是否继续","Device XXX requests connection. Are you sure you want to continue?","Verbindungsanforderung durch Gerät XXX. Wirklich fortfahren?","Il dispositivo XXX richiede la connessione. Sei sicuro di voler continuare?","O dispositivo XXX solicita ligação. Tem a certeza que quer continuar?","El dispositivo XXX solicita la conexión. ¿Quiere continuar?","Le périphérique XXX nécessite une connexion. Etes vous sur de vouloir continuer?","Enheten XXX ber om tilkobling. Er du sikker på at du vil fortsette?","Enheten XXX begär anslutning. Är du säker på att du vill fortsätta?","Enhed XXX anmoder om tilslutning. Sikker på at du vil fortsætte?","Laite XXX pyytää yhteyttä. Haluatko jatkaa?","Aygıt XXX bağlantı istiyor. Devam etmeye emin misiniz?","الجهاز XXX يطلب الاتصال. هل تريد المتابعة؟","Устройство XXX запрашивает подключение. Продолжить?"," Dịch vụ XXX yêu cầu kết nối. Chắn chắn tiếp tục không?","อุปกรณ์ XXX ร้องขอการเชื่อมต่อ คุณแน่ใจว่าต้องการดำเนินการต่อหรือไม่","ကိရိယာ XXX သည္ ခ်ိတ္ဆက္မႈ ေတာင္းဆိုထားသည္။ ဆက္လုပ္မလား?","XXX qurilma ulanishni so'rayapti. Davom etmoqchi ekaningizga ishonchingiz komilmi?","डिवाईस XXX कनेक्शन की मांग कर रहा. आगे बढ़ें ?","Пристрій XXX запрошує підключення. Продовжити?","Peranti XXX meminta sambungan. Pasti meneruskan?","המכשיר XXX דורש חיבור. האם אתה בטוח שתרצה להמשיך?","Zařízení XXX požaduje připojení. Chcete pokračovat?","Zariadenie XXX požaduje pripojenie. Chcete pokračovať?","Urządzenie XXX zgłasza żądanie połączenia. Czy chcesz kontynuować?","Az XXX eszköz-t csatlakoztatni kell. Biztosan folytatja?","Устройството ХХХ заяви свързване. Сигурни ли сте, че желаете да продължите?","دستگاه XXX درخواست اتصال دارد. ادامه می‌دهید؟","Perangkat XXX meminta sambungan. Anda yakin ingin melanjutkan?","N/A"],
