    "Insufficient system memory. The current app will be closed.":["系统资源不足，当前应用将关闭","Insufficient system memory. The current app will be closed.","Systemspeicher unzureichend. Die aktuelle App wird beendet.","Memoria di sistema insufficiente. L'app in uso verrà chiusa.","Memória de sistema insuficiente. O aplicativo actual será fechado.","El sistema no tiene memoria suficiente. La aplicación actual se cerrará","Le système ne dispose pas d'une mémoire suffisante. L'application en cours sera arrêtée.","Det er for lite systemminne. Den gjeldende applikasjonen vil bli lukket.","Det finns otillräckligt med systemminne. Den pågående appen kommer att stängas.","Der er utilstrækkelig systemhukommelse. Den aktuelle app lukkes.","Järjestelmän muisti riittämätön. Sammutetaan käynnissä oleva sovellus.","Sistem hafızası yetersiz durumda. Geçerli uygulama kapatılacak.","ذاكرة غير كافية. سيتم إغلاق التطبيق الحالي.","Не хватает системной памяти. Текущее приложение будет закрыто.","Bộ nhớ hệ thống không đủ. Các ứng dụng hiện tại sẽ được đóng lại.","หน่วยความจำของระบบไม่เพียงพอ แอพปัจจุบันจะถูกปิด","စနစ္ မန္မိုရီ မလံုေလာက္ပါ။ လက္ရွိ အက္ကို ပိတ္မည္။","Tizim xotira joyi yetarli emas. Joriy ilova yopiladi.","सिस्टम की मेमरी पर्याप्त नहीं है. मौजूदा एप बंद हो जाएगा.","Не вистачає системної пам'яті. Поточну програму буде закрито.","Memori sistem yang tidak mencukupi. App semasa akan ditutup.","אין מספיק זכרון במערכת. היישומון הנוכחי ייסגר","Nedostatek systémové paměti. Současná aplikace se zavře.","Nedostatok systémovej pamäte. Súčasná aplikácia sa zatvorí.","Niewystarczająca pamięć systemu. Bieżąca aplikacja zostanie zamknięta.","Nincs elegendő memória a rendszerben. Az aktuális alkalmazás bezáródik.","Недостатъчна системна памет.","حافظه سیستم فعلی ناکافیست. برنامه فعلی بسته خواهد شد.","RAM tidak cukup. Aplikasi saat ini akan ditutup.","N/A"],
    "There is no network found. Some apps will be unavailable.":["网络不可用，可能会导致部分应用无法使用","There is no network found. Some apps will be unavailable.","Es wurde kein Netzwerk gefunden. Einige Apps sind nicht verfügbar.","Nessuna rete rilevata. Alcune app non saranno utilizzabili.","Rede não encontrada. Alguns aplicativos não estarão disponíveis.","No se ha encontrado una red. Algunas aplicaciones no estarán disponibles.","Pas de connexion réseau trouvé. Certaines applications ne seront pas disponibles.","Det ble ikke funnet noen nettverk. Noen applikasjoner vil være utilgjengelig.","Inget nätverk hittas. Vissa appar kommer att vara otillgängliga.","Der er ikke fundet noget netværk. Nogle apps vil derfor være utilgængelige.","Verkkoyhteyttä ei saatavilla. Joitain sovelluksia ei saatavilla.","Hiç ağ bulunamadı. Bazı uygulamalar mevcut olmayacak.","ليس هناك شبكة اتصال. بعض التطبيقات لن تعمل.","Сеть не найдена. Некоторые приложения будут недоступны.","Không tìm thấy mạng. Các ứng dụng sẽ không sẵn sàng.","ไม่พบเครือข่ายใดๆ บางแอพจะไม่สามารถใช้บริการได้","မည္သည့္ ကြန္ယက္မွ် မေတြ႕ပါ။ အခ်ဳိ႕ အက္ပ္မ်ား မရႏိုင္ပါ။","Birorta ham tarmoq topilmadi. Ayrim ilovalardan foydalanib bo'lmaydi.","कोई नेटवर्क नहीं मिला. कुछ एप्स उपलब्ध नहीं होंगे.","Мережа не знайдена. Деякі програми будуть недоступні.","Tiada rangkaian dijumpai. Sesetengah app tidak akan tersedia.","לא נמצאו רשתות. חלק מהיישומים יהיו לא זמינים","Nebyla nalezena žádná síť. Některé aplikace nebudou k dispozici.","Nebola nájdená žiadna sieť. Niektoré aplikácie nebudú k dispozícii.","Nie znaleziono sieci. Wybrane aplikacje mogą być niedostępne.","Nem található hálózat. Egyes alkalmazások nem lesznek elérhetők.","Няма намерена мрежа. Някои от приложенията няма да бъдат достъпни.","هیچ شبکه‌ای یافت نشد. بعضی شبکه‌ها ناموجود خواهند بود.","Tidak ada jaringan. Beberapa aplikasi akan tidak tersedia.","N/A"],
