    "Uncover hidden colours, vibrant contrast and better brightness for a more accurate image.":["","Uncover hidden colours, vibrant contrast and better brightness for a more accurate image.","Machen Sie versteckte Farben sichtbar und sorgen Sie für einen lebendigeren Kontrast und mehr Helligkeit, um ein noch akkurateres Bild zu erzeugen.","Scopri colori nascosti, colori accesi e migliore luminosità per un'immagine più accurata.","Descubra as cores escondidas, contraste vibrante e melhor brilho para uma imagem mais precisa.","Descubra colores ocultos, contrastes vibrante y el mejor brillo para una imagen más precisa.","Afficher des couleurs cachées, un contraste dynamique et une meilleure luminosité pour une image encore plus précise .","Se nye farger, levende kontraster og en bedre lysstyrke for et mer reelt bilde.","Avslöja dolda färger, vibrerande kontrast och bättre ljusstyrka för en mer korrekt bild.","Opdag skjulte farver, levende kontrast og bedre lysstyrke for et mere præcist billede.","Paljastaa piilossa olevia värejä, eloisa kontrasti ja parempi kirkkaus takaa tarkemman kuvan. ","Daha mükemmel görüntü deneyimi için saklı renkleri, canlı karşıtlığı ve daha iyi parlaklığı keşfedin.","كشف الألوان الخفية، والتباين الحيوي والسطوع الافضل للحصول على صورة أكثر دقة.","Откройте скрытые цвета, выразительный контраст и улучшенную яркость для получения более точных изображений.","Khám phá các màu sắc ẩn, độ tương phản sống động và độ sáng tốt hơn cho một hình ảnh chính xác hơn.","เปิดเผยสีที่ถูกซ่อนอยู่ ความคมชัดที่มีชีวืตชีวาและความสว่างที่ดีกว่าสำหรับภาพที่มีความแม่นยำมากขึ้น","ပိုမိုတိက်သည့္ ႐ုပ္ပံုထြက္ရန္ ဝွက္ထားသည့္အေရာင္မ်ား၊ ျမဴးႂကြသည့္ အေရာင္အေသြး ျခားနားခ်က္မ်ားႏွင့္ ပိုမို ေတာက္ပမႈမ်ား ေဖာ္ထုတ္ပါ။","Yanada aniq tasvir uchun yashirin ranglar, jonli kontrast va yanada yaxshiroq yorqinlikni oching.","अच्छी इमेज के लिए छुपे हुए रंगों, विविध कांट्रास्ट और बेहतर ब्राईटनेस को निकालें ","Виявляйте приховані кольори, виразний контраст і поліпшену яскравість для отримання більш точних зображень.","Dedahkan warna tersembunyi, kontras bertenaga dan kecerahan yang lebih baik untuk imej yang lebih tepat.","גלה צבעים חבויים, ניגודיות חיה ובהירות טובה יותר בשביל תמונות מדוייקות יותר","Odhalte skryté barvy, živý kontrast a lepší jas pro přesnější obraz.","Odhaľte skryté farby, živý kontrast a lepší jas pre presnejší obraz.","Odkryj ukryte kolory, intensywny kontrast i lepszą jasność dla uzyskania bardziej wyraźnego obrazu.","Fedje fel a rejtett színeket, az élénk kontrasztot és a nagyobb fényerőt az élethűbb képekért.","Открийте скрити цветове, жив контраст и по-добра яркост за по-точен образ.","رنگ‌های پنهان را آشکار کنید، تضاد زنده را ببینید و از روشنایی بهتر برای داشتن تصویر دقیق‌تر لذت ببرید.","Ungkap warna tersembunyi, kontras dan kecerahan yang lebih baik untuk gambar yang lebih akurat.","N/A"],
